    "description": "**Depeche Mode \u043A\u0430\u043A \u0441\u043C\u044B\u0441\u043B \u0436\u0438\u0437\u043D\u0438**\n\u041A\u0440\u0443\u0433\u043E\u0441\u0432\u0435\u0442\u043D\u0430\u044F \u043F\u0430\u043D\u043E\u0440\u0430\u043C\u0430, \u043F\u043E\u043A\u0430\u0437\u044B\u0432\u0430\u044E\u0449\u0430\u044F \u043E\u0431\u044B\u0447\u0430\u0438 \u0438 \u0442\u0440\u0430\u0434\u0438\u0446\u0438\u0438 \u043F\u043E\u043A\u043B\u043E\u043D\u043D\u0438\u043A\u043E\u0432 Depeche Mode \u043F\u043E \u0432\u0441\u0435\u043C\u0443 \u043C\u0438\u0440\u0443: \u043E\u0442 \u0420\u043E\u0441\u0441\u0438\u0438 \u0434\u043E \u0418\u0440\u0430\u043D\u0430. \u041E\u0442\u043F\u0440\u0430\u0432\u0438\u0432\u0448\u0438\u0441\u044C \u0441\u043D\u0438\u043C\u0430\u0442\u044C \u043F\u0430\u0440\u0430\u0434\u043D\u0443\u044E \u043A\u0430\u0440\u0442\u0438\u043D\u0443, \u0440\u0430\u0441\u0441\u043A\u0430\u0437\u044B\u0432\u0430\u044E\u0449\u0443\u044E \u043E \u0442\u043E\u043C, \u043A\u0430\u043A \u043B\u044E\u0431\u044F\u0442 \u0433\u0440\u0443\u043F\u043F\u0443 Depeche Mode \u0437\u0430 \u043F\u0440\u0435\u0434\u0435\u043B\u0430\u043C\u0438 \u0411\u0440\u0438\u0442\u0430\u043D\u0438\u0438, \u0430\u0432\u0442\u043E\u0440\u044B \u0444\u0438\u043B\u044C\u043C\u0430 \u0441\u0442\u043E\u043B\u043A\u043D\u0443\u043B\u0438\u0441\u044C \u0441 \u0442\u0435\u043C, \u0447\u0442\u043E \u043B\u044E\u0431\u043E\u0432\u044C \u044D\u0442\u0430 \u043F\u043E\u0434\u0447\u0430\u0441 \u043D\u043E\u0441\u0438\u0442 \u043E\u0447\u0435\u043D\u044C \u043B\u0438\u0447\u043D\u044B\u0439 \u2014 \u0438 \u0432 \u0442\u043E \u0436\u0435 \u0432\u0440\u0435\u043C\u044F \u043E\u0431\u0449\u0435\u043D\u0430\u0446\u0438\u043E\u043D\u0430\u043B\u044C\u043D\u044B\u0439 \u2014 \u0445\u0430\u0440\u0430\u043A\u0442\u0435\u0440.\n",
