    "director": "\u0414\u0436\u0435\u0444\u0444\u0440\u0438 \u041B\u0435\u0432\u0438-\u0425\u0438\u043D\u0442\u0435",
    "country": "\u0421\u0428\u0410",
    "year": "2008",
    "duration": 92,
    "description": "\u041C\u0443\u0445\u0430\u043C\u043C\u0435\u0434 \u0410\u043B\u0438 \u043F\u0440\u043E\u0442\u0438\u0432 \u0414\u0436\u0435\u0439\u043C\u0441\u0430 \u0411\u0440\u0430\u0443\u043D\u0430\n\u0425\u0440\u043E\u043D\u0438\u043A\u0430 \u0442\u0440\u0435\u0445\u0434\u043D\u0435\u0432\u043D\u043E\u0433\u043E \u0441\u043E\u0443\u043B-\u0444\u0435\u0441\u0442\u0438\u0432\u0430\u043B\u044F \u0432 \u0417\u0430\u0438\u0440\u0435 \u0432 1974 \u0433\u043E\u0434\u0443, \u043F\u0440\u0438\u0443\u0440\u043E\u0447\u0435\u043D\u043D\u043E\u0433\u043E \u043A \u0438\u0441\u0442\u043E\u0440\u0438\u0447\u0435\u0441\u043A\u043E\u043C\u0443 \u0431\u043E\u044E \u041C\u0443\u0445\u0430\u043C\u043C\u0435\u0434\u0430 \u0410\u043B\u0438 \u043F\u0440\u043E\u0442\u0438\u0432 \u0414\u0436\u043E\u0440\u0434\u0436\u0430 \u0424\u043E\u0440\u043C\u0430\u043D\u0430 (\u0442\u0430\u043A\u0436\u0435 \u0438\u0437\u0432\u0435\u0441\u0442\u043D\u043E\u0433\u043E \u043A\u0430\u043A Rumble in the Jungle), \u2014 \u043A\u0440\u043E\u0432\u044C, \u043F\u043E\u0442 \u0438 \u0414\u0436\u0435\u0439\u043C\u0441 \u0411\u0440\u0430\u0443\u043D, \u0441\u0430\u0434\u044F\u0449\u0438\u0439\u0441\u044F \u043D\u0430 \u0448\u043F\u0430\u0433\u0430\u0442 \u043D\u0430 \u0433\u043B\u0430\u0437\u0430\u0445 \u0443 \u0441\u0442\u043E\u0442\u044B\u0441\u044F\u0447\u043D\u043E\u0433\u043E \u0441\u0442\u0430\u0434\u0438\u043E\u043D\u0430. \u0421\u043A\u0440\u043E\u0435\u043D\u043D\u044B\u0439 \u0438\u0437 \u0442\u043E\u0433\u043E \u0436\u0435 \u0430\u0440\u0445\u0438\u0432\u043D\u043E\u0433\u043E \u043C\u0430\u0442\u0435\u0440\u0438\u0430\u043B\u0430, \u0447\u0442\u043E \u043B\u0435\u0433 \u0432 \u043E\u0441\u043D\u043E\u0432\u0443 \u0437\u043D\u0430\u043C\u0435\u043D\u0438\u0442\u043E\u0439 \u0431\u043E\u043A\u0441\u0435\u0440\u0441\u043A\u043E\u0439 \u043B\u0435\u043D\u0442\u044B \u00ABWhen We Were Kings\u00BB, \u044D\u0442\u043E\u0442 \u0444\u0438\u043B\u044C\u043C \u043F\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043B\u044F\u0435\u0442 \u0441\u043E\u0431\u043E\u0439 \u043F\u043E\u0448\u0430\u0433\u043E\u0432\u0443\u044E \u0438\u043D\u0441\u0442\u0440\u0443\u043A\u0446\u0438\u044E \u00AB\u041A\u0430\u043A \u0441\u0434\u0435\u043B\u0430\u0442\u044C \u0433\u0440\u043E\u043C\u0430\u0434\u043D\u044B\u0439 \u0444\u0435\u0441\u0442\u0438\u0432\u0430\u043B\u044C \u0432 \u0410\u0444\u0440\u0438\u043A\u0435: \u043E\u0442 \u043F\u0435\u0440\u0432\u043E\u0439 \u0433\u0430\u0439\u043A\u0438 \u0434\u043E \u043F\u043E\u0441\u043B\u0435\u0434\u043D\u0435\u0439 \u043F\u0435\u0441\u043D\u0438\u00BB.\n",
