    "nameRU": "\u041C\u0435\u0436\u0434\u0443 \u0434\u044C\u044F\u0432\u043E\u043B\u043E\u043C \u0438 \u0433\u043B\u0443\u0431\u043E\u043A\u0438\u043C \u0441\u0438\u043D\u0438\u043C \u043C\u043E\u0440\u0435\u043C",
    "nameEN": "Between the Devil and Wide Blue Sea",
    "director": "\u0420\u043E\u043C\u0443\u0430\u043B\u044C\u0434 \u041A\u0430\u0440\u043C\u0430\u043A\u0430\u0440",
    "country": "\u0413\u0435\u0440\u043C\u0430\u043D\u0438\u044F",
    "year": "2005",
    "duration": 89,
    "description": "\u0423\u0434\u0438\u0432\u0438\u0442\u0435\u043B\u044C\u043D\u0430\u044F \u043E\u0434\u0438\u0441\u0441\u0435\u044F, \u043F\u0440\u043E\u043B\u0438\u0432\u0430\u044E\u0449\u0430\u044F \u0441\u0432\u0435\u0442 \u043D\u0430 \u0435\u0432\u0440\u043E\u043F\u0435\u0439\u0441\u043A\u0443\u044E \u044D\u043B\u0435\u043A\u0442\u0440\u043E\u043D\u043D\u0443\u044E \u0441\u0446\u0435\u043D\u0443 \u043D\u0443\u043B\u0435\u0432\u044B\u0445.\n\u041C\u0443\u0437\u044B\u043A\u0430 \u0437\u0434\u0435\u0441\u044C \u0433\u043E\u0432\u043E\u0440\u0438\u0442 \u0441\u0430\u043C\u0430 \u0437\u0430 \u0441\u0435\u0431\u044F \u2014 \u0432 \u0444\u0438\u043B\u044C\u043C\u0435 \u043D\u0435\u0442 \u043D\u0438 \u0435\u0434\u0438\u043D\u043E\u0433\u043E \u0438\u043D\u0442\u0435\u0440\u0432\u044C\u044E, \u0442\u043E\u043B\u044C\u043A\u043E \u043F\u043E\u0441\u0442\u0440\u043E\u0435\u043D\u043D\u044B\u0435 \u043D\u0430 \u0434\u043B\u0438\u043D\u043D\u044B\u0445 \u043F\u043B\u0430\u043D\u0430\u0445 \u0441\u044A\u0435\u043C\u043A\u0438 \u0436\u0438\u0432\u044B\u0445 \u0432\u044B\u0441\u0442\u0443\u043F\u043B\u0435\u043D\u0438\u0439 \u043D\u0430 \u0441\u0430\u043C\u044B\u0445 \u0440\u0430\u0437\u043D\u044B\u0445 \u043F\u043B\u043E\u0449\u0430\u0434\u043A\u0430\u0445, \u043E\u0442 \u043A\u043B\u0443\u0431\u0430 Cocoon \u043D\u0430 \u0418\u0431\u0438\u0446\u0435 \u0434\u043E \u0442\u0435\u0441\u043D\u044B\u0445 \u043B\u043E\u043D\u0434\u043E\u043D\u0441\u043A\u0438\u0445 \u0437\u0430\u043B\u043E\u0432. \u0412 \u043A\u0430\u043C\u0435\u0440\u0443 \u043F\u043E\u043F\u0430\u0434\u0430\u044E\u0442 \u043A\u0430\u043A \u043C\u0430\u043B\u043E-\u043C\u0430\u043B\u044C\u0441\u043A\u0438 \u0438\u0437\u0432\u0435\u0441\u0442\u043D\u044B\u0435 \u0444\u0438\u0433\u0443\u0440\u044B \u2014 T.Raumschmiere, Alter Ego, Captain Comatose, \u0442\u0430\u043A \u0438 \u043C\u0435\u043D\u0435\u0435 \u043E\u0447\u0435\u0432\u0438\u0434\u043D\u044B\u0435 \u043B\u044E\u0434\u0438. \u0412\u043F\u0440\u043E\u0447\u0435\u043C, \u0433\u043B\u0430\u0432\u043D\u043E\u0435 \u0437\u0434\u0435\u0441\u044C \u0432\u043E\u0432\u0441\u0435 \u043D\u0435 \u0438\u043C\u0435\u043D\u0430, \u0430 \u0442\u043E\u0447\u043D\u043E \u043F\u0435\u0440\u0435\u0434\u0430\u043D\u043D\u043E\u0435 \u043E\u0449\u0443\u0449\u0435\u043D\u0438\u0435 \u0441\u043E\u043F\u0440\u0438\u0447\u0430\u0441\u0442\u043D\u043E\u0441\u0442\u0438 \u0432\u0441\u0435\u043C\u0443 \u043F\u0440\u043E\u0438\u0441\u0445\u043E\u0434\u044F\u0449\u0435\u043C\u0443 \u0441 \u044D\u0442\u043E\u0439 \u0441\u0446\u0435\u043D\u043E\u0439. \u0424\u0438\u043B\u044C\u043C \u0431\u044B\u043B \u043F\u043E\u043A\u0430\u0437\u0430\u043D \u043D\u0430 \u043C\u043D\u043E\u0433\u0438\u0445 \u043C\u0435\u0436\u0434\u0443\u043D\u0430\u0440\u043E\u0434\u043D\u044B\u0445 \u043A\u0438\u043D\u043E\u0444\u0435\u0441\u0442\u0438\u0432\u0430\u043B\u044F\u0445, \u0442\u0430\u043A\u0438\u0445 \u043A\u0430\u043A \u0444\u0435\u0441\u0442\u0438\u0432\u0430\u043B\u044C \u0432 \u041B\u043E\u043A\u0430\u0440\u043D\u043E \u0438 \u0444\u0435\u0441\u0442\u0438\u0432\u0430\u043B\u044C Sonar, \u0438 \u0441\u0442\u0430\u043B \u043B\u0443\u0447\u0448\u0438\u043C \u043D\u0435\u043C\u0435\u0446\u043A\u0438\u043C \u0434\u043E\u043A\u0443\u043C\u0435\u043D\u0442\u0430\u043B\u044C\u043D\u044B\u043C \u0444\u0438\u043B\u044C\u043C\u043E\u043C 2005-\u0433\u043E \u0433\u043E\u0434\u0430 \u043F\u043E \u0432\u0435\u0440\u0441\u0438\u0438 \u043A\u0430\u043D\u0430\u043B\u0430 ARTE.\n",
