    "director": "\u041D\u0430\u0442\u0430\u043B\u0438\u044F \u041C\u0435\u0449\u0430\u043D\u0438\u043D\u043E\u0432\u0430",
    "country": "\u0420\u043E\u0441\u0441\u0438\u044F",
    "year": "2012",
    "duration": 46,
    "description": "\u0424\u0438\u043B\u044C\u043C-\u043A\u043E\u043D\u0446\u0435\u0440\u0442 \u0433\u0440\u0443\u043F\u043F\u044B \u00AB\u041B\u0435\u043D\u0438\u043D\u0433\u0440\u0430\u0434\u00BB, \u0433\u0434\u0435 \u0433\u0435\u0440\u043E\u044F\u043C\u0438 \u044F\u0432\u043B\u044F\u044E\u0442\u0441\u044F \u043D\u0435 \u043C\u0443\u0437\u044B\u043A\u0430\u043D\u0442\u044B, \u0430 \u0437\u0440\u0438\u0442\u0435\u043B\u0438. \u0426\u0435\u043B\u043E\u0435 \u044D\u0442\u043D\u043E\u0433\u0440\u0430\u0444\u0438\u0447\u0435\u0441\u043A\u043E\u0435 \u0438\u0441\u0441\u043B\u0435\u0434\u043E\u0432\u0430\u043D\u0438\u0435 \u043D\u0430 \u0442\u0435\u043C\u0443 \u0442\u043E\u0433\u043E, \u043A\u0442\u043E \u0436\u0435 \u0442\u0430\u043A\u0438\u0435 \u043F\u043E\u043A\u043B\u043E\u043D\u043D\u0438\u043A\u0438 \u00AB\u041B\u0435\u043D\u0438\u043D\u0433\u0440\u0430\u0434\u0430\u00BB, \u0432\u044B\u043F\u043E\u043B\u043D\u0435\u043D\u043D\u043E\u0435 \u043F\u0440\u043E\u0442\u0438\u0432 \u0432\u0441\u0435\u0445 \u0437\u0430\u043A\u043E\u043D\u043E\u0432 \u0436\u0430\u043D\u0440\u0430. \u0421\u0430\u043C\u0438 \u043C\u0443\u0437\u044B\u043A\u0430\u043D\u0442\u044B \u0432\u044B\u0441\u0442\u0443\u043F\u0430\u044E\u0442 \u0442\u0443\u0442 \u0441\u043E\u0443\u0447\u0430\u0441\u0442\u043D\u0438\u043A\u0430\u043C\u0438 \u0441\u044A\u0435\u043C\u043E\u0447\u043D\u043E\u0433\u043E \u043F\u0440\u043E\u0446\u0435\u0441\u0441\u0430 \u2014 \u043E\u0434\u043D\u0430 \u0438\u0437 \u043A\u0430\u043C\u0435\u0440, \u043D\u0430\u043F\u0440\u0438\u043C\u0435\u0440, \u0437\u0430\u043A\u0440\u0435\u043F\u043B\u0435\u043D\u0430 \u0443 \u0428\u043D\u0443\u0440\u043E\u0432\u0430 \u043D\u0430 \u0436\u0438\u0432\u043E\u0442\u0435. \u0414\u0440\u0443\u0433\u0438\u0435 \u0436\u0435 \u043A\u0430\u043C\u0435\u0440\u044B \u0441\u043B\u0435\u0434\u0443\u044E\u0442 \u0437\u0430 \u043F\u043E\u043A\u043B\u043E\u043D\u043D\u0438\u043A\u0430\u043C\u0438 \u0433\u0440\u0443\u043F\u043F\u044B, \u0434\u043E\u0432\u043E\u043B\u044C\u043D\u043E \u0441\u043C\u0435\u0448\u043D\u043E \u0438 \u0442\u043E\u0447\u043D\u043E \u0444\u0438\u043A\u0441\u0438\u0440\u0443\u044F \u0438\u0445 \u044D\u043C\u043E\u0446\u0438\u0438 \u0438 \u043F\u043E\u0441\u0442\u0443\u043F\u043A\u0438 \u043E\u0442 \u043E\u0431\u044A\u044F\u0442\u0438\u0439 \u0434\u043E \u0434\u0440\u0430\u043A \u0438 \u043F\u0435\u0440\u0435\u0434\u0430\u0432\u0430\u044F \u0430\u0442\u043C\u043E\u0441\u0444\u0435\u0440\u0443 \u043E\u0433\u043E\u043B\u0442\u0435\u043B\u043E\u0433\u043E \u0432\u0435\u0441\u0435\u043B\u044C\u044F \u0438 \u0437\u0430\u0448\u043A\u0430\u043B\u0438\u0432\u0430\u044E\u0449\u0435\u0433\u043E \u0430\u0434\u0440\u0435\u043D\u0430\u043B\u0438\u043D\u0430, \u043A\u043E\u0442\u043E\u0440\u044B\u043C\u0438 \u0441\u043B\u0430\u0432\u0438\u0442\u0441\u044F \u00AB\u041B\u0435\u043D\u0438\u043D\u0433\u0440\u0430\u0434\u00BB. \u0423\u0436\u0430\u0441\u043D\u043E \u0441\u043C\u0435\u0448\u043D\u043E, \u0434\u043E \u0441\u043B\u0435\u0437 \u043C\u0438\u043B\u043E, \u0432\u0440\u0435\u043C\u0435\u043D\u0430\u043C\u0438 \u0441\u0442\u0440\u0430\u0448\u043D\u043E \u2014 \u044D\u0444\u0444\u0435\u043A\u0442 \u043F\u0440\u0438\u0441\u0443\u0442\u0441\u0442\u0432\u0438\u044F \u0432 \u043F\u043E\u043B\u043D\u044B\u0439 \u0440\u043E\u0441\u0442.",
