    "nameRU": "\u0411\u043E\u0431 \u041C\u0430\u0440\u043B\u0438: \u0420\u044D\u0433\u0433\u0438 \u043D\u0430\u0432\u0441\u0435\u0433\u0434\u0430",
    "nameEN": "Marley",
    "director": "\u041A\u0435\u0432\u0438\u043D \u041C\u0430\u043A\u0434\u043E\u043D\u0430\u043B\u044C\u0434",
    "country": "\u0412\u0435\u043B\u0438\u043A\u043E\u0431\u0440\u0438\u0442\u0430\u043D\u0438\u044F, \u0421\u0428\u0410",
    "year": "2012",
    "duration": 144,
    "description": "\u041F\u043E\u0441\u043B\u0435\u0434\u043D\u0438\u0439 \u0448\u0435\u0434\u0435\u0432\u0440 \u043E\u0441\u043A\u0430\u0440\u043E\u0432\u0441\u043A\u043E\u0433\u043E \u043B\u0430\u0443\u0440\u0435\u0430\u0442\u0430 \u041A\u0435\u0432\u0438\u043D\u0430 \u041C\u0430\u043A\u0414\u043E\u043D\u0430\u043B\u044C\u0434\u0430 \u0438 \u043F\u0435\u0440\u0432\u044B\u0439 \u0444\u0438\u043B\u044C\u043C, \u0430\u0432\u0442\u043E\u0440\u0438\u0437\u043E\u0432\u0430\u043D\u043D\u044B\u0439 \u0441\u0435\u043C\u044C\u0435\u0439 \u0411\u043E\u0431\u0430 \u041C\u0430\u0440\u043B\u0438, \u0432 \u0441\u0432\u043E\u0435\u043C \u0432\u0435\u043B\u0438\u0447\u0438\u0438 \u043D\u0438\u0447\u0443\u0442\u044C \u043D\u0435 \u0443\u0441\u0442\u0443\u043F\u0430\u044E\u0449\u0438\u0439 \u0441\u0432\u043E\u0435\u043C\u0443 \u0433\u043B\u0430\u0432\u043D\u043E\u043C\u0443 \u0433\u0435\u0440\u043E\u044E. \u041E\u0434\u043D\u0430\u043A\u043E \u0433\u043B\u0430\u0432\u043D\u043E\u0435 \u0434\u043E\u0441\u0442\u043E\u0438\u043D\u0441\u0442\u0432\u043E \u0444\u0438\u043B\u044C\u043C\u0430 \u043D\u0435 \u0440\u0435\u0434\u0447\u0430\u0439\u0448\u0438\u0435 \u0437\u0430\u043F\u0438\u0441\u0438, \u043A\u0430\u0434\u0440\u044B \u0438 \u0441\u043B\u043E\u0432\u0430, \u043F\u0440\u043E\u0438\u0437\u043D\u0435\u0441\u0435\u043D\u043D\u044B\u0435 \u0441\u0430\u043C\u0438\u043C \u041C\u0430\u0440\u043B\u0438 \u043D\u0430 \u043F\u043B\u0435\u043D\u043A\u0443, \u043D\u0435 \u044D\u0444\u0444\u0435\u043A\u0442\u043D\u044B\u0435 \u043F\u0440\u043E\u043B\u0435\u0442\u044B \u0441 \u043A\u0430\u043C\u0435\u0440\u043E\u0439 \u043D\u0430\u0434 \u0440\u043E\u0434\u043D\u043E\u0439 \u0434\u0435\u0440\u0435\u0432\u043D\u0435\u0439, \u0432 \u043A\u043E\u0442\u043E\u0440\u044B\u0445 \u041C\u0430\u043A\u0414\u043E\u043D\u0430\u043B\u044C\u0434 \u0443\u043F\u043E\u0434\u043E\u0431\u043B\u044F\u0435\u0442\u0441\u044F \u0424\u0440\u044D\u043D\u0441\u0438\u0441\u0443 \u0424\u043E\u0440\u0434\u0435 \u041A\u043E\u043F\u043F\u043E\u043B\u0435 \u0438 \u0435\u0433\u043E \u00AB\u0410\u043F\u043E\u043A\u0430\u043B\u0438\u043F\u0441\u0438\u0441\u0443 \u0441\u0435\u0433\u043E\u0434\u043D\u044F\u00BB. \u0413\u043B\u0430\u0432\u043D\u043E\u0435 \u2014 \u044D\u0442\u043E \u043E\u0431\u0440\u0430\u0437 \u0436\u0438\u0432\u043E\u0433\u043E \u0447\u0435\u043B\u043E\u0432\u0435\u043A\u0430, \u0441\u043E\u0437\u0434\u0430\u0432\u0430\u0435\u043C\u044B\u0439 \u041C\u0430\u043A\u0414\u043E\u043D\u0430\u043B\u044C\u0434\u043E\u043C: \u043E\u0442\u0446\u0430 \u0434\u0435\u0432\u044F\u0442\u0438 \u0434\u0435\u0442\u0435\u0439 \u043E\u0442 \u0441\u0435\u043C\u0438 \u0440\u0430\u0437\u043D\u044B\u0445 \u0436\u0435\u043D\u0449\u0438\u043D, \u0447\u0435\u043B\u043E\u0432\u0435\u043A\u0430, \u043A\u043E\u0442\u043E\u0440\u044B\u0439 \u0441\u043B\u0435\u0434\u0443\u0435\u0442 \u0443\u043D\u0438\u0432\u0435\u0440\u0441\u0430\u043B\u044C\u043D\u043E\u043C\u0443 \u043D\u0430\u0431\u043E\u0440\u0443 \u043F\u0440\u0430\u0432\u0438\u043B, \u043F\u043E\u0440\u0430\u0436\u0430\u044E\u0449\u0438\u0445 \u0441\u0432\u043E\u0435\u0439 \u043C\u0443\u0434\u0440\u043E\u0441\u0442\u044C\u044E \u0438 \u043F\u0440\u043E\u0441\u0442\u043E\u0442\u043E\u0439, \u043E\u0431\u043B\u0430\u0434\u0430\u0442\u0435\u043B\u044F \u0447\u0435\u0440\u043D\u043E\u0439 \u043A\u043E\u0436\u0438 \u0438 \u00AB\u0431\u0435\u043B\u043E\u0439\u00BB \u0444\u0430\u043C\u0438\u043B\u0438\u0438, \u0447\u044C\u0435\u043C\u0443 \u0443\u0434\u0438\u0432\u0438\u0442\u0435\u043B\u044C\u043D\u043E\u043C\u0443 \u0433\u043E\u043B\u043E\u0441\u0443 \u043F\u043E\u043A\u043E\u0440\u044F\u043B\u0438\u0441\u044C \u043D\u0435 \u0442\u043E\u043B\u044C\u043A\u043E \u043C\u0438\u043B\u043B\u0438\u043E\u043D\u044B \u043B\u044E\u0434\u0435\u0439, \u043D\u043E \u0438 \u0446\u0435\u043B\u044B\u0435 \u0433\u043E\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0430, \u0432 \u0447\u044C\u0435\u043C \u043F\u0440\u0438\u043C\u0438\u0440\u0435\u043D\u0438\u0438 \u043E\u043D \u0443\u0447\u0430\u0441\u0442\u0432\u043E\u0432\u0430\u043B. \u0418\u0441\u043F\u043E\u043B\u044C\u0437\u0443\u044F \u0441\u043E\u0442\u043D\u0438 \u0438\u043D\u0442\u0435\u0440\u0432\u044C\u044E \u0441 \u043B\u044E\u0434\u044C\u043C\u0438 \u0432 \u0434\u0438\u0430\u043F\u0430\u0437\u043E\u043D\u0435 \u043E\u0442 \u0435\u0433\u043E \u0431\u044B\u0432\u0448\u0438\u0445 \u043E\u0434\u043D\u043E\u0433\u0440\u0443\u043F\u043F\u043D\u0438\u043A\u043E\u0432 \u0434\u043E \u0431\u044B\u0432\u0448\u0438\u0445 \u0436\u0435\u043D, \u043A\u0438\u043B\u043E\u043C\u0435\u0442\u0440\u044B \u0430\u0440\u0445\u0438\u0432\u043D\u043E\u0439 \u0445\u0440\u043E\u043D\u0438\u043A\u0438 \u0438 \u0431\u0435\u0441\u043F\u0440\u043E\u0438\u0433\u0440\u044B\u0448\u043D\u044B\u0439 \u043D\u0430\u0431\u043E\u0440 \u043F\u0435\u0441\u0435\u043D, \u043A\u043E\u0442\u043E\u0440\u044B\u0435 \u0438\u0437\u0432\u0435\u0441\u0442\u043D\u044B \u043A\u0430\u0436\u0434\u043E\u043C\u0443, \u041C\u0430\u043A\u0414\u043E\u043D\u0430\u043B\u044C\u0434 \u0441\u043E\u0437\u0434\u0430\u043B \u0431\u043B\u0435\u0441\u0442\u044F\u0449\u0438\u0439, \u0431\u0435\u0437\u0443\u043C\u043D\u043E \u0443\u0432\u043B\u0435\u043A\u0430\u0442\u0435\u043B\u044C\u043D\u044B\u0439 \u0438 \u043A\u0440\u0430\u0441\u0438\u0432\u044B\u0439 \u043F\u043E\u0440\u0442\u0440\u0435\u0442 \u0447\u0435\u043B\u043E\u0432\u0435\u043A\u0430, \u043F\u0440\u043E \u043A\u043E\u0442\u043E\u0440\u043E\u0433\u043E, \u043A\u0430\u0437\u0430\u043B\u043E\u0441\u044C \u0431\u044B, \u0438 \u0442\u0430\u043A \u0432\u0441\u0435 \u0438\u0437\u0432\u0435\u0441\u0442\u043D\u043E. \u041D\u043E \u044D\u0442\u043E \u043E\u0431\u043C\u0430\u043D\u0447\u0438\u0432\u043E: \u0432\u0438\u0434\u0435\u043B\u0438 \u0431\u044B \u0432\u044B \u0445\u043E\u0442\u044F \u0431\u044B, \u043A\u0430\u043A \u043E\u043D \u0438\u0433\u0440\u0430\u0435\u0442 \u0432 \u0444\u0443\u0442\u0431\u043E\u043B.",
