    "nameRU": "\u0411\u043E\u0436\u0435, \u0445\u0440\u0430\u043D\u0438 \u041E\u0437\u0437\u0438 \u041E\u0441\u0431\u043E\u0440\u043D\u0430",
    "nameEN": "God Bless Ozzy Osbourne",
    "director": "\u041C\u0430\u0439\u043A \u0424\u043B\u0430\u0439\u0441\u0441, \u041C\u0430\u0439\u043A \u041F\u0438\u0448\u0438\u0442\u0435\u043B\u043B\u0438",
    "country": "\u0421\u0428\u0410",
    "year": "2011",
    "duration": 120,
    "description": "\u041E\u0437\u0437\u0438 \u043F\u0440\u044B\u0433\u0430\u0435\u0442 \u0447\u0435\u0440\u0435\u0437 \u0441\u043A\u0430\u043A\u0430\u043B\u043A\u0443, \u043F\u0440\u0435\u0436\u0434\u0435 \u0447\u0435\u043C \u0432\u044B\u0439\u0442\u0438 \u043D\u0430 \u0441\u0446\u0435\u043D\u0443, \u0444\u043E\u0442\u043E\u0433\u0440\u0430\u0444\u0438\u0440\u0443\u0435\u0442\u0441\u044F \u0441\u043E \u0441\u0432\u043E\u0438\u043C\u0438 \u0441\u0435\u0441\u0442\u0440\u0430\u043C\u0438, \u043D\u0430\u0440\u044F\u0436\u0435\u043D\u043D\u044B\u043C\u0438 \u043A\u0430\u043A \u043D\u043E\u0432\u043E\u0433\u043E\u0434\u043D\u044F\u044F \u0435\u043B\u043A\u0430, \u043F\u043E\u0441\u0442\u043E\u044F\u043D\u043D\u043E \u0431\u043E\u0440\u043C\u043E\u0447\u0435\u0442 \u00AB\u043C\u0430\u0442\u044C \u0442\u0432\u043E\u044E\u00BB \u2014 \u0438 \u0434\u0435\u043B\u0430\u0435\u0442 \u0432\u0441\u0435 \u0434\u043B\u044F \u0442\u043E\u0433\u043E, \u0447\u0442\u043E\u0431\u044B \u0432 \u0435\u0433\u043E \u0448\u0435\u0441\u0442\u044C\u0434\u0435\u0441\u044F\u0442 \u0441 \u043B\u0438\u0448\u043D\u0438\u043C \u043B\u0435\u0442 \u043D\u0438\u043A\u0442\u043E \u043D\u0435 \u043C\u043E\u0433 \u0443\u043F\u0440\u0435\u043A\u043D\u0443\u0442\u044C \u0435\u0433\u043E \u0432 \u0442\u043E\u043C, \u0447\u0442\u043E \u043E\u043D \u0432\u044B\u0436\u0438\u043B \u0438\u0437 \u0443\u043C\u0430 \u0438\u043B\u0438 \u0441\u043E\u0432\u0441\u0435\u043C \u043E\u0431\u044A\u0435\u043B\u0441\u044F \u043C\u043E\u0440\u043E\u0436\u0435\u043D\u043D\u043E\u0433\u043E. \u041D\u0435\u0441\u043C\u043E\u0442\u0440\u044F \u043D\u0430 \u0442\u043E, \u0447\u0442\u043E \u0441\u0440\u0435\u0434\u0438 \u043F\u0440\u043E\u0434\u044E\u0441\u0435\u0440\u043E\u0432 \u0444\u0438\u043B\u044C\u043C\u0430 \u0437\u043D\u0430\u0447\u0438\u0442\u0441\u044F \u0435\u0433\u043E \u0441\u044B\u043D \u0414\u0436\u0435\u043A, \u0432 \u0444\u0438\u043B\u044C\u043C\u0435, \u0440\u0430\u0441\u043A\u0440\u0443\u0447\u0438\u0432\u0430\u044E\u0449\u0435\u043C \u0438\u0441\u0442\u043E\u0440\u0438\u044E \u041E\u0441\u0431\u043E\u0440\u043D\u0430 \u043E\u0442 \u0434\u0435\u0442\u0441\u0442\u0432\u0430 \u0432 \u0411\u0438\u0440\u043C\u0438\u043D\u0433\u0435\u043C\u0435 \u0434\u043E \u043D\u0430\u0441\u0442\u043E\u044F\u0449\u0435\u0433\u043E \u043C\u043E\u043C\u0435\u043D\u0442\u0430, \u043D\u0435\u0442 \u043D\u0438 \u043A\u0430\u043F\u043B\u0438 \u0441\u043D\u0438\u0441\u0445\u043E\u0436\u0434\u0435\u043D\u0438\u044F \u0438\u043B\u0438 \u043D\u043E\u0441\u0442\u0430\u043B\u044C\u0433\u0438\u0438. \u042D\u0442\u043E \u043F\u043E-\u043F\u0440\u0435\u0436\u043D\u0435\u043C\u0443 \u0442\u043E\u0442 \u0436\u0435 \u0441\u0430\u043C\u044B\u0439 \u0447\u0435\u043B\u043E\u0432\u0435\u043A, \u043A\u043E\u0442\u043E\u0440\u044B\u0439 \u043E\u0442\u043A\u0443\u0441\u044B\u0432\u0430\u043B \u0433\u043E\u043B\u043E\u0432\u044B \u043B\u0435\u0442\u0443\u0447\u0438\u043C \u043C\u044B\u0448\u0430\u043C, \u0443\u043F\u043E\u0442\u0440\u0435\u0431\u043B\u044F\u043B \u043D\u0430\u0440\u043A\u043E\u0442\u0438\u043A\u0438 \u0432 \u043F\u0440\u043E\u043C\u044B\u0448\u043B\u0435\u043D\u043D\u044B\u0445 \u043C\u0430\u0441\u0448\u0442\u0430\u0431\u0430\u0445, \u0438\u0437\u043E\u0431\u0440\u0435\u043B \u0432\u0441\u0435, \u0447\u0442\u043E \u0442\u043E\u043B\u044C\u043A\u043E \u043C\u043E\u0436\u043D\u043E \u0431\u044B\u043B\u043E \u0438\u0437\u043E\u0431\u0440\u0435\u0441\u0442\u0438, \u0432\u043A\u043B\u044E\u0447\u0430\u044F \u0445\u0435\u0432\u0438-\u043C\u0435\u0442\u0430\u043B, \u0438 \u043F\u043E \u0441\u0442\u0440\u0430\u043D\u043D\u043E\u043C\u0443 \u0441\u0442\u0435\u0447\u0435\u043D\u0438\u044E \u043E\u0431\u0441\u0442\u043E\u044F\u0442\u0435\u043B\u044C\u0441\u0442\u0432 \u043E\u0441\u0442\u0430\u043B\u0441\u044F \u0436\u0438\u0432. \u0412\u044B\u044F\u0441\u043D\u044F\u0435\u0442\u0441\u044F \u043C\u0430\u0441\u0441\u0430 \u0437\u0430\u043D\u0438\u043C\u0430\u0442\u0435\u043B\u044C\u043D\u044B\u0445 \u043F\u043E\u0434\u0440\u043E\u0431\u043D\u043E\u0441\u0442\u0435\u0439: \u043A\u0430\u043A, \u043D\u0430\u043F\u0440\u0438\u043C\u0435\u0440, \u0442\u043E, \u0447\u0442\u043E \u043E\u043D\u0438 \u0432\u044B\u0434\u0443\u043C\u0430\u043B\u0438 Black Sabbath, \u0441\u0445\u043E\u0434\u0438\u0432 \u043D\u0430 \u0444\u0438\u043B\u044C\u043C \u0443\u0436\u0430\u0441\u043E\u0432 \u0432 \u0441\u043E\u0441\u0435\u0434\u043D\u0438\u0439 \u043A\u0438\u043D\u043E\u0442\u0435\u0430\u0442\u0440 \u0438 \u0440\u0435\u0448\u0438\u0432, \u0447\u0442\u043E \u0435\u0441\u043B\u0438 \u043A\u0442\u043E-\u0442\u043E \u0441\u043D\u0438\u043C\u0430\u0435\u0442 \u0441\u0442\u0440\u0430\u0448\u043D\u044B\u0435 \u0444\u0438\u043B\u044C\u043C\u044B, \u0442\u043E \u043A\u0442\u043E-\u0442\u043E \u0434\u043E\u043B\u0436\u0435\u043D \u0438\u0433\u0440\u0430\u0442\u044C \u0441\u0442\u0440\u0430\u0448\u043D\u0443\u044E \u043C\u0443\u0437\u044B\u043A\u0443. \u0425\u043E\u0442\u044F, \u043D\u0430\u0434\u043E \u0441\u043A\u0430\u0437\u0430\u0442\u044C, \u0447\u0442\u043E \u0432 \u0444\u0438\u043B\u044C\u043C\u0435 \u0441\u043C\u0435\u0448\u043D\u043E\u0433\u043E \u0437\u043D\u0430\u0447\u0438\u0442\u0435\u043B\u044C\u043D\u043E \u0431\u043E\u043B\u044C\u0448\u0435, \u0447\u0435\u043C \u0441\u0442\u0440\u0430\u0448\u043D\u043E\u0433\u043E.",
