    "nameRU": "\u041D\u0435 \u043E\u0433\u043B\u044F\u0434\u044B\u0432\u0430\u0439\u0441\u044F",
    "nameEN": "Anton Corbijn Inside Out",
    "director": "\u041A\u043B\u0430\u0440\u0442\u044C\u0435 \u041A\u0432\u0438\u0440\u0435\u0439\u043D\u0441",
    "country": "\u041D\u0438\u0434\u0435\u0440\u043B\u0430\u043D\u0434\u044B, \u0413\u0435\u0440\u043C\u0430\u043D\u0438\u044F, \u0412\u0435\u043B\u0438\u043A\u043E\u0431\u0440\u0438\u0442\u0430\u043D\u0438\u044F, \u0418\u0442\u0430\u043B\u0438\u044F, \u0428\u0432\u0435\u0446\u0438\u044F, \u0411\u0435\u043B\u044C\u0433\u0438\u044F, \u0418\u0440\u043B\u0430\u043D\u0434\u0438\u044F",
    "year": "2012",
    "duration": 85,
    "description": "\u0413\u043B\u0443\u0431\u043E\u043A\u0438\u0439 \u0438 \u043B\u0438\u0447\u043D\u044B\u0439 \u043F\u043E\u0440\u0442\u0440\u0435\u0442 \u0438\u0437\u0432\u0435\u0441\u0442\u043D\u043E\u0433\u043E \u0444\u043E\u0442\u043E\u0433\u0440\u0430\u0444\u0430 \u0438 \u0440\u0435\u0436\u0438\u0441\u0441\u0435\u0440\u0430, \u0440\u0430\u0431\u043E\u0442\u044B \u043A\u043E\u0442\u043E\u0440\u043E\u0433\u043E \u0432\u0441\u0435\u0433\u0434\u0430 \u0441\u043E\u0447\u0435\u0442\u0430\u043B\u0438 \u0432 \u0441\u0435\u0431\u0435 \u0435\u0433\u043E \u043B\u044E\u0431\u043E\u0432\u044C \u043A \u0444\u043E\u0442\u043E\u0433\u0440\u0430\u0444\u0438\u0438 \u0438 \u043C\u0443\u0437\u044B\u043A\u0435 \u043E\u0434\u043D\u043E\u0432\u0440\u0435\u043C\u0435\u043D\u043D\u043E. \u0410\u043D\u0442\u043E\u043D \u041A\u043E\u0440\u0431\u0435\u0439\u043D \u0441\u0434\u0435\u043B\u0430\u043B \u0441\u0435\u0431\u0435 \u0438\u043C\u044F \u043F\u0440\u0435\u0436\u0434\u0435 \u0432\u0441\u0435\u0433\u043E \u043A\u0430\u043A \u0430\u0432\u0442\u043E\u0440 \u0447\u0435\u0440\u043D\u043E-\u0431\u0435\u043B\u044B\u0445 \u043F\u043E\u0440\u0442\u0440\u0435\u0442\u043E\u0432 \u0442\u0430\u043A\u0438\u0445 \u043B\u044E\u0434\u0435\u0439, \u043A\u0430\u043A \u0411\u043E\u043D\u043E, \u041A\u043B\u0438\u043D\u0442 \u0418\u0441\u0442\u0432\u0443\u0434, \u041C\u0430\u0439\u043B\u0441 \u0414\u044D\u0432\u0438\u0441, Rolling Stones, \u0411\u044C\u043E\u0440\u043A \u0438 \u043C\u043D\u043E\u0433\u0438\u0445 \u0434\u0440\u0443\u0433\u0438\u0445. \u0415\u0433\u043E \u0440\u0430\u0431\u043E\u0442\u044B \u043D\u0435 \u0442\u043E\u043B\u044C\u043A\u043E \u043F\u043E\u044F\u0432\u043B\u044F\u043B\u0438\u0441\u044C \u043D\u0430 \u043E\u0431\u043B\u043E\u0436\u043A\u0430\u0445 \u0437\u043D\u0430\u043A\u043E\u0432\u044B\u0445 \u043C\u0443\u0437\u044B\u043A\u0430\u043B\u044C\u043D\u044B\u0445 \u0430\u043B\u044C\u0431\u043E\u043C\u043E\u0432 \u0438 \u043C\u043E\u0434\u043D\u044B\u0445 \u0436\u0443\u0440\u043D\u0430\u043B\u043E\u0432 \u043F\u043E\u0441\u043B\u0435\u0434\u043D\u0438\u0445 \u0434\u0432\u0430\u0434\u0446\u0430\u0442\u0438 \u043B\u0435\u0442, \u043D\u043E \u0438 \u0441\u0444\u043E\u0440\u043C\u0438\u0440\u043E\u0432\u0430\u043B\u0438 \u0445\u0443\u0434\u043E\u0436\u0435\u0441\u0442\u0432\u0435\u043D\u043D\u044B\u0439 \u0432\u043A\u0443\u0441 \u0446\u0435\u043B\u043E\u0433\u043E \u043F\u043E\u043A\u043E\u043B\u0435\u043D\u0438\u044F, \u0432\u044B\u0440\u043E\u0441\u0448\u0435\u0433\u043E \u043D\u0430 \u044D\u0442\u0438\u0445 \u0441\u0430\u043C\u044B\u0445 \u043F\u043B\u0430\u0441\u0442\u0438\u043D\u043A\u0430\u0445 \u0438 \u0436\u0443\u0440\u043D\u0430\u043B\u0430\u0445. \u041E\u0434\u043D\u0430\u043A\u043E \u0432 \u0441\u0438\u043B\u0443 \u0441\u0432\u043E\u0435\u0433\u043E \u0445\u0430\u0440\u0430\u043A\u0442\u0435\u0440\u0430 \u0438 \u043F\u0440\u043E\u0444\u0435\u0441\u0441\u0438\u0438 \u041A\u043E\u0440\u0431\u0435\u0439\u043D \u0432\u0441\u0435\u0433\u0434\u0430 \u043E\u0441\u0442\u0430\u0432\u0430\u043B\u0441\u044F \u0437\u0430 \u043A\u0430\u0434\u0440\u043E\u043C, \u043D\u0435\u043F\u0440\u043E\u043D\u0438\u0446\u0430\u0435\u043C\u044B\u043C \u0434\u043B\u044F \u043F\u043E\u0441\u0442\u043E\u0440\u043E\u043D\u043D\u0438\u0445 \u0432\u0437\u0433\u043B\u044F\u0434\u043E\u0432, \u0432 \u0444\u0438\u043B\u044C\u043C\u0435 \u0436\u0435 \u0440\u0435\u0436\u0438\u0441\u0441\u0435\u0440 \u0440\u0430\u0441\u043F\u0443\u0442\u044B\u0432\u0430\u0435\u0442 \u0435\u0433\u043E \u043B\u0438\u0447\u043D\u0443\u044E \u0438\u0441\u0442\u043E\u0440\u0438\u044E \u0438 \u0441\u043B\u0435\u0434\u0443\u0435\u0442 \u043F\u043E \u043F\u044F\u0442\u0430\u043C \u0437\u0430 \u0441\u0432\u043E\u0438\u043C \u0433\u0435\u0440\u043E\u0435\u043C. \u0422\u0430\u043A, \u0437\u0440\u0438\u0442\u0435\u043B\u044C \u0441\u0442\u0430\u043D\u043E\u0432\u0438\u0442\u0441\u044F \u0435\u0433\u043E \u043F\u043E\u043F\u0443\u0442\u0447\u0438\u043A\u043E\u043C \u0432 \u043F\u043E\u0435\u0437\u0434\u0435, \u0432\u044B\u0441\u043B\u0443\u0448\u0438\u0432\u0430\u0435\u0442 \u0448\u0443\u0442\u043A\u0438 \u0411\u043E\u043D\u043E \u043E \u0442\u043E\u043C, \u0447\u0442\u043E \u0432 \u043A\u0430\u0434\u0440\u0435 \u041A\u043E\u0440\u0431\u0435\u0439\u043D\u0430 \u043E\u043D \u0432\u0441\u0435\u0433\u0434\u0430 \u0432\u044B\u0433\u043B\u044F\u0434\u0438\u0442 \u043B\u0443\u0447\u0448\u0435, \u0447\u0435\u043C \u043D\u0430 \u0441\u0430\u043C\u043E\u043C \u0434\u0435\u043B\u0435, \u043E\u043A\u0430\u0437\u044B\u0432\u0430\u0435\u0442\u0441\u044F \u0441\u0432\u0438\u0434\u0435\u0442\u0435\u043B\u0435\u043C \u0441\u044A\u0435\u043C\u043E\u043A \u0441 \u0414\u0436\u043E\u0440\u0434\u0436\u0435\u043C \u041A\u043B\u0443\u043D\u0438, \u043A\u0443\u0445\u043E\u043D\u043D\u044B\u0445 \u0440\u0430\u0437\u0433\u043E\u0432\u043E\u0440\u043E\u0432 \u0441 \u043C\u0430\u0442\u0435\u0440\u044C\u044E \u0438 \u0441\u0435\u043C\u0435\u0439\u043D\u044B\u0445 \u043E\u0431\u0435\u0434\u043E\u0432, \u043F\u0440\u0435\u0434\u0432\u0430\u0440\u044F\u0435\u043C\u044B\u0445 \u043C\u043E\u043B\u0438\u0442\u0432\u0430\u043C\u0438 (\u043E\u0442\u0435\u0446 \u041A\u043E\u0440\u0431\u0435\u0439\u043D\u0430 \u0431\u044B\u043B \u0441\u0432\u044F\u0449\u0435\u043D\u043D\u0438\u043A\u043E\u043C).",
