    "country": "\u0418\u0441\u043B\u0430\u043D\u0434\u0438\u044F, \u0412\u0435\u043B\u0438\u043A\u043E\u0431\u0440\u0438\u0442\u0430\u043D\u0438\u044F, \u041A\u0430\u043D\u0430\u0434\u0430",
    "year": "2011",
    "duration": 74,
    "description": "\u0417\u0430\u0445\u0432\u0430\u0442\u044B\u0432\u0430\u044E\u0449\u0438\u0439 \u043F\u0440\u043E\u0440\u044B\u0432 \u043C\u0443\u0437\u044B\u043A\u0438 \u043D\u0430 \u0442\u0435\u0440\u0440\u0438\u0442\u043E\u0440\u0438\u044E \u043A\u0438\u043D\u0435\u043C\u0430\u0442\u043E\u0433\u0440\u0430\u0444\u0430, \u043E\u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043B\u0435\u043D\u043D\u044B\u0439 \u0438\u0441\u043B\u0430\u043D\u0434\u0441\u043A\u043E\u0439 \u0433\u0440\u0443\u043F\u043F\u043E\u0439 Sigur Ros \u0438 \u043A\u0430\u043D\u0430\u0434\u0441\u043A\u0438\u043C \u0440\u0435\u0436\u0438\u0441\u0441\u0435\u0440\u043E\u043C \u0412\u0438\u043D\u0441\u0435\u043D\u0442\u043E\u043C \u041C\u043E\u0440\u0438\u0441\u0441\u0435\u0442\u043E\u043C (\u044D\u0442\u043E \u043E\u043D \u043F\u0440\u0438\u0434\u0443\u043C\u044B\u0432\u0430\u043B Arcade Fire \u0438\u043D\u0442\u0435\u0440\u0430\u043A\u0442\u0438\u0432\u043D\u044B\u0435 \u0432\u0438\u0434\u0435\u043E\u0440\u0435\u0431\u0443\u0441\u044B \u043F\u043E\u0434 \u0432\u0438\u0434\u043E\u043C \u043A\u043B\u0438\u043F\u043E\u0432). \u041E\u043D \u0441\u043D\u0438\u043C\u0430\u043B \u0433\u0440\u0443\u043F\u043F\u0443 \u0432\u043E \u0432\u0440\u0435\u043C\u044F \u0434\u0432\u0443\u0445 \u0435\u0435 \u043A\u043E\u043D\u0446\u0435\u0440\u0442\u043E\u0432 \u0432 \u0410\u043B\u0435\u043A\u0441\u0430\u043D\u0434\u0440\u0430-\u043F\u0430\u043B\u0430\u0441, \u043A\u043E\u043D\u0446\u0435\u0440\u0442\u043D\u043E\u043C \u0437\u0430\u043B\u0435 \u0412\u0438\u043A\u0442\u043E\u0440\u0438\u0430\u043D\u0441\u043A\u043E\u0439 \u044D\u043F\u043E\u0445\u0438 \u0432 \u044E\u0436\u043D\u043E\u0439 \u0447\u0430\u0441\u0442\u0438 \u041B\u043E\u043D\u0434\u043E\u043D\u0430, \u043F\u043E\u043C\u0435\u0449\u0430\u043B \u043F\u043E\u043B\u0443\u0447\u0438\u0432\u0448\u0443\u044E\u0441\u044F \u043A\u0430\u0440\u0442\u0438\u043D\u043A\u0443 \u043D\u0430 16-\u043C\u0438\u043B\u0438\u043C\u043C\u0435\u0442\u0440\u043E\u0432\u0443\u044E \u043F\u043B\u0435\u043D\u043A\u0443 \u0438 \u043F\u0440\u043E\u0433\u043E\u043D\u044F\u043B \u0438\u0437\u043E\u0431\u0440\u0430\u0436\u0435\u043D\u0438\u0435 \u0447\u0435\u0440\u0435\u0437 \u043F\u0440\u0438\u0437\u043C\u0443 \u0441\u0442\u0435\u043A\u043B\u0430. \u0412 \u0440\u0435\u0437\u0443\u043B\u044C\u0442\u0430\u0442\u0435 \u044D\u0442\u043E\u0433\u043E \u043F\u043E\u043B\u0443\u0447\u0438\u043B\u0441\u044F \u0443\u0434\u0438\u0432\u0438\u0442\u0435\u043B\u044C\u043D\u044B\u0439 \u043A\u0430\u043B\u0435\u0439\u0434\u043E\u0441\u043A\u043E\u043F \u044D\u043C\u043E\u0446\u0438\u0439, \u043F\u0435\u0440\u0435\u0436\u0438\u0432\u0430\u043D\u0438\u0439 \u0438 \u043D\u0430\u0432\u0430\u0436\u0434\u0435\u043D\u0438\u0439, \u043A\u043E\u0442\u043E\u0440\u044B\u0435 \u043A\u0430\u043A \u043D\u0435\u043B\u044C\u0437\u044F \u043B\u0443\u0447\u0448\u0435 \u043F\u0435\u0440\u0435\u0434\u0430\u044E\u0442 \u043D\u0435 \u0442\u043E\u043B\u044C\u043A\u043E \u0430\u0442\u043C\u043E\u0441\u0444\u0435\u0440\u0443 \u043A\u043E\u043D\u0446\u0435\u0440\u0442\u0430, \u043D\u043E \u0438 \u0441\u0443\u0442\u044C \u043C\u0443\u0437\u044B\u043A\u0438 Sigur Ros. \u0412 \u043C\u0435\u0440\u0443 \u0442\u0430\u0438\u043D\u0441\u0442\u0432\u0435\u043D\u043D\u043E\u0439, \u0437\u0430\u0433\u0430\u0434\u043E\u0447\u043D\u043E\u0439 \u0438 \u0434\u0435\u043B\u0438\u043A\u0430\u0442\u043D\u043E\u0439, \u043D\u043E \u0432 \u0442\u043E \u0436\u0435 \u0432\u0440\u0435\u043C\u044F \u0441\u043F\u043E\u0441\u043E\u0431\u043D\u043E\u0439 \u0432 \u043E\u0434\u043D\u043E\u0447\u0430\u0441\u044C\u0435 \u0432\u044B\u0439\u0442\u0438 \u0438\u0437 \u043A\u043B\u0430\u0443\u0441\u0442\u0440\u043E\u0444\u043E\u0431\u0438\u0447\u0435\u0441\u043A\u043E\u0433\u043E \u0437\u0430\u0431\u044B\u0442\u044C\u044F \u043D\u0430 \u0442\u0440\u0438\u0443\u043C\u0444\u0430\u043B\u044C\u043D\u0443\u044E \u043E\u0440\u0431\u0438\u0442\u0443.",
