    "description": "\u0420\u0435\u0432\u0443\u0449\u0438\u0439 \u0413\u043B\u0430\u0441\u0442\u043E\u043D\u0431\u0435\u0440\u0438, \u043F\u0443\u0441\u0442\u044B\u0435 \u0433\u043E\u0441\u0442\u0438\u043D\u0438\u0447\u043D\u044B\u0435 \u043D\u043E\u043C\u0435\u0440\u0430, \u0438\u0437\u043C\u0430\u0442\u044B\u0432\u0430\u044E\u0449\u0438\u0435 \u043F\u0435\u0440\u0435\u0435\u0437\u0434\u044B, \u0431\u0435\u0441\u043A\u043E\u043D\u0435\u0447\u043D\u044B\u0435 \u0438\u043D\u0442\u0435\u0440\u0432\u044C\u044E \u0438 \u043F\u043E\u043F\u044B\u0442\u043A\u0438 \u0432\u044B\u0433\u043E\u0432\u043E\u0440\u0438\u0442\u044C \u043D\u0430\u0437\u0432\u0430\u043D\u0438\u0435 \u0440\u0430\u0434\u0438\u043E\u0441\u0442\u0430\u043D\u0446\u0438\u0438, \u043E\u0442 \u043A\u043E\u0442\u043E\u0440\u043E\u0433\u043E \u0441\u0432\u043E\u0434\u0438\u0442 \u0437\u0443\u0431\u044B, \u0447\u0442\u043E\u0431\u044B \u0437\u0430\u043F\u0438\u0441\u0430\u0442\u044C \u043E\u0434\u0438\u043D \u0438 \u0442\u043E\u0442 \u0436\u0435 \u0434\u0436\u0438\u043D\u0433\u043B, \u2014 \u0435\u0434\u0438\u043D\u0441\u0442\u0432\u0435\u043D\u043D\u044B\u0439 \u0434\u043E\u043A\u0443\u043C\u0435\u043D\u0442\u0430\u043B\u044C\u043D\u044B\u0439 \u0444\u0438\u043B\u044C\u043C \u043E \u0433\u0440\u0443\u043F\u043F\u0435 Radiohead \u043F\u043E\u043A\u0430\u0437\u044B\u0432\u0430\u0435\u0442 \u0431\u043E\u043B\u0435\u0437\u043D\u0435\u043D\u043D\u0443\u044E \u0442\u0440\u0430\u043D\u0441\u0444\u043E\u0440\u043C\u0430\u0446\u0438\u044E \u0441\u043A\u0440\u043E\u043C\u043D\u043E\u0433\u043E \u043A\u0432\u0430\u0440\u0442\u0435\u0442\u0430 \u0438\u0437 \u041E\u043A\u0441\u0444\u043E\u0440\u0434\u0448\u0438\u0440\u0430 \u0432 \u0433\u043B\u0430\u0432\u043D\u0443\u044E \u0440\u043E\u043A-\u0433\u0440\u0443\u043F\u043F\u0443 \u043F\u043B\u0430\u043D\u0435\u0442\u044B, \u0430 \u0442\u0430\u043A\u0436\u0435 \u043E\u0431\u0440\u0430\u0442\u043D\u0443\u044E \u0441\u0442\u043E\u0440\u043E\u043D\u0443 \u043F\u0440\u0438\u0437\u043D\u0430\u043D\u0438\u044F \u0438 \u043A\u043E\u043C\u043C\u0435\u0440\u0447\u0435\u0441\u043A\u043E\u0433\u043E \u0443\u0441\u043F\u0435\u0445\u0430 \u043F\u043E \u043E\u0431\u0435 \u0441\u0442\u043E\u0440\u043E\u043D\u044B \u0410\u0442\u043B\u0430\u043D\u0442\u0438\u043A\u0438. \u041D\u0430\u0437\u0432\u0430\u0432 \u0444\u0438\u043B\u044C\u043C \u00AB\u0417\u043D\u0430\u043A\u043E\u043C\u0438\u0442\u044C\u0441\u044F \u0441 \u043B\u044E\u0434\u044C\u043C\u0438 \u043F\u0440\u043E\u0441\u0442\u043E\u00BB \u0431\u0440\u0438\u0442\u0430\u043D\u0441\u043A\u0438\u0439 \u0440\u0435\u0436\u0438\u0441\u0441\u0435\u0440 \u0413\u0440\u0430\u043D\u0442 \u0414\u0436\u0438 (\u0430\u0432\u0442\u043E\u0440 \u0444\u0438\u043B\u044C\u043C\u043E\u0432 \u00ABJoy Division\u00BB, \u00AB30th Century Man\u00BB \u043E \u0421\u043A\u043E\u0442\u0442\u0435 \u0423\u043E\u043A\u0435\u0440\u0435 \u0438, \u043A\u0441\u0442\u0430\u0442\u0438, \u043A\u043B\u0438\u043F\u0430 \u043D\u0430 \u043F\u0435\u0441\u043D\u044E \u00ABNo Surprises\u00BB), \u043E\u0447\u0435\u0432\u0438\u0434\u043D\u043E, \u0438\u043C\u0435\u043B \u0432 \u0432\u0438\u0434\u0443 \u043C\u0438\u0437\u0430\u043D\u0442\u0440\u043E\u043F\u0438\u0447\u0435\u0441\u043A\u0438\u0439 \u043D\u0440\u0430\u0432 \u0422\u043E\u043C\u0430 \u0419\u043E\u0440\u043A\u0430, \u043A\u043E\u0442\u043E\u0440\u044B\u0439, \u043E\u0434\u043D\u0430\u043A\u043E, \u043D\u0435 \u043F\u043E\u043C\u0435\u0448\u0430\u043B \u0435\u043C\u0443 \u043F\u0440\u043E\u0435\u0445\u0430\u0442\u044C \u0441 \u0433\u0440\u0443\u043F\u043F\u043E\u0439 \u0446\u0435\u043B\u044B\u0439 \u0442\u0443\u0440 \u0438 \u0441\u043D\u044F\u0442\u044C \u0444\u0438\u043B\u044C\u043C, \u043A\u0430\u043A \u043D\u0435\u043B\u044C\u0437\u044F \u043B\u0443\u0447\u0448\u0435 \u0440\u0430\u0441\u0441\u043A\u0430\u0437\u044B\u0432\u0430\u044E\u0449\u0438\u0439 \u0432\u0441\u0435 \u043E \u0433\u0440\u0443\u043F\u043F\u0435. \u0413\u0440\u0443\u043F\u043F\u0435, \u043A\u043E\u0442\u043E\u0440\u0430\u044F, \u043A \u0441\u043B\u043E\u0432\u0443, \u043D\u0435\u043D\u0430\u0432\u0438\u0434\u0438\u0442 \u0433\u0440\u0443\u043F\u043F\u0438\u0437. \u041F\u043E\u043A\u0430\u0437 \u043F\u0440\u0438\u0443\u0440\u043E\u0447\u0435\u043D \u043A 15-\u043B\u0435\u0442\u0438\u044E \u0441 \u043C\u043E\u043C\u0435\u043D\u0442\u0430 \u0432\u044B\u0445\u043E\u0434\u0430 \u0430\u043B\u044C\u0431\u043E\u043C\u0430 \u00ABOK Computer\u00BB, \u043A\u043E\u0442\u043E\u0440\u044B\u0439 \u0437\u0430\u043F\u0435\u0447\u0430\u0442\u043B\u0435\u043D \u0432 \u0444\u0438\u043B\u044C\u043C\u0435.",
