    "description": "\u00AB\u0421\u0430\u043C\u0430\u044F \u0441\u043A\u0430\u043D\u0434\u0430\u043B\u044C\u043D\u0430\u044F \u0433\u0440\u0443\u043F\u043F\u0430 \u0412\u0435\u043B\u0438\u043A\u043E\u0431\u0440\u0438\u0442\u0430\u043D\u0438\u0438, \u043F\u043E\u043F\u0430\u0434\u0430\u044E\u0449\u0430\u044F \u043D\u0430 \u043E\u0431\u043B\u043E\u0436\u043A\u0438 \u0442\u0430\u0431\u043B\u043E\u0438\u0434\u043E\u0432 \u0441 \u0442\u043E\u0439 \u0436\u0435 \u0440\u0435\u0433\u0443\u043B\u044F\u0440\u043D\u043E\u0441\u0442\u044C\u044E, \u0441 \u043A\u0430\u043A\u043E\u0439 \u0435\u0435 \u043B\u0438\u0434\u0435\u0440 \u041F\u0438\u0442 \u0414\u043E\u044D\u0440\u0442\u0438 \u2014 \u0432 \u0442\u044E\u0440\u044C\u043C\u0443\u00BB. \u0422\u0430\u043A\u0443\u044E \u0440\u0435\u043F\u0443\u0442\u0430\u0446\u0438\u044E \u0437\u0430\u0441\u043B\u0443\u0436\u0438\u043B\u0438 The Libertines \u0432 \u0441\u0430\u043C\u043E\u043C \u043D\u0430\u0447\u0430\u043B\u0435 \u043D\u0443\u043B\u0435\u0432\u044B\u0445, \u0434\u0430\u0440\u043E\u043C \u0447\u0442\u043E \u0438\u0445 \u043F\u043B\u0430\u0441\u0442\u0438\u043D\u043A\u0438 \u0441\u0442\u0430\u0432\u0438\u043B\u0438 \u0432 \u043E\u0434\u0438\u043D \u0440\u044F\u0434 \u0441 The White Stripes, The Strokes \u0438 \u043F\u0440\u043E\u0447\u0438\u043C\u0438 \u0433\u0435\u0440\u043E\u044F\u043C\u0438 \u0441\u0442\u0440\u0430\u0448\u043D\u043E \u043F\u043E\u043F\u0443\u043B\u044F\u0440\u043D\u043E\u0433\u043E \u0442\u043E\u0433\u0434\u0430 \u0440\u0435\u0442\u0440\u043E\u0440\u043E\u043A\u0430. \u0421 \u0442\u0435\u0445 \u043F\u043E\u0440 \u041F\u0438\u0442 \u0414\u043E\u044D\u0440\u0442\u0438 \u0438 \u041A\u0430\u0440\u043B \u0411\u0430\u0440\u0430\u0442 \u0443\u043C\u0443\u0434\u0440\u0438\u043B\u0438\u0441\u044C \u0440\u0430\u0437\u0440\u0443\u0433\u0430\u0442\u044C\u0441\u044F \u0432 \u043F\u0443\u0445 \u0438 \u043F\u0440\u0430\u0445, \u0441\u043E\u0437\u0434\u0430\u0442\u044C \u043A\u0430\u0436\u0434\u044B\u0439 \u043F\u043E \u0441\u0432\u043E\u0435\u0439 \u0433\u0440\u0443\u043F\u043F\u0435 \u0438 \u0432 \u0440\u0435\u0437\u0443\u043B\u044C\u0442\u0430\u0442\u0435 \u0441\u043D\u043E\u0432\u0430 \u0441\u043E\u0431\u0440\u0430\u0442\u044C\u0441\u044F \u0432\u043C\u0435\u0441\u0442\u0435, \u0447\u0442\u043E\u0431\u044B \u0441\u044B\u0433\u0440\u0430\u0442\u044C \u0432 \u043A\u0430\u0447\u0435\u0441\u0442\u0432\u0435 \u0445\u0435\u0434\u043B\u0430\u0439\u043D\u0435\u0440\u043E\u0432 \u043D\u0430 \u0444\u0435\u0441\u0442\u0438\u0432\u0430\u043B\u044F\u0445 \u0432 \u0420\u0438\u0434\u0438\u043D\u0433\u0435 \u0438 \u0432 \u041B\u0438\u0434\u0441\u0435 \u0432 2010 \u0433\u043E\u0434\u0443. \u042D\u0442\u043E\u0442 \u0444\u043E\u0440\u043C\u0430\u043B\u044C\u043D\u044B\u0439 \u043F\u043E\u0432\u043E\u0434 \u043F\u043E\u0437\u0432\u043E\u043B\u0438\u043B \u0420\u043E\u0434\u0436\u0435\u0440\u0443 \u0421\u0430\u0440\u0434\u0436\u0435\u043D\u0442\u0443, \u043F\u043E \u0441\u0443\u0442\u0438, \u0441\u0442\u0430\u0442\u044C \u0435\u0449\u0435 \u043E\u0434\u043D\u0438\u043C \u0447\u043B\u0435\u043D\u043E\u043C \u0433\u0440\u0443\u043F\u043F\u044B, \u0438 \u043F\u043E\u043B\u0443\u0447\u0438\u0442\u044C \u0434\u043E\u0441\u0442\u0443\u043F \u0432\u0441\u044E\u0434\u0443: \u0432 \u0441\u0442\u0443\u0434\u0438\u044E, \u0433\u0434\u0435 \u0433\u0440\u0443\u043F\u043F\u0430 \u0440\u0435\u043F\u0435\u0442\u0438\u0440\u043E\u0432\u0430\u043B\u0430, \u0432 \u043F\u0430\u0431\u044B, \u0433\u0434\u0435 \u043E\u043D\u0430 \u043F\u0440\u043E\u0432\u043E\u0434\u0438\u043B\u0430 \u0432\u0440\u0435\u043C\u0435\u043D\u0438 \u043D\u0435 \u043C\u0435\u043D\u044C\u0448\u0435, \u0432 \u0433\u0440\u0438\u043C\u0435\u0440\u043A\u0438, \u0433\u0434\u0435 \u0432\u044B\u0436\u0438\u043C\u0430\u043B\u0430 \u0444\u0443\u0442\u0431\u043E\u043B\u043A\u0438 \u043F\u043E\u0441\u043B\u0435 \u043A\u043E\u043D\u0446\u0435\u0440\u0442\u043E\u0432, \u0438 \u043F\u0440\u043E\u0441\u0442\u043E \u0432 \u043D\u0435 \u0441\u0430\u043C\u044B\u0435 \u043E\u0447\u0435\u0432\u0438\u0434\u043D\u044B\u0435, \u043D\u043E \u043F\u0430\u043C\u044F\u0442\u043D\u044B\u0435 \u0434\u043B\u044F \u00AB\u043B\u0438\u0431\u0435\u0440\u0442\u0438\u043D\u043E\u0432\u00BB \u0437\u0430\u043A\u043E\u0443\u043B\u043A\u0438 \u041B\u043E\u043D\u0434\u043E\u043D\u0430. \u0421\u0430\u043C\u043E\u0435 \u0446\u0435\u043D\u043D\u043E\u0435, \u0432\u043F\u0440\u043E\u0447\u0435\u043C, \u0434\u0430\u0436\u0435 \u043D\u0435 \u044D\u0442\u043E, \u0430 \u043F\u043E\u0447\u0442\u0438 \u0447\u0442\u043E \u0434\u0440\u0443\u0436\u0435\u0441\u043A\u0438\u0435, \u043F\u0440\u043E\u043F\u0443\u0449\u0435\u043D\u043D\u044B\u0435 \u0447\u0435\u0440\u0435\u0437 \u043F\u0440\u0438\u0437\u043C\u0443 \u043D\u0435\u0441\u043A\u043E\u043B\u044C\u043A\u0438\u0445 \u043F\u0438\u043D\u0442 \u0431\u0430\u0439\u043A\u0438 \u0414\u043E\u044D\u0440\u0442\u0438 \u0438 \u0411\u0430\u0440\u0430\u0442\u0430, \u043F\u043E\u043B\u043D\u044B\u0435 \u043A\u0440\u0435\u043F\u043A\u043E\u0439 \u0431\u0440\u0438\u0442\u0430\u043D\u0441\u043A\u043E\u0439 \u0440\u0443\u0433\u0430\u043D\u0438, \u043C\u0435\u0442\u043A\u0438\u0445 \u0448\u0443\u0442\u043E\u043A \u0438 \u043D\u0435\u0438\u0437\u043C\u0435\u043D\u043D\u043E\u0433\u043E \u043E\u0431\u0430\u044F\u043D\u0438\u044F.",
