    "duration": 78,
    "description": "Teenage \u2014 \u044D\u0442\u043E \u0443\u043F\u043E\u0438\u0442\u0435\u043B\u044C\u043D\u0430\u044F \u0438\u0441\u0442\u043E\u0440\u0438\u044F \u043C\u043E\u043B\u043E\u0434\u0435\u0436\u043D\u043E\u0439 \u043A\u0443\u043B\u044C\u0442\u0443\u0440\u044B \u0438 \u043D\u0430\u0441\u0442\u043E\u044F\u0449\u0438\u0439 \u0432\u0438\u0437\u0443\u0430\u043B\u044C\u043D\u044B\u0439 \u0433\u0438\u0434 \u043F\u043E \u0438\u0441\u0442\u043E\u0440\u0438\u0438 \u0442\u0438\u043D\u0435\u0439\u0434\u0436\u0435\u0440\u0441\u0442\u0432\u0430, \u043A\u043E\u0442\u043E\u0440\u0430\u044F, \u043A\u0430\u043A \u0432\u044B\u044F\u0441\u043D\u044F\u0435\u0442\u0441\u044F, \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043E\u0432\u0430\u043B\u0430 \u043D\u0435 \u0432\u0441\u0435\u0433\u0434\u0430 \u0438 \u043D\u0430\u0447\u0430\u043B\u0430\u0441\u044C \u0434\u0430\u043B\u0435\u043A\u043E \u043D\u0435 \u0432 1960-\u0435. \u0412\u0434\u043E\u0445\u043D\u043E\u0432\u043B\u0435\u043D\u043D\u044B\u0439 \u043E\u0434\u043D\u043E\u0438\u043C\u0435\u043D\u043D\u043E\u0439 \u043A\u043D\u0438\u0433\u043E\u0439 \u0431\u0440\u0438\u0442\u0430\u043D\u0441\u043A\u043E\u0433\u043E \u043F\u0430\u043D\u043A-\u043F\u0438\u0441\u0430\u0442\u0435\u043B\u044F \u0438 \u043A\u0440\u0438\u0442\u0438\u043A\u0430 \u0414\u0436\u043E\u043D\u0430 \u0421\u044D\u0432\u0438\u0434\u0436\u0430, \u0444\u0438\u043B\u044C\u043C \u0434\u0430\u0435\u0442 \u0433\u043E\u043B\u043E\u0441 \u043C\u043E\u043B\u043E\u0434\u044B\u043C \u043B\u044E\u0434\u044F\u043C \u043F\u0435\u0440\u0432\u043E\u0439 \u043F\u043E\u043B\u043E\u0432\u0438\u043D\u044B XX \u0432\u0435\u043A\u0430 \u0438\u0437 \u0410\u043C\u0435\u0440\u0438\u043A\u0438, \u0411\u0440\u0438\u0442\u0430\u043D\u0438\u0438 \u0438 \u0413\u0435\u0440\u043C\u0430\u043D\u0438\u0438 \u2014 \u043E\u0442 \u043E\u0434\u0435\u0440\u0436\u0438\u043C\u044B\u0445 \u0432\u0435\u0447\u0435\u0440\u0438\u043D\u043A\u0430\u043C\u0438 \u044E\u043D\u044B\u0445 \u043F\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u0438\u0442\u0435\u043B\u0435\u0439 \u0430\u0440\u0438\u0441\u0442\u043E\u043A\u0440\u0430\u0442\u0438\u0447\u0435\u0441\u043A\u043E\u0439 \u0431\u043E\u0433\u0435\u043C\u044B (Bright Young People) \u0438 \u0431\u0443\u043D\u0442\u0443\u044E\u0449\u0438\u0445 \u043D\u0435\u043C\u0435\u0446\u043A\u0438\u0445 Swing Kids \u0434\u043E \u0438\u0434\u0435\u0430\u043B\u0438\u0441\u0442\u043E\u0432 \u0438\u0437 \u0413\u0438\u0442\u043B\u0435\u0440\u044E\u0433\u0435\u043D\u0434\u0430 \u0438 \u0441\u0430\u043C\u044B\u0445 \u043D\u0430\u0441\u0442\u043E\u044F\u0449\u0438\u0445 \u0431\u043E\u0439\u0441\u043A\u0430\u0443\u0442\u043E\u0432 (\u043A\u0441\u0442\u0430\u0442\u0438, \u043B\u044E\u0431\u0438\u043C\u044B\u0439 \u0430\u043A\u0442\u0435\u0440 \u0423\u044D\u0441\u0430 \u0410\u043D\u0434\u0435\u0440\u0441\u043E\u043D\u0430 \u0414\u0436\u0435\u0439\u0441\u043E\u043D \u0428\u0432\u0430\u0440\u0446\u043C\u0430\u043D \u044F\u0432\u043B\u044F\u0435\u0442\u0441\u044F \u043F\u0440\u043E\u0434\u044E\u0441\u0435\u0440\u043E\u043C \u0444\u0438\u043B\u044C\u043C\u0430). \u041F\u043E\u0441\u0442\u0440\u043E\u0435\u043D\u043D\u044B\u0439 \u0432\u043E\u043A\u0440\u0443\u0433 \u043A\u0438\u043B\u043E\u043C\u0435\u0442\u0440\u043E\u0432 \u0447\u0435\u0440\u043D\u043E-\u0431\u0435\u043B\u044B\u0445 \u0430\u0440\u0445\u0438\u0432\u043E\u0432 \u0438 \u043B\u044E\u0431\u043E\u0432\u043D\u043E \u0441\u043D\u044F\u0442\u044B\u0445 \u043D\u0430 8-\u043C\u0438\u043B\u043B\u0438\u043C\u0435\u0442\u0440\u043E\u0432\u0443\u044E \u043F\u043B\u0435\u043D\u043A\u0443 \u0440\u0435\u043A\u043E\u043D\u0441\u0442\u0440\u0443\u043A\u0446\u0438\u0439 \u043F\u0440\u0438 \u0443\u0447\u0430\u0441\u0442\u0438\u0438 \u043C\u043E\u043B\u043E\u0434\u044B\u0445 \u0430\u043A\u0442\u0435\u0440\u043E\u0432, \u00ABTeenage\u00BB \u0433\u043E\u0432\u043E\u0440\u0438\u0442 \u0441\u043E \u0437\u0440\u0438\u0442\u0435\u043B\u0435\u043C \u044F\u0437\u044B\u043A\u043E\u043C \u043D\u0435 \u0438\u0441\u0442\u043E\u0440\u0438\u0447\u0435\u0441\u043A\u0438\u0445 \u0444\u0430\u043A\u0442\u043E\u0432, \u0430 \u0441\u043A\u043E\u0440\u0435\u0435 \u043F\u043E\u044D\u0442\u0438\u0447\u0435\u0441\u043A\u0438\u0445 \u043E\u0431\u0440\u0430\u0437\u043E\u0432 \u0438 \u043E\u0449\u0443\u0449\u0435\u043D\u0438\u0439. \u0420\u0435\u0436\u0438\u0441\u0441\u0435\u0440 \u0444\u0438\u043B\u044C\u043C\u0430 \u041C\u044D\u0442\u0442 \u0412\u0443\u043B\u0444 \u043F\u043E\u043B\u044C\u0437\u0443\u0435\u0442\u0441\u044F \u043C\u0435\u0442\u043E\u0434\u043E\u043C, \u043F\u043E\u0434\u0441\u043C\u043E\u0442\u0440\u0435\u043D\u043D\u044B\u043C \u0443 \u0441\u0432\u043E\u0435\u0433\u043E \u0441\u043E\u0430\u0432\u0442\u043E\u0440\u0430 \u0421\u044D\u0432\u0438\u0434\u0436\u0430, \u043D\u0430\u043F\u0438\u0441\u0430\u0432\u0448\u0435\u0433\u043E \u0445\u0440\u043E\u043D\u0438\u043A\u0443 \u0431\u0440\u0438\u0442\u0430\u043D\u0441\u043A\u043E\u0433\u043E \u043F\u0430\u043D\u043A\u0430 \u00ABEngland's Dreaming\u00BB \u0438 \u0441\u0446\u0435\u043D\u0430\u0440\u0438\u0439 \u0432\u044B\u0434\u0430\u044E\u0449\u0435\u0433\u043E\u0441\u044F \u0434\u043E\u043A\u0443\u043C\u0435\u043D\u0442\u0430\u043B\u044C\u043D\u043E\u0433\u043E \u0444\u0438\u043B\u044C\u043C\u0430 \u00ABJoy Division\u00BB, \u2014 \u0430 \u0438\u043C\u0435\u043D\u043D\u043E: \u043F\u043E\u0434\u043E\u0431\u043D\u043E \u0442\u043E\u043C\u0443 \u043A\u0430\u043A \u043F\u0430\u043D\u043A\u0438 1970-\u0445 \u0440\u0432\u0430\u043B\u0438 \u043D\u0430 \u0447\u0430\u0441\u0442\u0438 \u0430\u043A\u043A\u0443\u0440\u0430\u0442\u043D\u044B\u0435 \u043E\u0434\u0435\u0436\u0434\u044B \u043F\u0440\u0435\u0434\u044B\u0434\u0443\u0449\u0438\u0445 \u044D\u043F\u043E\u0445, \u0441\u043A\u0440\u0435\u043F\u043B\u044F\u044F \u0438\u0445 \u043D\u0430\u0440\u044F\u0434\u044B \u0441 \u043D\u043E\u0432\u044B\u043C \u0441\u043C\u044B\u0441\u043B\u043E\u043C \u043F\u0440\u0438 \u043F\u043E\u043C\u043E\u0449\u0438 \u0431\u0443\u043B\u0430\u0432\u043E\u043A, \u0412\u0443\u043B\u0444 \u043F\u0443\u0441\u043A\u0430\u0435\u0442 \u043F\u043E\u0434 \u043D\u043E\u0436 \u043A\u0438\u043B\u043E\u043C\u0435\u0442\u0440\u044B \u0430\u0440\u0445\u0438\u0432\u043D\u044B\u0445 \u0445\u0440\u043E\u043D\u0438\u043A, \u0447\u0442\u043E\u0431\u044B \u043F\u0440\u0438 \u043F\u043E\u043C\u043E\u0449\u0438 \u043F\u0440\u0430\u043A\u0442\u0438\u0447\u0435\u0441\u043A\u0438 \u043D\u0435\u043F\u0440\u0435\u0440\u044B\u0432\u043D\u043E \u0437\u0432\u0443\u0447\u0430\u0449\u0435\u0433\u043E \u0432 \u0444\u0438\u043B\u044C\u043C\u0435 \u0441\u0430\u0443\u043D\u0434\u0442\u0440\u0435\u043A\u0430 \u0411\u0440\u044D\u0434\u0444\u043E\u0440\u0434\u0430 \u041A\u043E\u043A\u0441\u0430 \u0438\u0437 \u0433\u0440\u0443\u043F\u043F\u044B Deerhunter \u0440\u0430\u0441\u0441\u043A\u0430\u0437\u0430\u0442\u044C \u0441\u043E\u0432\u0441\u0435\u043C \u043D\u043E\u0432\u0443\u044E \u0438\u0441\u0442\u043E\u0440\u0438\u044E. \u0421\u043E\u0431\u0441\u0442\u0432\u0435\u043D\u043D\u043E, \u0432 \u044D\u0442\u043E\u043C \u0438 \u0441\u043E\u0441\u0442\u043E\u0438\u0442 \u043E\u0434\u043D\u0430 \u0438\u0437 \u043A\u043B\u044E\u0447\u0435\u0432\u044B\u0445 \u043C\u044B\u0441\u043B\u0435\u0439 \u0444\u0438\u043B\u044C\u043C\u0430 \u2014 \u043E\u0431\u0440\u0430\u0437\u044B \u044E\u043D\u043E\u0441\u0442\u0438 \u043F\u0440\u043E\u0448\u043B\u043E\u0433\u043E \u043E\u0431\u0440\u0430\u0449\u0435\u043D\u044B \u043D\u0435 \u0442\u043E\u043B\u044C\u043A\u043E \u0432 \u043F\u0440\u043E\u0448\u0435\u0434\u0448\u0435\u0435 \u0432\u0440\u0435\u043C\u044F, \u043D\u043E \u0438 \u043D\u0435\u043E\u0442\u0440\u044B\u0432\u043D\u043E \u0441\u0432\u044F\u0437\u0430\u043D\u044B \u0441 \u043D\u0430\u0441\u0442\u043E\u044F\u0449\u0438\u043C \u0438 \u043F\u043E\u0434\u0447\u0430\u0441 \u043E\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0435\u043D\u043D\u044B \u0437\u0430 \u0431\u0443\u0434\u0443\u0449\u0435\u0435.",
