    "nameEN": "London \u2013 The Modern Babylon",
    "director": "\u0414\u0436\u0443\u043B\u044C\u0435\u043D \u0422\u0435\u043C\u043F\u043B",
    "country": "Unknown",
    "year": "2012",
    "duration": 125,
    "description": "\u041F\u0440\u043E\u0448\u043B\u043E\u0435 \u0438 \u043D\u0430\u0441\u0442\u043E\u044F\u0449\u0435\u0435 \u0430\u043D\u0433\u043B\u0438\u0439\u0441\u043A\u043E\u0439 \u0441\u0442\u043E\u043B\u0438\u0446\u044B \u043F\u043E \u0432\u0435\u0440\u0441\u0438\u0438 \u0414\u0436\u0443\u043B\u0438\u0435\u043D\u0430 \u0422\u0435\u043C\u043F\u043B\u0430\n\n\u041D\u043E\u0432\u0430\u044F \u043A\u0430\u0440\u0442\u0438\u043D\u0430 \u043C\u0430\u0441\u0442\u0435\u0440\u0430 \u043C\u0443\u0437\u044B\u043A\u0430\u043B\u044C\u043D\u043E\u0439 \u0434\u043E\u043A\u0443\u043C\u0435\u043D\u0442\u0430\u043B\u0438\u0441\u0442\u0438\u043A\u0438 \u0414\u0436\u0443\u043B\u0438\u0435\u043D\u0430 \u0422\u0435\u043C\u043F\u043B\u0430 \u2014 \u0432\u043E\u0437\u043C\u043E\u0436\u043D\u043E, \u0435\u0433\u043E \u0441\u0430\u043C\u0430\u044F \u0430\u043C\u0431\u0438\u0446\u0438\u043E\u0437\u043D\u0430\u044F \u0438 \u0440\u0430\u0437\u043D\u043E\u0441\u0442\u043E\u0440\u043E\u043D\u043D\u044F\u044F \u043B\u0435\u043D\u0442\u0430. \u041F\u0440\u043E\u0441\u043C\u043E\u0442\u0440\u0435\u0432 6000 \u0447\u0430\u0441\u043E\u0432 \u0430\u0440\u0445\u0438\u0432\u043D\u044B\u0445 \u043C\u0430\u0442\u0435\u0440\u0438\u0430\u043B\u043E\u0432, \u0440\u0435\u0436\u0438\u0441\u0441\u0435\u0440 \u0441\u043E\u043E\u0440\u0443\u0434\u0438\u043B \u0444\u0438\u043B\u044C\u043C-\u043A\u043E\u043B\u043B\u0430\u0436 \u043E \u041B\u043E\u043D\u0434\u043E\u043D\u0435, \u0441\u0440\u0430\u0432\u043D\u0438\u0432 \u0441\u0432\u043E\u044E \u0440\u0430\u0431\u043E\u0442\u0443 \u0441 \u043F\u0443\u0442\u0435\u0448\u0435\u0441\u0442\u0432\u0438\u0435\u043C \u0432\u043E \u0432\u0440\u0435\u043C\u0435\u043D\u0438. \u041E\u043D \u0438\u043C\u0435\u043B \u0432\u043E\u0437\u043C\u043E\u0436\u043D\u043E\u0441\u0442\u044C \u0441\u043E\u0435\u0434\u0438\u043D\u0438\u0442\u044C \u0432 \u043E\u0434\u043D\u043E\u043C \u043F\u043E\u0432\u0435\u0441\u0442\u0432\u043E\u0432\u0430\u043D\u0438\u0438 \u043F\u0435\u0440\u0432\u044B\u0435 \u043A\u0430\u0434\u0440\u044B \u043D\u0430\u0447\u0430\u043B\u0430 \u0441\u0442\u043E\u043B\u0435\u0442\u0438\u044F, \u043E\u0442\u0440\u044B\u0432\u043A\u0438 \u0438\u0437 \u043F\u0430\u0440\u044B \u0434\u0435\u0441\u044F\u0442\u043A\u043E\u0432 \u043A\u043B\u044E\u0447\u0435\u0432\u044B\u0445 \u0444\u0438\u043B\u044C\u043C\u043E\u0432, \u0445\u0440\u043E\u043D\u0438\u043A\u0443 \u0438 \u0441\u043E\u0431\u0441\u0442\u0432\u0435\u043D\u043D\u044B\u0435 \u0441\u044A\u0435\u043C\u043A\u0438. \u041F\u043E\u043B\u0443\u0447\u0438\u043B\u0441\u044F \u043D\u0435 \u043F\u0440\u043E\u0441\u0442\u043E \u043F\u043E\u0440\u0442\u0440\u0435\u0442 \u0433\u043E\u0440\u043E\u0434\u0430, \u043D\u043E \u0435\u0433\u043E \u0431\u0438\u043E\u0433\u0440\u0430\u0444\u0438\u044F, \u0440\u0430\u0441\u0441\u043A\u0430\u0437 \u043E \u0442\u043E\u043C, \u043A\u0430\u043A \u043C\u0435\u0441\u0442\u043E \u0438 \u043B\u044E\u0434\u0438, \u0432 \u043D\u0435\u043C \u0436\u0438\u0432\u0443\u0449\u0438\u0435, \u043D\u0430\u0432\u0441\u0435\u0433\u0434\u0430 \u043C\u0435\u043D\u044F\u044E\u0442 \u0434\u0440\u0443\u0433 \u0434\u0440\u0443\u0433\u0430. \u0422\u0435\u043C\u043F\u043B \u0443\u043B\u0430\u0432\u043B\u0438\u0432\u0430\u0435\u0442 \u0438\u0441\u0442\u043E\u0440\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u0440\u0438\u0444\u043C\u044B \u0438 \u0437\u0430\u043A\u043E\u043D\u043E\u043C\u0435\u0440\u043D\u043E\u0441\u0442\u0438, \u0443\u0432\u044F\u0437\u044B\u0432\u0430\u0435\u0442 \u043A\u0443\u043B\u044C\u0442\u0443\u0440\u0443 \u0441 \u0441\u043E\u0446\u0438\u0430\u043B\u044C\u043D\u044B\u043C\u0438 \u0441\u043E\u0431\u044B\u0442\u0438\u044F\u043C\u0438 (\u043C\u0438\u0440\u043E\u0432\u044B\u0435 \u0432\u043E\u0439\u043D\u044B, \u043F\u0440\u0430\u0432\u043B\u0435\u043D\u0438\u0435 \u0422\u044D\u0442\u0447\u0435\u0440, \u043D\u0435\u0434\u0430\u0432\u043D\u0438\u0435 \u043F\u043E\u0433\u0440\u043E\u043C\u044B) \u2014 \u0441\u043B\u043E\u0432\u043E\u043C, \u043F\u0438\u0448\u0435\u0442 \u043D\u0430\u0441\u0442\u043E\u044F\u0449\u0443\u044E \u0441\u0438\u043C\u0444\u043E\u043D\u0438\u044E \u0433\u043E\u0440\u043E\u0434\u0430. \u0418, \u043A\u043E\u043D\u0435\u0447\u043D\u043E, \u044D\u0442\u043E \u043D\u0435 \u044D\u043D\u0446\u0438\u043A\u043B\u043E\u043F\u0435\u0434\u0438\u0447\u0435\u0441\u043A\u043E\u0435 \u0432\u044B\u0441\u043A\u0430\u0437\u044B\u0432\u0430\u043D\u0438\u0435, \u0430 \u043E\u0447\u0435\u043D\u044C \u043B\u0438\u0447\u043D\u043E\u0435 \u0438 \u043F\u0440\u0438\u0441\u0442\u0440\u0430\u0441\u0442\u043D\u043E\u0435. \u0417\u0434\u0435\u0441\u044C \u043D\u0435\u0442 \u0448\u0442\u0430\u043C\u043F\u043E\u0432, \u043D\u043E \u043E\u0431\u043E\u0448\u043B\u043E\u0441\u044C \u0438 \u0431\u0435\u0437 \u0443\u0434\u0443\u0448\u0430\u044E\u0449\u0435\u0433\u043E \u0441\u0442\u0440\u0430\u0445\u0430 \u043F\u043E\u043A\u0430\u0437\u0430\u0442\u044C\u0441\u044F \u0431\u0430\u043D\u0430\u043B\u044C\u043D\u044B\u043C: \u0444\u0438\u043B\u044C\u043C \u043D\u0430\u0447\u0438\u043D\u0430\u0435\u0442\u0441\u044F \u0441 \u043F\u0435\u0441\u043D\u0438 \u00ABLondon Calling\u00BB The Clash \u0438 \u0437\u0430\u0432\u0435\u0440\u0448\u0430\u0435\u0442\u0441\u044F \u043F\u043E\u0434 \u00ABWaterloo Sunset\u00BB The Kinks \u2014 \u0438 \u043D\u0435 \u043D\u0430\u0439\u0442\u0438 \u0435\u043C\u0443 \u043E\u0431\u0440\u0430\u043C\u043B\u0435\u043D\u0438\u044F \u0442\u043E\u0447\u043D\u0435\u0435.\n",
