    "duration": 15,
    "description": "\u0423 27-\u043B\u0435\u0442\u043D\u0435\u0433\u043E \u043D\u043E\u0440\u0432\u0435\u0436\u0446\u0430 \u041C\u0430\u0440\u0438\u0443\u0441\u0430 \u0421\u043E\u043B\u0435\u043C\u0430 \u0434\u0432\u0435 \u0441\u0442\u0440\u0430\u0441\u0442\u0438 \u0432 \u0436\u0438\u0437\u043D\u0438: \u0431\u0435\u0448\u0435\u043D\u044B\u0435 \u0442\u0430\u043D\u0446\u044B \u043F\u043E\u0434 \u044D\u043B\u0435\u043A\u0442\u0440\u043E\u043D\u043D\u0443\u044E \u043C\u0443\u0437\u044B\u043A\u0443 \u0438 \u0441\u0430\u043C\u043E\u0434\u0435\u043B\u044C\u043D\u044B\u0435 \u043D\u0430\u0440\u043A\u043E\u0442\u0438\u043A\u0438. \u041E\u043D \u0432\u043B\u0430\u0434\u0435\u0435\u0442 \u0441\u0430\u043B\u043E\u043D\u043E\u043C \u0437\u0430\u0433\u0430\u0440\u0430 \u0432 \u043C\u0430\u043B\u0435\u043D\u044C\u043A\u043E\u0439 \u043D\u043E\u0440\u0432\u0435\u0436\u0441\u043A\u043E\u0439 \u0434\u0435\u0440\u0435\u0432\u0443\u0448\u043A\u0435, \u0441\u0430\u0431\u043E\u0442\u0438\u0440\u0443\u0435\u0442 \u0432\u0441\u0435\u0445 \u0435\u0435 \u0436\u0438\u0442\u0435\u043B\u0435\u0439 \u0441\u0432\u043E\u0438\u043C\u0438 \u043A\u0438\u0441\u043B\u043E\u0442\u043D\u044B\u043C\u0438 \u0442\u0430\u043D\u0446\u0430\u043C\u0438 \u0438 \u0432\u044B\u043A\u043B\u0430\u0434\u044B\u0432\u0430\u0435\u0442 \u044D\u0442\u043E \u043D\u0430 YouTube \u043F\u043E\u0434 \u043F\u0441\u0435\u0432\u0434\u043E\u043D\u0438\u043C\u043E\u043C \u0418\u043D\u0441\u043F\u0435\u043A\u0442\u043E\u0440 \u041D\u043E\u0440\u0441\u0435. Whateverest \u2014 \u044D\u0442\u043E \u043F\u0440\u0438\u0434\u0443\u043C\u0430\u043D\u043D\u044B\u0439 \u041D\u043E\u0440\u0441\u0435 \u0441\u0438\u043C\u0432\u043E\u043B, \u0433\u043E\u0440\u0430 \u0435\u0433\u043E \u043D\u0435\u043E\u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043B\u0435\u043D\u043D\u044B\u0445 \u0436\u0435\u043B\u0430\u043D\u0438\u0439, \u043A\u043E\u0442\u043E\u0440\u0443\u044E \u043E\u043D \u043F\u0440\u0438\u0432\u044B\u043A \u043D\u0435 \u0437\u0430\u043C\u0435\u0447\u0430\u0442\u044C. \u0412\u043C\u0435\u0441\u0442\u043E \u0442\u043E\u0433\u043E \u0447\u0442\u043E\u0431\u044B \u0441\u0442\u0430\u0442\u044C \u0432\u0435\u043B\u0438\u043A\u0438\u043C \u043C\u0443\u0437\u044B\u043A\u0430\u043D\u0442\u043E\u043C, \u041C\u0430\u0440\u0438\u0443\u0441 \u043E\u0441\u0442\u0430\u043B\u0441\u044F \u0432 \u0441\u0432\u043E\u0435\u0439 \u0431\u043E\u0433\u043E\u043C \u0437\u0430\u0431\u044B\u0442\u043E\u0439 \u0434\u0435\u0440\u0435\u0432\u0443\u0448\u043A\u0435 \u0443\u0445\u0430\u0436\u0438\u0432\u0430\u0442\u044C \u0437\u0430 \u0431\u043E\u043B\u044C\u043D\u044B\u043C \u043E\u0442\u0446\u043E\u043C. \u041E\u043D \u0440\u0435\u0448\u0438\u043B \u0437\u0430\u0431\u0440\u043E\u0441\u0438\u0442\u044C \u043C\u0435\u0447\u0442\u044B \u043E \u0436\u0438\u0437\u043D\u0438 \u043A\u0440\u0443\u0442\u043E\u0433\u043E \u043F\u0430\u0440\u043D\u044F \u0438 \u043F\u0440\u043E\u0441\u0442\u043E \u0440\u0430\u0441\u043A\u0440\u0430\u0441\u0438\u0442\u044C \u0441\u0432\u043E\u044E \u043E\u0431\u044B\u0432\u0430\u0442\u0435\u043B\u044C\u0441\u043A\u0443\u044E \u0438\u0434\u0438\u043B\u043B\u0438\u044E \u043E\u0434\u0443\u0445\u043E\u0442\u0432\u043E\u0440\u0435\u043D\u043D\u044B\u043C\u0438 \u0442\u0430\u043D\u0446\u0430\u043C\u0438 \u043D\u0430 \u0437\u0430\u043A\u0430\u0442\u0435. \u041D\u0435\u0443\u043D\u044B\u0432\u0430\u044E\u0449\u0438\u0439 \u0444\u0438\u043B\u043E\u0441\u043E\u0444-\u043D\u0430\u0440\u043A\u043E\u043C\u0430\u043D \u0432\u0434\u043E\u0445\u043D\u043E\u0432\u0438\u043B \u043D\u043E\u0440\u0432\u0435\u0436\u0441\u043A\u043E\u0433\u043E \u0434\u0438\u0434\u0436\u0435\u044F \u0422\u043E\u0434\u0430 \u0422\u0435\u0440\u044C\u0435 \u043D\u0430 \u0437\u0430\u043F\u0438\u0441\u044C \u0442\u0440\u0435\u043A\u0430, \u043D\u0430\u0437\u0432\u0430\u043D\u043D\u043E\u0433\u043E \u0432 \u0435\u0433\u043E \u0447\u0435\u0441\u0442\u044C, \u2014 \u00ABInspector Norse\u00BB.",
