    "nameRU": " \u0412\u0435\u043B\u0438\u043A\u043E\u0435 \u0440\u043E\u043A-\u043D-\u0440\u043E\u043B\u043B\u044C\u043D\u043E\u0435 \u043D\u0430\u0434\u0443\u0432\u0430\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E",
    "nameEN": "The Great Rock-n-Roll Swindle",
    "director": "\u0414\u0436\u0443\u043B\u044C\u0435\u043D \u0422\u0435\u043C\u043F\u043B",
    "country": "\u0412\u0435\u043B\u0438\u043A\u043E\u0431\u0440\u0438\u0442\u0430\u043D\u0438\u044F",
    "year": "1980",
    "duration": 103,
    "description": "\u042D\u0442\u0438\u043C \u0434\u0435\u0440\u0437\u043A\u0438\u043C \u043C\u043E\u043A\u044C\u044E\u043C\u0435\u043D\u0442\u0430\u0440\u0438 \u0414\u0436\u0443\u043B\u0438\u0435\u043D \u0422\u0435\u043C\u043F\u043B \u0434\u0435\u0431\u044E\u0442\u0438\u0440\u043E\u0432\u0430\u043B \u0432 \u043A\u0438\u043D\u043E\u0440\u0435\u0436\u0438\u0441\u0441\u0443\u0440\u0435. \u0421\u0435\u0433\u043E\u0434\u043D\u044F \u00AB\u0412\u0435\u043B\u0438\u043A\u043E\u0435 \u0440\u043E\u043A-\u043D-\u0440\u043E\u043B\u043B\u044C\u043D\u043E\u0435 \u043D\u0430\u0434\u0443\u0432\u0430\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E\u00BB, \u0432\u044B\u0437\u0432\u0430\u0432\u0448\u0435\u0435 \u0432 \u0441\u0432\u043E\u0435 \u0432\u0440\u0435\u043C\u044F \u043D\u0435\u043C\u0430\u043B\u043E \u0441\u043F\u043E\u0440\u043E\u0432 \u0438 \u0441\u043A\u0430\u043D\u0434\u0430\u043B\u043E\u0432, \u2014 \u0441\u0430\u043C\u043E \u043F\u043E \u0441\u0435\u0431\u0435 \u043E\u0431\u0440\u0430\u0437\u0446\u043E\u0432\u044B\u0439 \u0434\u043E\u043A\u0443\u043C\u0435\u043D\u0442 \u044D\u043F\u043E\u0445\u0438, \u0432\u043E\u0437\u0432\u0440\u0430\u0449\u0430\u044E\u0449\u0438\u0439 \u043D\u0430\u0441 \u0432\u043E \u0432\u0440\u0435\u043C\u0435\u043D\u0430 \u0440\u0430\u0441\u0446\u0432\u0435\u0442\u0430 \u0431\u0440\u0438\u0442\u0430\u043D\u0441\u043A\u043E\u0433\u043E \u043A\u0438\u043D\u0435\u043C\u0430\u0442\u043E\u0433\u0440\u0430\u0444\u0430, \u0441\u043F\u043E\u0441\u043E\u0431\u043D\u043E\u0433\u043E \u0431\u044B\u0442\u044C \u043E\u0434\u043D\u043E\u0432\u0440\u0435\u043C\u0435\u043D\u043D\u043E \u043F\u0430\u0440\u0430\u0434\u043E\u043A\u0441\u0430\u043B\u044C\u043D\u044B\u043C, \u043D\u0430\u0441\u043C\u0435\u0448\u043B\u0438\u0432\u044B\u043C \u0438 \u043F\u0440\u043E\u043D\u0438\u043A\u043D\u043E\u0432\u0435\u043D\u043D\u044B\u043C. \u042D\u0442\u043E \u0432\u043E\u0432\u0441\u0435 \u043D\u0435 \u0441\u0442\u0440\u043E\u0433\u043E\u0435 \u0441\u0432\u0438\u0434\u0435\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u043E \u0432\u0437\u043B\u0435\u0442\u0435 \u0438 \u043F\u0430\u0434\u0435\u043D\u0438\u0438 \u0432\u0435\u043B\u0438\u043A\u0438\u0445 Sex Pistols, \u0430 \u0444\u0430\u043D\u0442\u0430\u0437\u0438\u044F, \u043A\u043E\u0442\u043E\u0440\u0430\u044F \u0441\u043E\u0447\u0435\u0442\u0430\u0435\u0442 \u0430\u043D\u0438\u043C\u0430\u0446\u0438\u043E\u043D\u043D\u044B\u0435 \u0432\u0441\u0442\u0430\u0432\u043A\u0438, \u0438\u0441\u0442\u043E\u0440\u0438\u0447\u0435\u0441\u043A\u0438\u0439 \u044D\u043F\u043E\u0441, \u043B\u0443\u043A\u0430\u0432\u044B\u0435 \u0440\u0430\u0441\u0441\u043A\u0430\u0437\u044B \u043C\u0435\u043D\u0435\u0434\u0436\u0435\u0440\u0430 \u0433\u0440\u0443\u043F\u043F\u044B \u041C\u0430\u043B\u043A\u043E\u043B\u044C\u043C\u0430 \u041C\u0430\u043A\u041B\u0430\u0440\u0435\u043D\u0430 \u043E\u0431 \u0438\u0437\u043E\u0431\u0440\u0435\u0442\u0435\u043D\u0438\u0438 \u043F\u0430\u043D\u043A-\u0440\u043E\u043A\u0430 \u0438, \u043D\u0430\u043A\u043E\u043D\u0435\u0446, \u0443\u043D\u0438\u043A\u0430\u043B\u044C\u043D\u044B\u0435 \u0437\u0430\u043F\u0438\u0441\u0438 \u0432\u044B\u0441\u0442\u0443\u043F\u043B\u0435\u043D\u0438\u0439 \u0433\u0440\u0443\u043F\u043F\u044B. \u041E\u0441\u043D\u043E\u0432\u043D\u043E\u0439 \u043C\u0430\u0442\u0435\u0440\u0438\u0430\u043B \u0441\u043D\u0438\u043C\u0430\u043B\u0441\u044F \u0432 \u043D\u0430\u0447\u0430\u043B\u0435 1978 \u0433\u043E\u0434\u0430, \u0442\u043E \u0435\u0441\u0442\u044C \u0422\u0435\u043C\u043F\u043B \u0437\u0430\u043F\u0435\u0447\u0430\u0442\u043B\u0435\u043B \u0443\u0436\u0435 \u043F\u0435\u0440\u0435\u0445\u043E\u0434\u043D\u044B\u0439 \u043C\u043E\u043C\u0435\u043D\u0442 \u0440\u0430\u0441\u043F\u0430\u0434\u0430, \u043D\u0430\u0447\u0430\u043B\u043E \u043A\u043E\u043D\u0446\u0430. \u0421\u043E\u0431\u0441\u0442\u0432\u0435\u043D\u043D\u043E, \u043D\u0435\u043D\u0430\u0432\u0438\u0434\u044F\u0449\u0438\u0439 \u041C\u0430\u043A\u041B\u0430\u0440\u0435\u043D\u0430 \u0414\u0436\u043E\u043D \u041B\u0430\u0439\u0434\u043E\u043D (\u044D\u043A\u0441 \u0414\u0436\u043E\u043D\u043D\u0438 \u0420\u043E\u0442\u0442\u0435\u043D) \u0432 \u0444\u0438\u043B\u044C\u043C\u0435 \u0443\u0447\u0430\u0441\u0442\u0432\u043E\u0432\u0430\u0442\u044C \u043E\u0442\u043A\u0430\u0437\u0430\u043B\u0441\u044F \u0438 \u043F\u043E\u043F\u0430\u0434\u0430\u0435\u0442 \u0432 \u043A\u0430\u0434\u0440 \u0442\u043E\u043B\u044C\u043A\u043E \u0432 \u0445\u0440\u043E\u043D\u0438\u043A\u0435. \u0417\u0430\u0442\u043E \u043C\u043D\u043E\u0433\u043E \u0421\u0438\u0434\u0430 \u0412\u0438\u0448\u0435\u0441\u0430, \u043A\u043E\u0442\u043E\u0440\u044B\u0439, \u0432 \u0447\u0430\u0441\u0442\u043D\u043E\u0441\u0442\u0438, \u0431\u0435\u0437\u0437\u0430\u0431\u043E\u0442\u043D\u043E \u0438\u0441\u043F\u043E\u043B\u043D\u044F\u0435\u0442 \u0437\u0434\u0435\u0441\u044C \u0443\u0434\u0438\u0432\u0438\u0442\u0435\u043B\u044C\u043D\u044B\u0439 \u043A\u0430\u0432\u0435\u0440 \u043D\u0430 \u043F\u0435\u0441\u043D\u044E \u0421\u0438\u043D\u0430\u0442\u0440\u044B. \u042D\u0442\u043E \u0441\u0430\u0442\u0438\u0440\u0438\u0447\u0435\u0441\u043A\u043E\u0435, \u043F\u043E\u0447\u0442\u0438 \u0444\u0430\u0440\u0441\u043E\u0432\u043E\u0435 \u0432\u044B\u0441\u043A\u0430\u0437\u044B\u0432\u0430\u043D\u0438\u0435, \u043D\u043E \u0433\u043E\u0440\u0435\u0447\u044C \u0435\u043C\u0443 \u043F\u0440\u0438\u0434\u0430\u0435\u0442 \u0442\u043E, \u0447\u0442\u043E \u0444\u0438\u043B\u044C\u043C \u0441\u0442\u0430\u0432\u0438\u0442 \u043D\u0435 \u043F\u0440\u043E\u0441\u0442\u043E \u0442\u043E\u0447\u043A\u0443 \u0432 \u0438\u0441\u0442\u043E\u0440\u0438\u0438 \u0433\u0440\u0443\u043F\u043F\u044B, \u043D\u043E \u0438 \u0442\u0430\u043A\u0438\u043C \u0441\u0442\u0440\u0430\u043D\u043D\u044B\u043C, \u043A\u0430\u0440\u043D\u0430\u0432\u0430\u043B\u044C\u043D\u044B\u043C \u043E\u0431\u0440\u0430\u0437\u043E\u043C \u0437\u0430\u043A\u0440\u044B\u0432\u0430\u0435\u0442 \u0441\u0430\u043C\u0438 \u0441\u0435\u043C\u0438\u0434\u0435\u0441\u044F\u0442\u044B\u0435 \u0433\u043E\u0434\u044B.",
