    "nameRU": " \u0414\u0436\u043E \u0421\u0442\u0440\u0430\u043C\u043C\u0435\u0440: \u0411\u0443\u0434\u0443\u0449\u0435\u0435 \u043D\u0435\u0438\u0437\u0432\u0435\u0441\u0442\u043D\u043E",
    "nameEN": "Joe Strummer: The Future Is Unwritten",
    "director": "\u0414\u0436\u0443\u043B\u044C\u0435\u043D \u0422\u0435\u043C\u043F\u043B",
    "country": "\u0418\u0440\u043B\u0430\u043D\u0434\u0438\u044F, \u0412\u0435\u043B\u0438\u043A\u043E\u0431\u0440\u0438\u0442\u0430\u043D\u0438\u044F",
    "year": "2007",
    "duration": 124,
    "description": "\u0421\u043D\u0430\u0447\u0430\u043B\u0430 \u0435\u0433\u043E \u0437\u0432\u0430\u043B\u0438 \u0414\u0436\u043E\u043D \u0413\u0440\u044D\u043C \u041C\u0435\u043B\u043B\u043E\u0440, \u043E\u043D \u0440\u043E\u0434\u0438\u043B\u0441\u044F \u0432 \u0410\u043D\u043A\u0430\u0440\u0435, \u0443\u0447\u0438\u043B\u0441\u044F \u0432 \u043F\u0440\u0435\u0441\u0442\u0438\u0436\u043D\u043E\u0439 \u0447\u0430\u0441\u0442\u043D\u043E\u0439 \u0448\u043A\u043E\u043B\u0435 \u0438 \u0443\u0432\u043B\u0435\u043A\u0430\u043B\u0441\u044F \u043C\u0443\u0437\u044B\u043A\u043E\u0439. \u0417\u0430\u0442\u0435\u043C \u043E\u043D \u0432\u0437\u044F\u043B \u0441\u0435\u0431\u0435 \u0438\u043C\u044F \u0414\u0436\u043E \u0421\u0442\u0440\u0430\u043C\u043C\u0435\u0440, \u0443\u0441\u043B\u044B\u0448\u0430\u043B \u0432\u043F\u0435\u0440\u0432\u044B\u0435 \u0432 \u0436\u0438\u0437\u043D\u0438 Sex Pistols \u0438 \u0441\u0442\u0430\u043B \u0444\u0440\u043E\u043D\u0442\u043C\u0435\u043D\u043E\u043C The Clash; \u0431\u0440\u0438\u0442\u0430\u043D\u0441\u043A\u043E\u0439 \u043A\u0443\u043B\u044C\u0442\u0443\u0440\u0435 \u043F\u043E\u0441\u043B\u0435 \u044D\u0442\u043E\u0433\u043E \u043D\u0435 \u0431\u044B\u0432\u0430\u0442\u044C \u043F\u0440\u0435\u0436\u043D\u0435\u0439. \u0421\u043D\u0438\u043C\u0430\u0442\u044C \u043F\u043E\u0440\u0442\u0440\u0435\u0442 \u0421\u0442\u0440\u0430\u043C\u043C\u0435\u0440\u0430 \u0431\u044B\u043B\u043E \u043D\u0430 \u0440\u043E\u0434\u0443 \u043D\u0430\u043F\u0438\u0441\u0430\u043D\u043E \u0414\u0436\u0443\u043B\u0438\u0435\u043D\u0443 \u0422\u0435\u043C\u043F\u043B\u0443, \u0433\u043B\u0430\u0432\u043D\u043E\u043C\u0443 \u0445\u0440\u043E\u043D\u0438\u043A\u0435\u0440\u0443 \u0430\u043D\u0433\u043B\u0438\u0439\u0441\u043A\u043E\u0439 \u0440\u043E\u043A-\u0441\u0446\u0435\u043D\u044B. \u041D\u043E \u0434\u0430\u0436\u0435 \u0435\u043C\u0443 \u043F\u043E\u043D\u0430\u0434\u043E\u0431\u0438\u043B\u043E\u0441\u044C \u043E\u043F\u0440\u0435\u0434\u0435\u043B\u0435\u043D\u043D\u043E\u0435 \u0432\u0440\u0435\u043C\u044F, \u0447\u0442\u043E\u0431\u044B \u043E\u0441\u043E\u0437\u043D\u0430\u0442\u044C \u043C\u0430\u0441\u0448\u0442\u0430\u0431\u044B \u043E\u0441\u0442\u0430\u0432\u0448\u0435\u0439\u0441\u044F \u043F\u043E\u0441\u043B\u0435 \u0432\u043D\u0435\u0437\u0430\u043F\u043D\u043E\u0439 \u0441\u043C\u0435\u0440\u0442\u0438 \u043C\u0443\u0437\u044B\u043A\u0430\u043D\u0442\u0430 \u0437\u0438\u044F\u044E\u0449\u0435\u0439 \u0434\u044B\u0440\u044B. \u0427\u0442\u043E\u0431\u044B \u0440\u0430\u0441\u0441\u043A\u0430\u0437\u0430\u0442\u044C \u043E \u0421\u0442\u0440\u0430\u043C\u043C\u0435\u0440\u0435, \u0440\u0435\u0436\u0438\u0441\u0441\u0435\u0440 \u043F\u0440\u043E\u0434\u0435\u043B\u0430\u043B \u043A\u043E\u043B\u043E\u0441\u0441\u0430\u043B\u044C\u043D\u0443\u044E \u0440\u0430\u0431\u043E\u0442\u0443: \u043E\u043D \u0432\u0437\u044F\u043B \u0434\u043B\u044F \u0444\u0438\u043B\u044C\u043C\u0430 \u0431\u043E\u043B\u0435\u0435 \u043F\u043E\u043B\u0443\u0441\u043E\u0442\u043D\u0438 \u0438\u043D\u0442\u0435\u0440\u0432\u044C\u044E \u0441 \u0441\u0430\u043C\u044B\u043C\u0438 \u0440\u0430\u0437\u043D\u044B\u043C\u0438 \u043B\u044E\u0434\u044C\u043C\u0438 \u2014 \u0432 \u0434\u0438\u0430\u043F\u0430\u0437\u043E\u043D\u0435 \u043E\u0442 \u0411\u043E\u043D\u043E \u0438 \u0411\u043E\u0431\u0431\u0438 \u0413\u0438\u043B\u043B\u0435\u0441\u043F\u0438 \u0434\u043E \u041C\u0430\u0440\u0442\u0438\u043D\u0430 \u0421\u043A\u043E\u0440\u0441\u0435\u0437\u0435 \u0438 \u0414\u0436\u043E\u043D\u043D\u0438 \u0414\u0435\u043F\u043F\u0430. \u0422\u0430\u043A\u043E\u0439 \u0440\u0430\u0437\u0431\u0440\u043E\u0441 \u0441\u043E\u0431\u0435\u0441\u0435\u0434\u043D\u0438\u043A\u043E\u0432 \u043B\u0438\u0448\u044C \u043F\u043E\u0434\u0447\u0435\u0440\u043A\u0438\u0432\u0430\u0435\u0442, \u043D\u0430\u0441\u043A\u043E\u043B\u044C\u043A\u043E \u0433\u043B\u0443\u0431\u043E\u043A\u0438\u0439 \u0441\u043B\u0435\u0434 \u043E\u0441\u0442\u0430\u0432\u0438\u043B \u0421\u0442\u0440\u0430\u043C\u043C\u0435\u0440 \u0432 \u043F\u0430\u043C\u044F\u0442\u0438 \u0434\u0440\u0443\u0433\u0438\u0445 \u043B\u044E\u0434\u0435\u0439; \u043E\u043D \u0431\u044B\u043B \u043E\u0434\u043D\u0438\u043C \u0438\u0437 \u043F\u043E\u0441\u043B\u0435\u0434\u043D\u0438\u0445, \u043A\u0442\u043E \u043D\u0435 \u0437\u0430\u0432\u0438\u0441\u0435\u043B \u043E\u0442 \u0432\u0440\u0435\u043C\u0435\u043D\u0438, \u043D\u043E \u0441\u0430\u043C \u0435\u0433\u043E \u043E\u043F\u0440\u0435\u0434\u0435\u043B\u044F\u043B.",
