    "year": "2012",
    "duration": 97,
    "description": "\u0414\u0430\u0442\u0441\u043A\u0438\u0439 \u043F\u043E\u0434\u0440\u043E\u0441\u0442\u043E\u043A \u041D\u0438\u043A\u043E\u043B\u0430\u0441 \u0412\u0435\u0441\u0442\u0432\u0443\u0434 \u0432\u0437\u044F\u043B \u0441\u0435\u0431\u0435 \u0441\u0446\u0435\u043D\u0438\u0447\u0435\u0441\u043A\u043E\u0435 \u0438\u043C\u044F \u041A\u0438\u0434\u0434, \u043F\u043E\u043B\u043E\u0436\u0438\u043B \u043D\u0430 YouTube \u0437\u0430\u043F\u0438\u0441\u0430\u043D\u043D\u0443\u044E \u0441 \u0434\u0440\u0443\u0437\u044C\u044F\u043C\u0438 \u043F\u0435\u0441\u043D\u044E \u0438 \u0441\u0442\u0430\u043B \u0441\u0430\u043C\u044B\u043C \u043F\u043E\u043F\u0443\u043B\u044F\u0440\u043D\u044B\u043C \u043D\u0430 \u0440\u043E\u0434\u0438\u043D\u0435 \u0440\u044D\u043F\u0435\u0440\u043E\u043C, \u0432\u0438\u0434\u0435\u043E \u043A\u043E\u0442\u043E\u0440\u043E\u0433\u043E \u0441\u043E\u0431\u0438\u0440\u0430\u044E\u0442 \u043C\u0438\u043B\u043B\u0438\u043E\u043D\u044B \u043F\u0440\u043E\u0441\u043C\u043E\u0442\u0440\u043E\u0432, \u0430 \u0437\u0430\u043F\u0438\u0441\u0438 \u0432\u043E\u0437\u0433\u043B\u0430\u0432\u043B\u044F\u044E\u0442 \u0442\u043E\u043F \u043F\u0440\u043E\u0434\u0430\u0436 \u043D\u0430 iTunes. \u0410\u043D\u0434\u0440\u0435\u0430\u0441 \u0419\u043E\u043D\u0441\u0435\u043D \u0437\u0430\u043F\u0435\u0447\u0430\u0442\u043B\u0435\u043B \u0438\u0441\u0442\u043E\u0440\u0438\u044E \u0432\u0437\u043B\u0435\u0442\u0430 \u0438 \u043F\u0430\u0434\u0435\u043D\u0438\u044F, \u043E\u0447\u0435\u043D\u044C \u0445\u0430\u0440\u0430\u043A\u0442\u0435\u0440\u043D\u0443\u044E \u0434\u043B\u044F \u043C\u0438\u0440\u0430 \u0432\u0435\u0431 2.0, \u043A\u043E\u0433\u0434\u0430 \u043F\u043E\u043F\u0443\u043B\u044F\u0440\u043D\u043E\u0441\u0442\u044C \u0438 \u0441\u043B\u0430\u0432\u0430 \u043F\u0440\u0438\u0445\u043E\u0434\u044F\u0442 \u0438 \u0443\u0445\u043E\u0434\u044F\u0442 \u0441\u0430\u043C\u044B\u043C \u043F\u0440\u0438\u0447\u0443\u0434\u043B\u0438\u0432\u044B\u043C \u043E\u0431\u0440\u0430\u0437\u043E\u043C (\u0441\u043C. \u043E\u0431 \u044D\u0442\u043E\u043C \u043E\u0434\u043D\u0443 \u0438\u0437 \u0433\u043B\u0430\u0432 \u00AB\u0420\u0438\u043C\u0441\u043A\u0438\u0445 \u043F\u0440\u0438\u043A\u043B\u044E\u0447\u0435\u043D\u0438\u0439\u00BB \u0412\u0443\u0434\u0438 \u0410\u043B\u043B\u0435\u043D\u0430). \u041F\u043E\u043A\u043B\u043E\u043D\u043D\u0438\u043A\u043E\u043C 22-\u043B\u0435\u0442\u043D\u0435\u0433\u043E \u043C\u0443\u0437\u044B\u043A\u0430\u043D\u0442\u0430 \u0441\u0442\u0430\u043B \u0434\u0430\u0436\u0435 \u0434\u0430\u0442\u0441\u043A\u0438\u0439 \u043F\u0440\u0435\u043C\u044C\u0435\u0440-\u043C\u0438\u043D\u0438\u0441\u0442\u0440, \u043C\u0435\u0447\u0442\u0430\u0432\u0448\u0438\u0439 \u043E\u0431 \u0430\u0432\u0442\u043E\u0433\u0440\u0430\u0444\u0435; \u043D\u043E \u00AB\u0416\u0438\u0437\u043D\u044C \u041A\u0438\u0434\u0434\u0430\u00BB \u0440\u0430\u0441\u0441\u043A\u0430\u0437\u044B\u0432\u0430\u0435\u0442 \u0438 \u043E\u0431 \u043E\u0431\u043E\u0440\u043E\u0442\u043D\u043E\u0439 \u0441\u0442\u043E\u0440\u043E\u043D\u0435 \u0432\u043D\u0435\u0437\u0430\u043F\u043D\u044B\u0445 \u043F\u043E\u0431\u0435\u0434: \u0440\u0435\u0436\u0438\u0441\u0441\u0435\u0440 \u0441 \u0434\u0438\u043A\u0438\u043C \u0434\u0440\u0430\u0439\u0432\u043E\u043C \u0438 \u043F\u0440\u0430\u043A\u0442\u0438\u0447\u0435\u0441\u043A\u0438 \u0440\u043E\u043C\u0430\u043D\u043D\u044B\u043C \u0440\u0430\u0437\u043C\u0430\u0445\u043E\u043C \u0437\u0430\u043F\u0435\u0447\u0430\u0442\u043B\u0435\u0432\u0430\u0435\u0442 \u043D\u043E\u0432\u044B\u0439 \u043C\u0438\u0440 \u0432\u043E\u0437\u043C\u043E\u0436\u043D\u043E\u0441\u0442\u0435\u0439, \u0438\u0441\u043A\u0443\u0448\u0435\u043D\u0438\u0439 \u0438 \u0438\u0441\u043F\u044B\u0442\u0430\u043D\u0438\u0439, \u043A\u043E\u0442\u043E\u0440\u044B\u0439 \u043E\u0442\u043A\u0440\u044B\u043B\u0441\u044F \u043F\u0435\u0440\u0435\u0434 \u043D\u043E\u0432\u043E\u0439 \u0437\u0432\u0435\u0437\u0434\u043E\u0439.",
