    "country": "\u0414\u0430\u043D\u0438\u044F, \u0421\u0428\u0410",
    "year": "2012",
    "duration": 60,
    "description": "\u041F\u0438\u0442\u0438 \u0438\u0433\u0440\u0430\u0435\u0442 \u043D\u0430 \u0433\u0438\u0442\u0430\u0440\u0435 \u0432 \u0433\u0430\u0440\u0430\u0436\u043D\u043E\u0439 \u0433\u0440\u0443\u043F\u043F\u0435 Thee Oh Sees \u0438 \u0440\u0430\u0431\u043E\u0442\u0430\u0435\u0442 \u043D\u0430 \u0441\u043A\u043B\u0430\u0434\u0435 \u043F\u043E\u0440\u043D\u043E\u0433\u0440\u0430\u0444\u0438\u0438, \u0443\u043F\u0430\u043A\u043E\u0432\u044B\u0432\u0430\u044F \u0438 \u0440\u0430\u0441\u0441\u044B\u043B\u0430\u044F \u043F\u043E \u0432\u0441\u0435\u043C \u043C\u0438\u0440\u0443 \u0441\u0435\u043A\u0441-\u0438\u0433\u0440\u0443\u0448\u043A\u0438 \u0438 \u0432\u0438\u0434\u0435\u043E \u0434\u043B\u044F \u0432\u0437\u0440\u043E\u0441\u043B\u044B\u0445. \u0414\u0436\u0438\u043D\u0434\u0436\u0435\u0440 \u0432 \u043D\u043E\u0447\u043D\u0443\u044E \u0441\u043C\u0435\u043D\u0443 \u0432 \u043D\u044C\u044E-\u0439\u043E\u0440\u043A\u0441\u043A\u043E\u043C \u0431\u0430\u0440\u0435 \u043F\u0440\u0435\u0434\u0441\u043A\u0430\u0437\u044B\u0432\u0430\u0435\u0442 \u0441\u0447\u0430\u0441\u0442\u043B\u0438\u0432\u043E\u0435 \u0431\u0443\u0434\u0443\u0449\u0435\u0435 \u043B\u044E\u0434\u044F\u043C, \u043E\u0441\u043E\u0431\u0435\u043D\u043D\u043E \u043F\u043E\u0441\u0442\u0440\u0430\u0434\u0430\u0432\u0448\u0438\u043C \u043E\u0442 \u043E\u0431\u0432\u0430\u043B\u0430 \u044D\u043A\u043E\u043D\u043E\u043C\u0438\u043A\u0438 \u0432 2008-\u043C. \u041E\u043D\u0438 \u043E\u0431\u0430 \u0432\u044B\u0440\u043E\u0441\u043B\u0438 \u043D\u0430 \u0430\u043C\u0435\u0440\u0438\u043A\u0430\u043D\u0441\u043A\u043E\u0439 \u0438\u0434\u0435\u043E\u043B\u043E\u0433\u0438\u0438 \u0432\u0441\u0435\u043E\u0431\u0449\u0435\u0433\u043E \u0441\u0447\u0430\u0441\u0442\u044C\u044F \u0438 \u0431\u043B\u0430\u0433\u043E\u043F\u043E\u043B\u0443\u0447\u0438\u044F \u0438 \u043E\u0431\u0430 \u0441\u0442\u043E\u043B\u043A\u043D\u0443\u043B\u0438\u0441\u044C \u0441 \u043C\u0438\u0440\u043E\u043C \u0440\u0430\u0437\u0440\u0443\u0448\u0435\u043D\u043D\u044B\u0445 \u043D\u0430\u0434\u0435\u0436\u0434, \u043D\u0435\u0432\u044B\u043F\u043E\u043B\u043D\u0435\u043D\u043D\u044B\u0445 \u0441\u043E\u0446\u0438\u0430\u043B\u044C\u043D\u044B\u0445 \u043E\u0431\u0435\u0449\u0430\u043D\u0438\u0439 \u0438 \u0442\u044F\u0436\u0435\u043B\u043E\u0433\u043E \u0444\u0438\u043D\u0430\u043D\u0441\u043E\u0432\u043E\u0433\u043E \u043A\u0440\u0438\u0437\u0438\u0441\u0430. \u00AB\u041F\u0438\u0442\u0438 & \u0414\u0436\u0438\u043D\u0434\u0436\u0435\u0440\u00BB \u2014 \u044D\u0442\u043E \u0432\u0437\u0440\u043E\u0441\u043B\u0430\u044F \u0441\u043A\u0430\u0437\u043A\u0430 \u043E \u0434\u0432\u0443\u0445 \u0430\u0443\u0442\u0441\u0430\u0439\u0434\u0435\u0440\u0430\u0445, \u0437\u0430\u0431\u043B\u0443\u0434\u0438\u0432\u0448\u0438\u0445\u0441\u044F \u0432 \u0441\u0432\u043E\u0435\u043C \u043F\u043E\u0438\u0441\u043A\u0435 \u043F\u0440\u043E\u0441\u0442\u043E\u0433\u043E \u0447\u0435\u043B\u043E\u0432\u0435\u0447\u0435\u0441\u043A\u043E\u0433\u043E \u0441\u0447\u0430\u0441\u0442\u044C\u044F. \u042D\u0442\u043E \u0444\u0438\u043B\u044C\u043C \u043E \u043C\u0438\u0440\u0435, \u0432 \u043A\u043E\u0442\u043E\u0440\u043E\u043C \u0442\u043E\u043B\u044C\u043A\u043E \u043C\u0443\u0437\u044B\u043A\u0430 \u0438 \u0434\u0440\u0443\u0436\u0431\u0430 \u043F\u043E\u043C\u043E\u0433\u0430\u044E\u0442 \u0447\u0435\u043B\u043E\u0432\u0435\u043A\u0443 \u043E\u0441\u0442\u0430\u0442\u044C\u0441\u044F \u043D\u0430 \u043F\u043B\u0430\u0432\u0443.",
