    "director": "\u042D\u043D\u0442\u043E\u043D\u0438 \u0425\u0435\u0433\u0430\u0440\u0442\u0438, \u0427\u0430\u0440\u043B\u044C\u0437 \u0410\u0442\u043B\u0430\u0441",
    "country": "\u0414\u0430\u043D\u0438\u044F",
    "year": "2012",
    "duration": 76,
    "description": "\u0427\u0435\u0440\u0435\u0437 \u0433\u043E\u0434 \u043F\u043E\u0441\u043B\u0435 \u0437\u0430\u043F\u0438\u0441\u0438 \u0430\u043B\u044C\u0431\u043E\u043C\u0430 \u00ABI Am a Bird Now\u00BB (2005) \u0433\u0440\u0443\u043F\u043F\u0430 Antony and the Johnsons \u0432\u044B\u0441\u0442\u0443\u043F\u0438\u043B\u0430 \u0441 \u043A\u043E\u043D\u0446\u0435\u0440\u0442\u043D\u044B\u043C \u0448\u043E\u0443 \u00ABTurning\u00BB, \u043A\u043E\u0442\u043E\u0440\u043E\u0435 \u0441\u0430\u043C \u042D\u043D\u0442\u043E\u043D\u0438 \u0425\u0435\u0433\u0430\u0440\u0442\u0438 \u043D\u0430\u0437\u0432\u0430\u043B \u00AB\u0431\u0440\u043E\u0434\u044F\u0436\u044C\u0435\u0439 \u0433\u0430\u043B\u0435\u0440\u0435\u0435\u0439 \u0432\u0435\u043B\u0438\u043A\u043E\u043B\u0435\u043F\u0438\u044F\u00BB. \u0414\u043B\u044F \u044D\u0442\u043E\u0433\u043E \u0435\u0432\u0440\u043E\u043F\u0435\u0439\u0441\u043A\u043E\u0433\u043E \u0442\u0443\u0440\u0430 \u0431\u044B\u043B\u0438 \u0432\u044B\u0431\u0440\u0430\u043D\u044B 13 \u0436\u0435\u043D\u0449\u0438\u043D-\u043C\u043E\u0434\u0435\u043B\u0435\u0439, \u043A\u043E\u0442\u043E\u0440\u044B\u0435 \u0432\u043E \u0432\u0440\u0435\u043C\u044F \u0432\u044B\u0441\u0442\u0443\u043F\u043B\u0435\u043D\u0438\u044F \u042D\u043D\u0442\u043E\u043D\u0438 \u043F\u043E \u043E\u0447\u0435\u0440\u0435\u0434\u0438 \u043C\u043E\u043B\u0447\u0430 \u0441\u0442\u043E\u044F\u043B\u0438 \u043D\u0430 \u0432\u0440\u0430\u0449\u0430\u044E\u0449\u0435\u0439\u0441\u044F \u043F\u043B\u0430\u0442\u0444\u043E\u0440\u043C\u0435. \u0418\u0445 \u043F\u043E\u0440\u0442\u0440\u0435\u0442\u044B \u0432\u044B\u0432\u043E\u0434\u0438\u043B \u043D\u0430 \u044D\u043A\u0440\u0430\u043D \u0438 \u0437\u0430\u043F\u0435\u0447\u0430\u0442\u043B\u0435\u0432\u0430\u043B \u0432\u0438\u0434\u0435\u043E\u0445\u0443\u0434\u043E\u0436\u043D\u0438\u043A \u0427\u0430\u0440\u043B\u0437 \u0410\u0442\u043B\u0430\u0441, \u043F\u0440\u043E\u0440\u0430\u0431\u043E\u0442\u0430\u0432\u0448\u0438\u0439 \u043C\u043D\u043E\u0433\u043E \u043B\u0435\u0442 \u0441\u043E \u0437\u043D\u0430\u043C\u0435\u043D\u0438\u0442\u044B\u043C \u0445\u043E\u0440\u0435\u043E\u0433\u0440\u0430\u0444\u043E\u043C \u041C\u0435\u0440\u0441\u043E\u043C \u041A\u0430\u043D\u043D\u0438\u043D\u0433\u0435\u043C\u043E\u043C. \u0423 \u0432\u0441\u0435\u0445 \u0443\u0447\u0430\u0441\u0442\u043D\u0438\u0446 \u0437\u0430\u0433\u0430\u0434\u043E\u0447\u043D\u0430\u044F \u0430\u0443\u0440\u0430, \u043D\u0435\u043F\u0440\u043E\u0441\u0442\u0430\u044F \u0441\u0443\u0434\u044C\u0431\u0430 \u0438 \u043E\u0441\u043E\u0431\u044B\u0435 \u043E\u0442\u043D\u043E\u0448\u0435\u043D\u0438\u044F \u0441 \u0441\u043E\u0431\u0441\u0442\u0432\u0435\u043D\u043D\u043E\u0439 \u0441\u0435\u043A\u0441\u0443\u0430\u043B\u044C\u043D\u043E\u0441\u0442\u044C\u044E. \u0417\u0430 \u043A\u0443\u043B\u0438\u0441\u0430\u043C\u0438 \u043E\u043D\u0438 \u0434\u0430\u044E\u0442 \u0438\u043D\u0442\u0435\u0440\u0432\u044C\u044E \u042D\u043D\u0442\u043E\u043D\u0438. \u041F\u0435\u0440\u0435\u0434 \u043D\u0430\u043C\u0438 \u043B\u0438\u0434\u0435\u0440 \u0433\u0440\u0443\u043F\u043F\u044B The Voluptuous Horror of Karen Black, \u0442\u0440\u0430\u043D\u0441\u0433\u0435\u043D\u0434\u0435\u0440\u043D\u0430\u044F \u043C\u043E\u0434\u0435\u043B\u044C \u0444\u043E\u0442\u043E\u0433\u0440\u0430\u0444\u0430 \u041D\u0430\u043D \u0413\u043E\u043B\u0434\u0438\u043D, \u0434\u0438\u0437\u0430\u0439\u043D\u0435\u0440\u044B, \u0445\u0443\u0434\u043E\u0436\u043D\u0438\u043A\u0438 \u0438 \u043F\u0440\u043E\u0441\u0442\u043E \u043B\u044E\u0434\u0438. \u00AB\u041F\u0440\u0435\u0432\u0440\u0430\u0449\u0435\u043D\u0438\u0435\u00BB \u043D\u0435 \u0434\u043E\u043A\u0443\u043C\u0435\u043D\u0442\u0430\u0446\u0438\u044F \u044D\u0442\u043E\u0433\u043E \u0438\u0437\u043E\u0431\u0440\u0435\u0442\u0430\u0442\u0435\u043B\u044C\u043D\u043E\u0433\u043E \u043F\u0435\u0440\u0444\u043E\u0440\u043C\u0430\u043D\u0441\u0430, \u043D\u043E \u0435\u0433\u043E \u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u043E\u0435 \u043F\u0440\u043E\u0434\u043E\u043B\u0436\u0435\u043D\u0438\u0435, \u043A\u0443\u043B\u044C\u043C\u0438\u043D\u0430\u0446\u0438\u044F \u043F\u0440\u043E\u0435\u043A\u0442\u0430. \u042D\u0442\u043E \u0438 \u0444\u0438\u043B\u044C\u043C-\u043A\u043E\u043D\u0446\u0435\u0440\u0442, \u043F\u043E\u0437\u0432\u043E\u043B\u044F\u044E\u0449\u0438\u0439 \u043F\u043E\u0433\u0440\u0443\u0437\u0438\u0442\u044C\u0441\u044F \u0432 \u0430\u0442\u043C\u043E\u0441\u0444\u0435\u0440\u0443 \u0432\u0430\u0436\u043D\u0435\u0439\u0448\u0435\u0439 \u0434\u043B\u044F \u043C\u0443\u0437\u044B\u043A\u0430\u043D\u0442\u0430 \u0441\u0435\u0440\u0438\u0438 \u043A\u043E\u043D\u0446\u0435\u0440\u0442\u043E\u0432, \u0438 \u043A\u043E\u043B\u043B\u0435\u043A\u0446\u0438\u044F \u043F\u043E\u0434\u0447\u0430\u0441 \u0433\u0440\u0443\u0441\u0442\u043D\u044B\u0445 \u0438\u0441\u0442\u043E\u0440\u0438\u0439, \u043A\u043E\u0442\u043E\u0440\u044B\u0435 \u0438\u0434\u0435\u0430\u043B\u044C\u043D\u043E \u0440\u0435\u0437\u043E\u043D\u0438\u0440\u0443\u044E\u0442 \u0441 \u043F\u0435\u0447\u0430\u043B\u044C\u043D\u043E\u0439 \u043C\u0443\u0437\u044B\u043A\u043E\u0439 Antony and the Johnsons \u0438 \u0432\u0441\u0442\u0443\u043F\u0430\u044E\u0442 \u0441 \u043D\u0435\u0439 \u0432 \u0441\u0432\u043E\u0439 \u043E\u0441\u043E\u0431\u0435\u043D\u043D\u044B\u0439 \u0434\u0438\u0430\u043B\u043E\u0433.",
