    "nameRU": "Efterklang: \u041F\u0440\u0438\u0437\u0440\u0430\u043A \u041F\u0438\u0440\u0430\u043C\u0438\u0434\u044B",
    "nameEN": "Efterklang: The Ghost of Piramida",
    "director": " \u0410\u043D\u0434\u0440\u0435\u0430\u0441 \u041A\u0435\u0444\u0435\u0434",
    "country": "\u0414\u0430\u043D\u0438\u044F",
    "year": "2012",
    "duration": 65,
    "description": "\u0424\u0438\u043B\u044C\u043C \u0440\u0430\u0441\u0441\u043A\u0430\u0437\u044B\u0432\u0430\u0435\u0442 \u043E \u043F\u0440\u0438\u043A\u043B\u044E\u0447\u0435\u043D\u0438\u044F\u0445 \u0433\u0440\u0443\u043F\u043F\u044B Efterklang \u0432 \u0437\u0430\u0431\u0440\u043E\u0448\u0435\u043D\u043D\u043E\u043C \u0443\u0433\u043E\u043B\u044C\u043D\u043E\u043C \u0433\u043E\u0440\u043E\u0434\u043A\u0435 \u0441\u043E\u0432\u0435\u0442\u0441\u043A\u043E\u0433\u043E \u043E\u0431\u0440\u0430\u0437\u0446\u0430 \u0441 \u0440\u043E\u043C\u0430\u043D\u0442\u0438\u0447\u0435\u0441\u043A\u0438\u043C \u043D\u0430\u0437\u0432\u0430\u043D\u0438\u0435\u043C \u041F\u0438\u0440\u0430\u043C\u0438\u0434\u0430. Efterklang \u0438\u0449\u0443\u0442 \u0437\u0432\u0443\u043A\u0438 \u0432 \u043E\u043F\u0443\u0441\u0442\u0435\u0432\u0448\u0438\u0445 \u0434\u043E\u043C\u0430\u0445 \u0433\u043E\u0440\u043E\u0434\u0430-\u043F\u0440\u0438\u0437\u0440\u0430\u043A\u0430, \u043F\u043E\u043A\u0430 \u043F\u043E\u043B\u044F\u0440\u043D\u0438\u043A \u0410\u043B\u0435\u043A\u0441\u0430\u043D\u0434\u0440 \u0434\u0435\u043B\u0438\u0442\u0441\u044F \u043E\u0431\u0440\u044B\u0432\u043A\u0430\u043C\u0438 \u0441\u0432\u043E\u0438\u0445 \u0432\u043E\u0441\u043F\u043E\u043C\u0438\u043D\u0430\u043D\u0438\u0439, \u0437\u0430\u0441\u043D\u044F\u0442\u044B\u0445 \u043D\u0430 \u0441\u0442\u0430\u0440\u0443\u044E \u043A\u0438\u043D\u043E\u043F\u043B\u0435\u043D\u043A\u0443. \u041F\u0438\u0440\u0430\u043C\u0438\u0434\u0430 \u0431\u044B\u043B\u0430 \u0434\u043B\u044F \u043D\u0435\u0433\u043E \u043E\u0441\u0442\u0440\u043E\u0432\u043E\u043C \u0432\u043E\u043F\u043B\u043E\u0449\u0435\u043D\u043D\u043E\u0439 \u0441\u043E\u0432\u0435\u0442\u0441\u043A\u043E\u0439 \u043C\u0435\u0447\u0442\u044B \u2014 \u0438 \u0441\u0432\u0435\u0442 \u043E\u0442 \u044D\u0442\u043E\u0439 \u0434\u0430\u0432\u043D\u043E \u0443\u0448\u0435\u0434\u0448\u0435\u0439 \u0438\u043B\u043B\u044E\u0437\u0438\u0438 \u043F\u0440\u0435\u0432\u0440\u0430\u0449\u0430\u0435\u0442 \u0431\u0438\u043E\u0433\u0440\u0430\u0444\u0438\u044E \u043F\u0440\u043E\u0441\u0442\u043E\u0433\u043E \u043F\u043E\u043B\u044F\u0440\u043D\u0438\u043A\u0430 \u0432 \u043F\u043E\u044D\u0442\u0438\u0447\u043D\u0443\u044E \u0441\u043A\u0430\u0437\u043A\u0443. \u0414\u0432\u0435 \u0438\u0441\u0442\u043E\u0440\u0438\u0438 \u043D\u0430\u043A\u043B\u0430\u0434\u044B\u0432\u0430\u044E\u0442\u0441\u044F \u0434\u0440\u0443\u0433 \u043D\u0430 \u0434\u0440\u0443\u0433\u0430, \u0441\u043E\u0437\u0434\u0430\u0432\u0430\u044F \u0443\u043D\u0438\u043A\u0430\u043B\u044C\u043D\u043E\u0435 \u043A\u0438\u043D\u043E \u043E \u043C\u0443\u0437\u044B\u043A\u0435 \u0438 \u043E \u0436\u0438\u0437\u043D\u0438 \u0432\u043E\u043E\u0431\u0449\u0435. \u00AB\u041F\u0440\u0438\u0437\u0440\u0430\u043A \u041F\u0438\u0440\u0430\u043C\u0438\u0434\u044B\u00BB \u2014 \u044D\u0442\u043E \u0444\u0438\u043B\u044C\u043C \u043E \u0442\u043E\u043C, \u043A\u0430\u043A \u043D\u043E\u0432\u044B\u0435 \u0441\u043A\u0430\u043D\u0434\u0438\u043D\u0430\u0432\u0441\u043A\u0438\u0435 \u043C\u0435\u043B\u043E\u0434\u0438\u0438 \u0440\u043E\u0436\u0434\u0430\u044E\u0442\u0441\u044F \u043D\u0430 \u043E\u0431\u043B\u043E\u043C\u043A\u0430\u0445 \u0441\u043E\u0432\u0435\u0442\u0441\u043A\u0438\u0445 \u0438\u043B\u043B\u044E\u0437\u0438\u0439.",
