    "country": "\u0411\u0440\u0430\u0437\u0438\u043B\u0438\u044F, \u0421\u0428\u0410, \u0412\u0435\u043B\u0438\u043A\u043E\u0431\u0440\u0438\u0442\u0430\u043D\u0438\u044F",
    "year": "2012",
    "duration": 87,
    "description": "\u041F\u043E\u0441\u043B\u0435 \u0432\u043E\u0435\u043D\u043D\u043E\u0433\u043E \u043F\u0435\u0440\u0435\u0432\u043E\u0440\u043E\u0442\u0430 1964 \u0433\u043E\u0434\u0430 \u0432 \u0411\u0440\u0430\u0437\u0438\u043B\u0438\u0438 \u043F\u043E\u0447\u0442\u0438 \u043D\u0430 \u0434\u0432\u0430\u0434\u0446\u0430\u0442\u044C \u043B\u0435\u0442 \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u0438\u043B\u0441\u044F \u0430\u0432\u0442\u043E\u0440\u0438\u0442\u0430\u0440\u043D\u044B\u0439 \u0440\u0435\u0436\u0438\u043C. \u041F\u0440\u0438\u043C\u0435\u0440\u043D\u043E \u0442\u043E\u0433\u0434\u0430 \u0436\u0435 \u0432 \u0441\u0442\u0440\u0430\u043D\u0435 \u0432 \u043A\u0430\u0447\u0435\u0441\u0442\u0432\u0435 \u0441\u043F\u043E\u043D\u0442\u0430\u043D\u043D\u043E\u0439 \u0440\u0435\u0430\u043A\u0446\u0438\u0438 \u043D\u0430 \u043F\u043E\u043B\u0438\u0442\u0438\u0447\u0435\u0441\u043A\u043E\u0435 \u0431\u0443\u0440\u043B\u0435\u043D\u0438\u0435 \u0437\u0430\u0440\u043E\u0434\u0438\u043B\u043E\u0441\u044C \u043C\u043E\u0449\u043D\u0435\u0439\u0448\u0435\u0435 \u0430\u0440\u0442\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043A\u043E\u0435 \u0434\u0432\u0438\u0436\u0435\u043D\u0438\u0435 \u00AB\u0422\u0440\u043E\u043F\u0438\u043A\u0430\u043B\u0438\u044F\u00BB, \u0437\u0430\u0442\u0440\u043E\u043D\u0443\u0432\u0448\u0435\u0435 \u043C\u0443\u0437\u044B\u043A\u0443, \u043F\u043E\u044D\u0437\u0438\u044E \u0438 \u043A\u0438\u043D\u043E. \u0412 \u043F\u0435\u0440\u0432\u0443\u044E \u043E\u0447\u0435\u0440\u0435\u0434\u044C \u043E\u043D\u043E \u0432\u0434\u043E\u0445\u043D\u043E\u0432\u043B\u044F\u043B\u043E\u0441\u044C \u043C\u0443\u0437\u044B\u043A\u0430\u043D\u0442\u0430\u043C\u0438-\u043D\u043E\u0432\u0430\u0442\u043E\u0440\u0430\u043C\u0438, \u0441\u0440\u0435\u0434\u0438 \u043A\u043E\u0442\u043E\u0440\u044B\u0445 \u0431\u044B\u043B\u0438 Os Mutantes, \u0416\u0438\u043B\u0431\u0435\u0440\u0442\u0443 \u0416\u0438\u043B, \u0422\u043E\u043C \u0417\u0435 \u0438 \u041A\u0430\u044D\u0442\u0430\u043D\u0443 \u0412\u0435\u043B\u043E\u0437\u0443 (\u0438\u0445 \u0441\u043E\u0431\u0440\u0430\u0442\u043E\u043C \u0432 \u043A\u0438\u043D\u043E \u0441\u0442\u0430\u043B \u043B\u0438\u0434\u0435\u0440 cinema novo \u0413\u043B\u0430\u0443\u0431\u0435\u0440 \u0420\u043E\u0448\u0430). \u00AB\u0422\u0440\u043E\u043F\u0438\u043A\u0430\u043B\u0438\u044F\u00BB \u043F\u0440\u043E\u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043E\u0432\u0430\u043B\u0430 \u043D\u0435\u0434\u043E\u043B\u0433\u043E, \u043D\u043E \u0442\u0432\u043E\u0440\u0447\u0435\u0441\u043A\u0438\u0439 \u0432\u0437\u0440\u044B\u0432 \u0431\u044B\u043B \u0442\u0430\u043A\u043E\u0439 \u043C\u043E\u0449\u0438, \u0447\u0442\u043E \u0435\u0435 \u0432\u043B\u0438\u044F\u043D\u0438\u0435 \u0434\u043E \u0441\u0438\u0445 \u043F\u043E\u0440 \u043F\u0440\u0438\u0437\u043D\u0430\u044E\u0442 \u0414\u044D\u0432\u0438\u0434 \u0411\u0438\u0440\u043D, Sonic Youth \u0438 Beck. \u0412\u043F\u0440\u043E\u0447\u0435\u043C, \u043F\u0435\u0440\u0435\u0434 \u0432\u0430\u043C\u0438 \u043D\u0435 \u0442\u043E\u043B\u044C\u043A\u043E \u0440\u0430\u0441\u0441\u043A\u0430\u0437 \u043E \u043F\u043E\u0442\u0440\u044F\u0441\u0430\u044E\u0449\u0435\u0439 \u043C\u0443\u0437\u044B\u043A\u0435, \u043D\u043E \u0441\u043B\u043E\u0436\u043D\u043E\u0441\u043E\u0447\u0438\u043D\u0435\u043D\u043D\u044B\u0439 \u0444\u0438\u043B\u044C\u043C-\u043A\u043E\u043B\u043B\u0430\u0436, \u0441\u043E\u0441\u0442\u0430\u0432\u043B\u0435\u043D\u043D\u044B\u0439 \u0438\u0437 \u0443\u043D\u0438\u043A\u0430\u043B\u044C\u043D\u043E\u0439 \u0445\u0440\u043E\u043D\u0438\u043A\u0438, \u0432\u0438\u0434\u0435\u043E\u043A\u043B\u0438\u043F\u043E\u0432, \u0442\u0435\u043B\u0435\u0432\u0438\u0437\u0438\u043E\u043D\u043D\u044B\u0445 \u0448\u043E\u0443, \u0438\u043D\u0442\u0435\u0440\u0432\u044C\u044E, \u0440\u0435\u0434\u0447\u0430\u0439\u0448\u0438\u0445 \u0444\u043E\u0442\u043E\u0433\u0440\u0430\u0444\u0438\u0439 \u0438 \u043F\u0441\u0438\u0445\u043E\u0434\u0435\u043B\u0438\u0447\u0435\u0441\u043A\u043E\u0439 \u0433\u0440\u0430\u0444\u0438\u043A\u0438. \u0420\u0430\u0431\u043E\u0442\u0430 \u043D\u0430\u0434 \u043A\u0430\u0440\u0442\u0438\u043D\u043E\u0439 \u0434\u043B\u0438\u043B\u0430\u0441\u044C \u0446\u0435\u043B\u044B\u0445 \u0448\u0435\u0441\u0442\u044C \u043B\u0435\u0442, \u0447\u0442\u043E \u043F\u043E\u0437\u0432\u043E\u043B\u0438\u043B\u043E \u0441\u043E\u0431\u0440\u0430\u0442\u044C \u0440\u0430\u0437\u043D\u043E\u043F\u043B\u0430\u043D\u043E\u0432\u044B\u0439 \u043C\u0430\u0442\u0435\u0440\u0438\u0430\u043B \u0438 \u043F\u0440\u0435\u0432\u0440\u0430\u0442\u0438\u0442\u044C \u0435\u0433\u043E \u0432 \u043F\u043B\u0430\u043C\u0435\u043D\u043D\u043E\u0435 \u0432\u044B\u0441\u043A\u0430\u0437\u044B\u0432\u0430\u043D\u0438\u0435 \u043E\u0431 \u0438\u0441\u0442\u043E\u0440\u0438\u0438 \u043B\u044E\u0434\u0435\u0439, \u043A\u043E\u0442\u043E\u0440\u044B\u043C \u043F\u0440\u0438\u0448\u043B\u043E\u0441\u044C \u043F\u0440\u043E\u0447\u0443\u0432\u0441\u0442\u0432\u043E\u0432\u0430\u0442\u044C \u043D\u0430 \u0441\u0435\u0431\u0435 \u0442\u0443\u0440\u0431\u0443\u043B\u0435\u043D\u0442\u043D\u044B\u0435 \u043F\u043E\u0432\u043E\u0440\u043E\u0442\u044B \u0438\u0441\u0442\u043E\u0440\u0438\u0438, \u0441\u043E\u0445\u0440\u0430\u043D\u0438\u0432 \u0441\u0435\u0431\u044F.",
