    "nameRU": "\u0421\u0442\u0430\u0440\u0430\u044F \u0434\u043E\u0431\u0440\u0430\u044F \u0424\u0440\u0435\u0434\u0430",
    "nameEN": "Good Ol\u2019 Freda",
    "director": "\u0420\u0430\u0439\u0430\u043D \u0423\u0430\u0439\u0442",
    "country": "\u0421\u0428\u0410, \u0412\u0435\u043B\u0438\u043A\u043E\u0431\u0440\u0438\u0442\u0430\u043D\u0438\u044F",
    "year": "2013",
    "duration": 92,
    "description": "\u0421\u0442\u0435\u0441\u043D\u0438\u0442\u0435\u043B\u044C\u043D\u0430\u044F \u043B\u0438\u0432\u0435\u0440\u043F\u0443\u043B\u044C\u0441\u043A\u0430\u044F \u043D\u0430\u0431\u043E\u0440\u0449\u0438\u0446\u0430 \u0432\u0440\u044F\u0434 \u043B\u0438 \u043C\u043E\u0433\u043B\u0430 \u043F\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u0438\u0442\u044C, \u0447\u0435\u043C \u043E\u0431\u0435\u0440\u043D\u0435\u0442\u0441\u044F \u043F\u043E\u0445\u043E\u0434 \u0441 \u0441\u043E\u0441\u043B\u0443\u0436\u0438\u0432\u0446\u0430\u043C\u0438 \u0432 \u043A\u043B\u0443\u0431 The Cavern \u0438 \u043A\u0430\u043A \u0435\u0435 \u0436\u0438\u0437\u043D\u044C \u043E\u043A\u0430\u0436\u0435\u0442\u0441\u044F \u043D\u0430\u0432\u0441\u0435\u0433\u0434\u0430 \u0441\u0432\u044F\u0437\u0430\u043D\u043D\u043E\u0439 \u0441 \u0432\u044B\u0441\u0442\u0443\u043F\u0430\u044E\u0449\u0435\u0439 \u043D\u0430 \u0441\u0446\u0435\u043D\u0435 \u0433\u0440\u0443\u043F\u043F\u043E\u0439. \u0424\u0438\u043B\u044C\u043C \u043F\u0440\u043E \u0424\u0440\u0438\u0434\u0443 \u041A\u0435\u043B\u043B\u0438 \u2014 \u043F\u0440\u0430\u043A\u0442\u0438\u0447\u0435\u0441\u043A\u0438 \u0431\u0435\u0441\u0441\u043C\u0435\u043D\u043D\u0443\u044E, \u043E\u0434\u043D\u0430\u0436\u0434\u044B \u0443\u0432\u043E\u043B\u0435\u043D\u043D\u0443\u044E, \u043D\u043E \u0431\u044B\u0441\u0442\u0440\u043E \u0432\u043E\u0437\u0432\u0440\u0430\u0449\u0435\u043D\u043D\u0443\u044E \u043D\u0430\u0437\u0430\u0434 \u0441\u0435\u043A\u0440\u0435\u0442\u0430\u0440\u0448\u0443 The Beatles \u2014 \u0441\u0434\u0435\u043B\u0430\u043D \u043C\u0430\u043A\u0441\u0438\u043C\u0430\u043B\u044C\u043D\u043E \u043F\u0440\u043E\u0441\u0442\u043E \u0438 \u043D\u0435\u043F\u0440\u0435\u0442\u0435\u043D\u0446\u0438\u043E\u0437\u043D\u043E, \u043E\u0442\u0447\u0435\u0433\u043E \u0432\u044B\u0433\u043B\u044F\u0434\u0438\u0442 \u043F\u043E-\u043D\u0430\u0441\u0442\u043E\u044F\u0449\u0435\u043C\u0443 \u0442\u0440\u043E\u0433\u0430\u0442\u0435\u043B\u044C\u043D\u044B\u043C. \u041A\u0435\u043B\u043B\u0438 \u0443\u0434\u0430\u043B\u043E\u0441\u044C \u0441\u043E\u0437\u0434\u0430\u0442\u044C \u0438\u043B\u043B\u044E\u0437\u0438\u044E \u043F\u043E\u0440\u044F\u0434\u043A\u0430 \u0438 \u0441\u0442\u0430\u0442\u044C \u0435\u0449\u0435 \u043E\u0434\u043D\u0438\u043C \u0447\u043B\u0435\u043D\u043E\u043C \u0431\u043E\u043B\u044C\u0448\u043E\u0439 \u043B\u0438\u0432\u0435\u0440\u043F\u0443\u043B\u044C\u0441\u043A\u043E\u0439 \u0441\u0435\u043C\u044C\u0438 \u2014 \u043A\u043E\u043C\u0443, \u043A\u0430\u043A \u043D\u0435 \u0435\u0439, \u0440\u0430\u0441\u0441\u043A\u0430\u0437\u044B\u0432\u0430\u0442\u044C \u043F\u0440\u043E \u0443\u0447\u0430\u0441\u0442\u043D\u0438\u043A\u043E\u0432 \u0433\u0440\u0443\u043F\u043F\u044B \u043A\u0430\u043A \u043F\u0440\u043E \u0441\u0442\u0430\u0440\u044B\u0445 \u0434\u0440\u0443\u0437\u0435\u0439, \u043F\u0440\u0438 \u044D\u0442\u043E\u043C \u0443\u043C\u0443\u0434\u0440\u044F\u044F\u0441\u044C \u043D\u0435 \u0437\u0432\u0443\u0447\u0430\u0442\u044C \u0444\u0430\u043B\u044C\u0448\u0438\u0432\u043E. \u0420\u0430\u0432\u043D\u043E \u043D\u0435\u0437\u0430\u0442\u0430\u0441\u043A\u0430\u043D\u043D\u044B\u0439 \u0432\u0437\u0433\u043B\u044F\u0434 \u043D\u0430 \u043D\u0430\u0447\u0430\u043B\u043E \u043A\u0430\u0440\u044C\u0435\u0440\u044B \u0432\u0435\u043B\u0438\u0447\u0430\u0439\u0448\u0435\u0439 \u0433\u0440\u0443\u043F\u043F\u044B \u0432\u0441\u0435\u0445 \u0432\u0440\u0435\u043C\u0435\u043D \u0438 \u0432\u043E\u0441\u0445\u0438\u0442\u0438\u0442\u0435\u043B\u044C\u043D\u0430\u044F \u043E\u0434\u0430 \u0441\u043A\u0440\u043E\u043C\u043D\u043E\u0441\u0442\u0438 \u0438 \u0432\u0435\u0440\u043D\u043E\u0441\u0442\u0438.",
