    "nameEN": "Oldschool Renegades",
    "director": " \u041C\u043E\u0440\u0438\u0441 \u0421\u0442\u0435\u043D\u0431\u0435\u0440\u0433\u0435\u043D",
    "country": "\u041D\u0438\u0434\u0435\u0440\u043B\u0430\u043D\u0434\u044B",
    "year": "2013",
    "duration": 93,
    "description": "\u0425\u0440\u043E\u043D\u0438\u043A\u0438 \u0435\u0432\u0440\u043E\u043F\u0435\u0439\u0441\u043A\u043E\u0433\u043E \u0440\u0435\u0439\u0432\u0430, \u0441\u043D\u044F\u0442\u044B\u0435 \u0433\u043E\u043B\u043B\u0430\u043D\u0434\u0441\u043A\u0438\u043C\u0438 \u0434\u043E\u043A\u0443\u043C\u0435\u043D\u0442\u0430\u043B\u0438\u0441\u0442\u0430\u043C\u0438 \u0434\u0432\u0430\u0434\u0446\u0430\u0442\u044C \u043B\u0435\u0442 \u0441\u043F\u0443\u0441\u0442\u044F \u043F\u043E\u0441\u043B\u0435 \u0432\u0437\u043B\u0435\u0442\u0430 \u0438 \u043F\u0430\u0434\u0435\u043D\u0438\u044F \u0442\u0430\u043D\u0446\u0435\u0432\u0430\u043B\u044C\u043D\u043E\u0439 \u043A\u0443\u043B\u044C\u0442\u0443\u0440\u044B. \u041F\u043E\u0434 \u043F\u043E\u0441\u0442\u043E\u044F\u043D\u043D\u044B\u0439 \u0431\u0438\u0442 \u043D\u0435\u043C\u043E\u043B\u043E\u0434\u044B\u0435, \u0437\u0430\u0442\u043E \u0432\u044B\u0436\u0438\u0432\u0448\u0438\u0435 The Prodigy, 808 State, \u041C\u043E\u0431\u0438, \u0430 \u0442\u0430\u043A\u0436\u0435 \u043C\u0435\u043D\u0435\u0435 \u0438\u0437\u0432\u0435\u0441\u0442\u043D\u044B\u0435, \u043D\u043E \u043D\u0435 \u043C\u0435\u043D\u0435\u0435 \u0448\u0443\u043C\u0435\u0432\u0448\u0438\u0435 \u043D\u0430 \u0432\u0435\u0447\u0435\u0440\u0438\u043D\u043A\u0430\u0445 \u043D\u0430\u0447\u0430\u043B\u0430 90-\u0445 \u043F\u0435\u0440\u0441\u043E\u043D\u0430\u0436\u0438 \u0440\u0430\u0441\u0441\u0443\u0436\u0434\u0430\u044E\u0442 \u043E \u0442\u043E\u043C, \u043A\u0430\u043A \u0432\u0441\u0435 \u0431\u044B\u043B\u043E. \u00ABOldschool Renegades\u00BB \u0434\u0430\u0436\u0435 \u043D\u0435 \u043F\u044B\u0442\u0430\u0435\u0442\u0441\u044F \u043F\u0435\u0440\u0435\u0434\u0430\u0442\u044C \u0446\u0430\u0440\u0438\u0432\u0448\u0435\u0435 \u0442\u043E\u0433\u0434\u0430 \u043E\u0449\u0443\u0449\u0435\u043D\u0438\u0435 \u0431\u0435\u0437\u043E\u0433\u043E\u0432\u043E\u0440\u043E\u0447\u043D\u043E\u0439 \u044D\u0439\u0444\u043E\u0440\u0438\u0438, \u043F\u043E\u0441\u043A\u043E\u043B\u044C\u043A\u0443 \u044D\u0442\u043E \u0441\u043E\u0432\u0435\u0440\u0448\u0435\u043D\u043D\u043E \u0431\u0435\u0441\u0441\u043C\u044B\u0441\u043B\u0435\u043D\u043D\u043E \u2014 \u043D\u0430\u0440\u0435\u0437\u043A\u0430 \u0438\u043D\u0442\u0435\u0440\u0432\u044C\u044E \u0438\u043D\u0442\u0435\u0440\u0435\u0441\u043D\u0430 \u0432 \u043F\u0435\u0440\u0432\u0443\u044E \u043E\u0447\u0435\u0440\u0435\u0434\u044C \u043A\u0430\u043A \u043E\u0431\u044A\u0435\u043C\u043D\u043E\u0435 \u0442\u0435\u043E\u0440\u0435\u0442\u0438\u0447\u0435\u0441\u043A\u043E\u0435 \u0438\u0441\u0441\u043B\u0435\u0434\u043E\u0432\u0430\u043D\u0438\u0435 \u043E\u0434\u043D\u043E\u0439 \u043A\u0443\u043B\u044C\u0442\u0443\u0440\u044B, \u0440\u0430\u0441\u0441\u043A\u0430\u0437\u0430\u043D\u043D\u043E\u0435 \u0441\u043B\u043E\u0432\u0430\u043C\u0438 \u0433\u043B\u0430\u0432\u043D\u044B\u0445 \u0433\u0435\u0440\u043E\u0435\u0432; \u0432 \u0442\u043E \u0436\u0435 \u0432\u0440\u0435\u043C\u044F \u2014 \u0440\u0435\u0434\u043A\u0438\u0439 \u0444\u0438\u043B\u044C\u043C \u043D\u0430 \u0437\u0430\u0434\u0430\u043D\u043D\u0443\u044E \u0442\u0435\u043C\u0443, \u0432 \u043A\u043E\u0442\u043E\u0440\u043E\u043C \u0441\u043E\u0431\u0440\u0430\u043D\u044B \u0432\u0441\u0435 \u0433\u0435\u0440\u043E\u0438 \u0441\u0440\u0430\u0437\u0443.",
