    "nameRU": "Pulp: \u0444\u0438\u043B\u044C\u043C \u043E \u0436\u0438\u0437\u043D\u0438, \u0441\u043C\u0435\u0440\u0442\u0438 \u0438 \u0441\u0443\u043F\u0435\u0440\u043C\u0430\u0440\u043A\u0435\u0442\u0430\u0445",
    "nameEN": "Pulp: A Film About Life, Death and Supermarkets",
    "director": "\u0424\u043B\u043E\u0440\u0438\u0430\u043D \u0425\u0430\u0431\u0438\u0445\u0442",
    "country": "\u0412\u0435\u043B\u0438\u043A\u043E\u0431\u0440\u0438\u0442\u0430\u043D\u0438\u044F",
    "year": "2014",
    "duration": 90,
    "description": "\u00ABPulp: \u0444\u0438\u043B\u044C\u043C \u043E \u0436\u0438\u0437\u043D\u0438, \u0441\u043C\u0435\u0440\u0442\u0438 \u0438 \u0441\u0443\u043F\u0435\u0440\u043C\u0430\u0440\u043A\u0435\u0442\u0430\u0445\u00BB \u0438\u0437\u0443\u0447\u0430\u0435\u0442 \u0441\u0432\u044F\u0437\u044C \u0432\u044B\u043D\u0435\u0441\u0435\u043D\u043D\u043E\u0439 \u0432 \u043D\u0430\u0437\u0432\u0430\u043D\u0438\u0435 \u0431\u0440\u0438\u0442\u043F\u043E\u043F-\u043A\u043E\u043C\u0430\u043D\u0434\u044B, \u0441\u043E\u0447\u0438\u043D\u0438\u0432\u0448\u0435\u0439 \u0432\u043E \u0433\u043B\u0430\u0432\u0435 \u0441 \u044D\u0441\u0442\u0435\u0442\u043E\u043C-\u043E\u0433\u043E\u043B\u044C\u0446\u043E\u043C \u0414\u0436\u0430\u0440\u0432\u0438\u0441\u043E\u043C \u041A\u043E\u043A\u0435\u0440\u043E\u043C \u0431\u043E\u043B\u0435\u0435 \u0434\u0435\u0441\u044F\u0442\u043A\u0430 \u043F\u043E\u043F\u0430\u0432\u0448\u0438\u0445 \u0432 \u0432\u0435\u0447\u043D\u043E\u0441\u0442\u044C \u0433\u0438\u043C\u043D\u043E\u0432, \u0441 \u0435\u0435 \u043C\u0435\u0441\u0442\u043E\u043C \u0440\u043E\u0436\u0434\u0435\u043D\u0438\u044F \u2014 \u0428\u0435\u0444\u0444\u0438\u043B\u0434\u043E\u043C. \u041D\u0430\u043F\u043E\u043B\u043E\u0432\u0438\u043D\u0443 \u043E\u043D \u0441\u043E\u0441\u0442\u043E\u0438\u0442 \u0438\u0437 \u043A\u043E\u043D\u0446\u0435\u0440\u0442\u043D\u044B\u0445 \u0437\u0430\u043F\u0438\u0441\u0435\u0439, \u0432 \u0442\u043E\u043C \u0447\u0438\u0441\u043B\u0435 \u2014 \u0441\u0430\u043C\u043E\u0433\u043E \u043F\u043E\u0441\u043B\u0435\u0434\u043D\u0435\u0433\u043E \u0432\u044B\u0441\u0442\u0443\u043F\u043B\u0435\u043D\u0438\u044F \u0433\u0440\u0443\u043F\u043F\u044B \u043F\u043E\u0441\u043B\u0435 \u0440\u0435\u044E\u043D\u0438\u043E\u043D\u0430, \u043D\u0430\u043F\u043E\u043B\u043E\u0432\u0438\u043D\u0443 \u2014 \u0438\u0437 \u0437\u0430\u0431\u0430\u0432\u043D\u044B\u0445 \u0438\u043D\u0442\u0435\u0440\u0432\u044C\u044E \u0441 \u043F\u0440\u043E\u0441\u0442\u044B\u043C\u0438 \u043A\u0440\u0430\u0441\u0438\u0432\u044B\u043C\u0438 \u043B\u044E\u0434\u044C\u043C\u0438, \u0442\u0435\u043C\u0438 \u0441\u0430\u043C\u044B\u043C\u0438 common people, \u0440\u0430\u0434\u0438 \u043A\u043E\u0442\u043E\u0440\u044B\u0445 \u0432\u0441\u0435 \u044D\u0442\u043E \u0438 \u0437\u0430\u0442\u0435\u0432\u0430\u043B\u043E\u0441\u044C. \u041C\u043E\u043B\u043E\u0434\u0430\u044F \u043D\u044F\u043D\u044F, \u043F\u0440\u0438\u0435\u0445\u0430\u0432\u0448\u0430\u044F \u0440\u0430\u0434\u0438 Pulp \u0438\u0437 \u0421\u0428\u0410; \u0431\u0438\u0431\u043B\u0438\u043E\u0442\u0435\u043A\u0430\u0440\u0448\u0438, \u043E\u0446\u0435\u043D\u0438\u0432\u0430\u044E\u0449\u0438\u0435 \u043A\u043E\u043A\u0435\u0440\u043E\u0432\u0441\u043A\u0438\u0435 \u0441\u0442\u0438\u0445\u0438; \u043C\u0430\u043B\u0435\u043D\u044C\u043A\u0438\u0435 \u0434\u0435\u0432\u043E\u0447\u043A\u0438, \u043F\u043E-\u0441\u0432\u043E\u0435\u043C\u0443 \u0442\u0440\u0430\u043A\u0442\u0443\u044E\u0449\u0438\u0435 \u043F\u0435\u0441\u043D\u044E \u043F\u0440\u043E \u044D\u043A\u0441\u0442\u0430\u0437\u0438 \u0438 \u0430\u043C\u0444\u0435\u0442\u0430\u043C\u0438\u043D\u044B, \u0438 \u043C\u043D\u043E\u0433\u0438\u0435-\u043C\u043D\u043E\u0433\u0438\u0435 \u0434\u0440\u0443\u0433\u0438\u0435 \u2014 \u0430 \u0442\u0430\u043A\u0436\u0435, \u043A\u043E\u043D\u0435\u0447\u043D\u043E, \u0414\u0436\u0430\u0440\u0432\u0438\u0441 \u0438 \u043A\u043E\u043C\u043F\u0430\u043D\u0438\u044F. \u00ABPulp: \u0444\u0438\u043B\u044C\u043C \u043E \u0436\u0438\u0437\u043D\u0438, \u0441\u043C\u0435\u0440\u0442\u0438 \u0438 \u0441\u0443\u043F\u0435\u0440\u043C\u0430\u0440\u043A\u0435\u0442\u0430\u0445\u00BB \u2014 \u0442\u0430\u043A\u043E\u0435 \u0436\u0435 \u043E\u0431\u0430\u044F\u0442\u0435\u043B\u044C\u043D\u043E\u0435 \u0438 \u043E\u0441\u0442\u0440\u043E\u0443\u043C\u043D\u043E\u0435 \u043A\u0438\u043D\u043E, \u043A\u0430\u043A \u0438 \u0432\u043E\u0441\u043F\u0435\u0432\u0430\u0435\u043C\u0430\u044F \u0432 \u043D\u0435\u043C \u0433\u0440\u0443\u043F\u043F\u0430, \u2014 \u043D\u043E \u0432\u0441\u0435-\u0442\u0430\u043A\u0438 \u043E\u043D\u043E \u043D\u0435 \u043F\u0440\u043E \u043D\u0435\u0435, \u0430 \u043F\u0440\u043E \u043C\u0443\u0437\u044B\u043A\u0443, \u043F\u0440\u043E \u0442\u0435\u0445, \u043A\u0442\u043E \u0435\u0435 \u0441\u043B\u0443\u0448\u0430\u0435\u0442, \u0438 \u043F\u0440\u043E \u0442\u043E, \u0437\u0430\u0447\u0435\u043C \u044D\u0442\u043E \u0432\u0441\u0435 \u0438 \u0434\u043B\u044F \u043A\u043E\u0433\u043E.",
