    "director": "\u0414\u043C\u0438\u0442\u0440\u0438\u0439 \u041B\u0430\u0432\u0440\u0438\u043D\u0435\u043D\u043A\u043E",
    "country": "\u0420\u043E\u0441\u0441\u0438\u044F",
    "year": "2014",
    "duration": 96,
    "description": "\u041E \u0432\u0435\u043B\u0438\u043A\u043E\u0439 \u0440\u0443\u0441\u0441\u043A\u043E\u0439 \u0433\u0440\u0443\u043F\u043F\u0435 \u00AB\u0410\u0443\u043A\u0446\u042B\u043E\u043D\u00BB, \u043D\u0435\u0434\u0430\u0432\u043D\u043E \u043E\u0442\u043F\u0440\u0430\u0437\u0434\u043D\u043E\u0432\u0430\u0432\u0448\u0435\u0439 \u0441\u0432\u043E\u0435 \u0442\u0440\u0438\u0434\u0446\u0430\u0442\u0438\u043B\u0435\u0442\u0438\u0435, \u043D\u0430\u043F\u0438\u0441\u0430\u043B\u0438 \u043E\u0447\u0435\u043D\u044C-\u043E\u0447\u0435\u043D\u044C \u043C\u043D\u043E\u0433\u043E \u0431\u0443\u043A\u0432 \u0438 \u0441\u043D\u044F\u043B\u0438 \u043D\u0435\u0441\u043A\u043E\u043B\u044C\u043A\u043E \u0431\u0435\u0437\u044B\u0441\u043A\u0443\u0441\u043D\u044B\u0445 \u0442\u0435\u043B\u0435\u0432\u0438\u0437\u0438\u043E\u043D\u043D\u044B\u0445 \u0434\u043E\u043A\u0443\u043C\u0435\u043D\u0442\u0430\u043B\u043E\u043A. \u0421 \u0444\u0438\u043B\u044C\u043C\u043E\u043C \u00AB\u0415\u0449\u0435\u00BB \u0432\u0441\u0435 \u0441\u043E\u0432\u0435\u0440\u0448\u0435\u043D\u043D\u043E \u043F\u043E-\u0434\u0440\u0443\u0433\u043E\u043C\u0443: \u0440\u0435\u0436\u0438\u0441\u0441\u0435\u0440 \u0414\u043C\u0438\u0442\u0440\u0438\u0439 \u041B\u0430\u0432\u0440\u0438\u043D\u0435\u043D\u043A\u043E \u0440\u0430\u0431\u043E\u0442\u0430\u043B \u043D\u0430\u0434 \u043D\u0438\u043C \u0430\u0436 \u0441\u0435\u043C\u044C \u043B\u0435\u0442 \u2014 \u0440\u043E\u0432\u043D\u043E \u0441\u0442\u043E\u043B\u044C\u043A\u043E \u043F\u043E\u043D\u0430\u0434\u043E\u0431\u0438\u043B\u043E\u0441\u044C, \u0447\u0442\u043E\u0431\u044B \u043F\u043E\u0439\u043C\u0430\u0442\u044C \u0441\u0432\u043E\u0435\u0432\u043E\u043B\u044C\u043D\u043E\u0435 \u0438\u0437\u044F\u0449\u0435\u0441\u0442\u0432\u043E, \u0434\u043E \u0441\u0438\u0445 \u043F\u043E\u0440 \u0445\u0440\u0430\u043D\u0438\u043C\u043E\u0435 \u0424\u0435\u0434\u043E\u0440\u043E\u0432\u044B\u043C, \u0413\u0430\u0440\u043A\u0443\u0448\u0435\u0439, \u041E\u0437\u0435\u0440\u0441\u043A\u0438\u043C \u0438 \u043A\u043E\u043C\u043F\u0430\u043D\u0438\u0435\u0439. \u0421\u0442\u043E\u0438\u0442 \u0437\u0430\u0433\u043B\u044F\u043D\u0443\u0442\u044C \u0437\u0430 \u043C\u043E\u0449\u043D\u044B\u0439 \u043C\u0443\u0437\u044B\u043A\u0430\u043B\u044C\u043D\u044B\u0439 \u0444\u0430\u0441\u0430\u0434, \u043A\u0430\u043A \u0437\u0430 \u043D\u0438\u043C \u043E\u0431\u043D\u0430\u0440\u0443\u0436\u0438\u0432\u0430\u0435\u0442\u0441\u044F \u043D\u0435 \u0438\u0441\u0442\u043E\u0440\u0438\u044F \u0433\u0440\u0443\u043F\u043F\u044B, \u043D\u043E \u0445\u0440\u043E\u043D\u0438\u043A\u0438 \u043F\u0443\u0442\u0435\u0448\u0435\u0441\u0442\u0432\u0438\u044F, \u0446\u0435\u043B\u044C\u044E \u043A\u043E\u0442\u043E\u0440\u043E\u0433\u043E \u043E\u043A\u0430\u0437\u044B\u0432\u0430\u0435\u0442\u0441\u044F \u043D\u0438 \u043D\u0430 \u0447\u0442\u043E \u043D\u0435 \u043F\u043E\u0445\u043E\u0436\u0430\u044F, \u0443\u0434\u0438\u0432\u0438\u0442\u0435\u043B\u044C\u043D\u0430\u044F \u043C\u0443\u0437\u044B\u043A\u0430. \u0412 \u00AB\u0415\u0449\u0435\u00BB \u0443\u0445\u0432\u0430\u0447\u0435\u043D\u044B \u043A\u0430\u043A \u043F\u0440\u043E\u0446\u0435\u0441\u0441 \u0441\u043E\u0447\u0438\u043D\u0435\u043D\u0438\u044F \u043F\u0435\u0441\u0435\u043D, \u043A\u043E\u0442\u043E\u0440\u044B\u0435 \u0441\u0435\u0439\u0447\u0430\u0441 \u043F\u043E\u044E\u0442 \u043D\u0430\u0438\u0437\u0443\u0441\u0442\u044C, \u0442\u0430\u043A \u0438 \u0442\u043E, \u0447\u0442\u043E \u043E\u0431\u044B\u0447\u043D\u043E \u043E\u0441\u0442\u0430\u0435\u0442\u0441\u044F \u0437\u0430 \u0441\u043A\u043E\u0431\u043A\u0430\u043C\u0438: \u0444\u0440\u0430\u0433\u043C\u0435\u043D\u0442\u044B \u0431\u044B\u0442\u0430, \u0433\u0430\u0441\u0442\u0440\u043E\u043B\u044C\u043D\u044B\u0435 \u0434\u043D\u0435\u0432\u043D\u0438\u043A\u0438, \u0440\u0430\u0437\u0433\u043E\u0432\u043E\u0440\u044B, \u0432\u043E \u0432\u0440\u0435\u043C\u044F \u043A\u043E\u0442\u043E\u0440\u044B\u0445 \u043F\u0440\u043E\u0438\u0437\u043D\u043E\u0441\u0438\u0442\u0441\u044F \u043A\u043B\u044E\u0447\u0435\u0432\u043E\u0435: \u00AB\u041D\u0435\u043B\u044C\u0437\u044F \u043C\u043D\u043E\u0433\u043E \u0441\u043C\u043E\u0442\u0440\u0435\u0442\u044C \u043D\u0430 \u0441\u0432\u043E\u0431\u043E\u0434\u0443, \u0438\u043D\u0430\u0447\u0435 \u0437\u0430\u043A\u0440\u0443\u0436\u0438\u0442\u0441\u044F \u0433\u043E\u043B\u043E\u0432\u0430\u00BB.",
