    "id": 56,
    "nameRU": "The National: \u041F\u0440\u0438\u043D\u044F\u0442\u044B \u0437\u0430 \u043D\u0435\u0437\u043D\u0430\u043A\u043E\u043C\u0446\u0435\u0432",
    "nameEN": "Mistaken for Strangers",
    "director": " \u0422\u043E\u043C \u0411\u0435\u0440\u043D\u0438\u043D\u0433\u0435\u0440",
    "country": "\u0421\u0428\u0410",
    "year": "2013",
    "duration": 75,
    "description": "\u0415\u0433\u043E \u0441\u0442\u0430\u0440\u0448\u0438\u0439 \u0431\u0440\u0430\u0442 \u2014 \u0440\u043E\u043A-\u0437\u0432\u0435\u0437\u0434\u0430, \u0432\u043E\u043A\u0430\u043B\u0438\u0441\u0442 \u0433\u0440\u0443\u043F\u043F\u044B The National. \u041E\u043D \u2014 \u0438\u043D\u0444\u0430\u043D\u0442\u0438\u043B\u044C\u043D\u044B\u0439 \u0442\u044E\u0444\u044F\u043A, \u043D\u0435 \u0441\u043F\u043E\u0441\u043E\u0431\u043D\u044B\u0439 \u043D\u0438\u0447\u0435\u0433\u043E \u0434\u043E\u0434\u0435\u043B\u0430\u0442\u044C \u0434\u043E \u043A\u043E\u043D\u0446\u0430 \u0438 \u043F\u0440\u0435\u0434\u043F\u043E\u0447\u0438\u0442\u0430\u044E\u0449\u0438\u0439 Judas Priest. \u041F\u043E\u043A\u0430 \u041C\u044D\u0442\u0442 \u0411\u0435\u0440\u043D\u0438\u043D\u0433\u0435\u0440 \u0440\u0430\u0437\u044A\u0435\u0437\u0436\u0430\u0435\u0442 \u043F\u043E \u043C\u0438\u0440\u0443, \u0422\u043E\u043C \u0411\u0435\u0440\u043D\u0438\u043D\u0433\u0435\u0440 \u043B\u0435\u0436\u0438\u0442 \u043D\u0430 \u0434\u0438\u0432\u0430\u043D\u0435 \u0438 \u0440\u0438\u0441\u0443\u0435\u0442 \u0441\u0442\u0440\u0430\u043D\u043D\u044B\u0435 \u043A\u0430\u0440\u0442\u0438\u043D\u043A\u0438 \u2014 \u043D\u043E \u0432\u0434\u0440\u0443\u0433 \u0443 \u043C\u043B\u0430\u0434\u0448\u0435\u0433\u043E \u043F\u043E\u044F\u0432\u043B\u044F\u0435\u0442\u0441\u044F \u0432\u043E\u0437\u043C\u043E\u0436\u043D\u043E\u0441\u0442\u044C \u0441\u0442\u0430\u0442\u044C \u0440\u0435\u0436\u0438\u0441\u0441\u0435\u0440\u043E\u043C \u0434\u043E\u043A\u0443\u043C\u0435\u043D\u0442\u0430\u043B\u044C\u043D\u043E\u0433\u043E \u0444\u0438\u043B\u044C\u043C\u0430. \u00ABMistaken for Strangers\u00BB, \u0441\u043D\u044F\u0442\u044B\u0439 \u0431\u0440\u0430\u0442\u043E\u043C-\u043D\u0435\u0443\u0434\u0430\u0447\u043D\u0438\u043A\u043E\u043C \u043F\u0440\u043E \u0431\u0440\u0430\u0442\u0430-\u0437\u043D\u0430\u043C\u0435\u043D\u0438\u0442\u043E\u0441\u0442\u044C, \u0434\u0430\u0436\u0435 \u043D\u0435 \u0441\u0442\u043E\u043B\u044C\u043A\u043E \u0433\u0440\u0430\u043D\u0434\u0438\u043E\u0437\u043D\u043E\u0435 \u043A\u0438\u043D\u043E \u043E The National, \u0441\u043A\u043E\u043B\u044C\u043A\u043E \u0442\u0438\u043F\u0438\u0447\u0435\u0441\u043A\u043E\u0435 \u0438\u0441\u0441\u043B\u0435\u0434\u043E\u0432\u0430\u043D\u0438\u0435 \u0431\u0440\u0430\u0442\u0441\u043A\u0438\u0445 \u043E\u0442\u043D\u043E\u0448\u0435\u043D\u0438\u0439: \u043F\u0440\u043E \u0434\u0440\u0443\u0436\u0431\u0443, \u0437\u0430\u0432\u0438\u0441\u0442\u044C, \u043A\u043E\u043C\u043F\u043B\u0435\u043A\u0441\u044B \u0438 \u043B\u044E\u0431\u043E\u0432\u044C. \u041A\u043E\u0433\u0434\u0430 \u043D\u0435\u043E\u0442\u0441\u0442\u0443\u043F\u043D\u043E \u0441\u043B\u0435\u0434\u0443\u044E\u0449\u0435\u0433\u043E \u0437\u0430 \u0433\u0440\u0443\u043F\u043F\u043E\u0439 \u0422\u043E\u043C\u0430 \u0443\u0432\u043E\u043B\u044C\u043D\u044F\u044E\u0442, \u0440\u0435\u0436\u0438\u0441\u0441\u0435\u0440 \u043E\u043A\u043E\u043D\u0447\u0430\u0442\u0435\u043B\u044C\u043D\u043E \u043D\u0430\u0447\u0438\u043D\u0430\u0435\u0442 \u0441\u043D\u0438\u043C\u0430\u0442\u044C \u043F\u0440\u043E \u0441\u0435\u0431\u044F \u2014 \u043D\u043E \u0444\u0438\u043B\u044C\u043C \u043E\u0442 \u044D\u0442\u043E\u0433\u043E \u043F\u043E\u043B\u0443\u0447\u0430\u0435\u0442\u0441\u044F \u0442\u043E\u043B\u044C\u043A\u043E \u0442\u043E\u0447\u043D\u0435\u0435 \u0438 \u0441\u043C\u0435\u0448\u043D\u0435\u0435.",
