    "nameRU": "\u041F\u043E\u0432\u0438\u043D\u0443\u0439\u0441\u044F \u0445\u0443\u0434\u043E\u0436\u043D\u0438\u043A\u0443",
    "nameEN": "Obey the Artist",
    "director": "\u041E\u043D\u0434\u0438 \u0422\u0438\u043C\u043E\u043D\u0435\u0440",
    "country": "\u0421\u0428\u0410",
    "year": "2014",
    "duration": 14,
    "description": "\u0428\u0435\u043F\u0430\u0440\u0434 \u0424\u044D\u0439\u0440\u0438 \u0434\u043E \u0441\u0438\u0445 \u043F\u043E\u0440 \u0432\u0435\u0440\u0438\u0442 \u0432 \u0430\u043C\u0435\u0440\u0438\u043A\u0430\u043D\u0441\u043A\u0443\u044E \u043C\u0435\u0447\u0442\u0443. \u0413\u043E\u0432\u043E\u0440\u0438\u0442, \u043E\u043D\u0430 \u0441\u0434\u0435\u043B\u0430\u043B\u0430 \u0435\u0433\u043E \u0442\u0435\u043C, \u043A\u0442\u043E \u043E\u043D \u0435\u0441\u0442\u044C, \u2014 \u0442\u043E \u0435\u0441\u0442\u044C \u043E\u0434\u043D\u0438\u043C \u0438\u0437 \u0441\u0430\u043C\u044B\u0445 \u0432\u043B\u0438\u044F\u0442\u0435\u043B\u044C\u043D\u044B\u0445 \u0441\u0442\u0440\u0438\u0442-\u0430\u0440\u0442-\u0445\u0443\u0434\u043E\u0436\u043D\u0438\u043A\u043E\u0432 \u0441\u043E\u0432\u0440\u0435\u043C\u0435\u043D\u043D\u043E\u0441\u0442\u0438. \u0418 \u0447\u0442\u043E \u0432 \u043D\u0435\u043A\u043E\u0442\u043E\u0440\u043E\u043C \u0441\u043C\u044B\u0441\u043B\u0435 \u044D\u0442\u043E \u0434\u0430\u0436\u0435 \u0445\u043E\u0440\u043E\u0448\u043E, \u0447\u0442\u043E \u0443 \u043D\u0435\u0433\u043E \u043D\u0435 \u0431\u044B\u043B\u043E \u043C\u0435\u0446\u0435\u043D\u0430\u0442\u043E\u0432, \u043A\u043E\u0442\u043E\u0440\u044B\u0435 \u0433\u043E\u0442\u043E\u0432\u044B \u0431\u044B\u043B\u0438 \u043F\u043B\u0430\u0442\u0438\u0442\u044C \u0435\u043C\u0443 \u043F\u0440\u043E\u0441\u0442\u043E \u0437\u0430 \u0435\u0433\u043E \u0442\u0432\u043E\u0440\u0447\u0435\u0441\u0442\u0432\u043E. \u0427\u0442\u043E \u043E\u043D \u0434\u043E \u0441\u0438\u0445 \u043F\u043E\u0440 \u0432\u0441\u0435 \u0440\u0438\u0441\u0443\u0435\u0442 \u0441\u043E\u0431\u0441\u0442\u0432\u0435\u043D\u043D\u044B\u043C\u0438 \u0440\u0443\u043A\u0430\u043C\u0438, \u043D\u043E \u0442\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0438\u0438 \u043F\u043E\u043C\u043E\u0433\u0430\u044E\u0442 \u0435\u043C\u0443 \u0434\u0435\u043B\u0430\u0442\u044C \u0431\u043E\u043B\u0435\u0435 \u043C\u0430\u0441\u0448\u0442\u0430\u0431\u043D\u044B\u0435 \u043F\u0440\u043E\u0435\u043A\u0442\u044B; \u0447\u0442\u043E \u043F\u043E \u0434\u043E\u0440\u043E\u0433\u0435 \u043D\u0430 \u043E\u0442\u043A\u0440\u044B\u0442\u0438\u0435 \u0441\u043E\u0431\u0441\u0442\u0432\u0435\u043D\u043D\u043E\u0439 \u0432\u044B\u0441\u0442\u0430\u0432\u043A\u0438 \u0432 \u041C\u0443\u0437\u0435\u0435 \u0441\u043E\u0432\u0440\u0435\u043C\u0435\u043D\u043D\u043E\u0433\u043E \u0438\u0441\u043A\u0443\u0441\u0441\u0442\u0432\u0430 \u0432 \u0411\u043E\u0441\u0442\u043E\u043D\u0435 \u043D\u0435\u0441\u043A\u043E\u043B\u044C\u043A\u043E \u043B\u0435\u0442 \u043D\u0430\u0437\u0430\u0434 \u043E\u043D \u0431\u044B\u043B \u0430\u0440\u0435\u0441\u0442\u043E\u0432\u0430\u043D \u0432\u043E\u0441\u0435\u043C\u044C\u044E \u043F\u043E\u043B\u0438\u0446\u0435\u0439\u0441\u043A\u0438\u043C\u0438 \u0437\u0430 \u0442\u043E, \u0447\u0442\u043E \u043F\u0440\u0438\u043A\u043B\u0435\u0438\u043B \u0441\u0442\u0438\u043A\u0435\u0440 \u043D\u0430 \u0441\u0442\u0435\u043D\u0443. \u0428\u0435\u043F\u0430\u0440\u0434 \u0424\u044D\u0439\u0440\u0438 \u0440\u0430\u0441\u0441\u043A\u0430\u0437\u044B\u0432\u0430\u0435\u0442 \u0441\u0432\u043E\u0438 \u043F\u0440\u0430\u0432\u0438\u043B\u0430 \u0436\u0438\u0437\u043D\u0438, \u0432 \u0442\u043E \u0432\u0440\u0435\u043C\u044F \u043A\u0430\u043A \u0440\u0435\u0436\u0438\u0441\u0441\u0435\u0440 \u0434\u0430\u0435\u0442 \u043D\u0430\u043C \u0432\u043E\u0437\u043C\u043E\u0436\u043D\u043E\u0441\u0442\u044C \u043F\u043E\u0434\u0441\u043C\u043E\u0442\u0440\u0435\u0442\u044C \u0437\u0430 \u0435\u0433\u043E \u0440\u0430\u0431\u043E\u0442\u043E\u0439 \u0438 \u0436\u0438\u0437\u043D\u044C\u044E, \u0433\u043B\u0430\u0432\u044B \u043A\u043E\u0442\u043E\u0440\u043E\u0439 \u0441\u0442\u0440\u0435\u043C\u0438\u0442\u0435\u043B\u044C\u043D\u043E \u0441\u043C\u0435\u043D\u044F\u044E\u0442 \u0434\u0440\u0443\u0433 \u0434\u0440\u0443\u0433\u0430. \u0412\u043E\u0442 \u043C\u044B \u0432 \u0435\u0433\u043E \u0441\u0442\u0443\u0434\u0438\u0438, \u0430 \u0432\u043E\u0442 \u0432 \u0438\u043D\u0434\u0435\u0439\u0441\u043A\u043E\u0439 \u0440\u0435\u0437\u0435\u0440\u0432\u0430\u0446\u0438\u0438; \u0432\u043E\u0442 \u043E\u043D \u0441 \u0431\u0430\u043B\u043B\u043E\u043D\u0430\u043C\u0438 \u0432 \u0440\u0443\u043A\u0430\u0445 \u0443 \u0433\u0438\u0433\u0430\u043D\u0442\u0441\u043A\u043E\u0439 \u0441\u0442\u0435\u043D\u044B, \u0430 \u0432\u043E\u0442 \u0432 \u0430\u0440\u0442-\u0433\u0430\u043B\u0435\u0440\u0435\u0435 \u043D\u0430 \u0432\u0435\u0447\u0435\u0440\u0438\u043D\u043A\u0435 \u043F\u043E \u0441\u043B\u0443\u0447\u0430\u044E \u043E\u0442\u043A\u0440\u044B\u0442\u0438\u044F \u0435\u0433\u043E \u0432\u044B\u0441\u0442\u0430\u0432\u043A\u0438 \u00ABSid: Superman is Dead\u00BB, \u043F\u043E\u0441\u0432\u044F\u0449\u0435\u043D\u043D\u043E\u0439 \u0435\u0433\u043E \u043A\u0443\u043C\u0438\u0440\u0443 \u0421\u0438\u0434\u0443 \u0412\u0438\u0448\u0435\u0441\u0443. \u0412 \u043C\u0438\u043A\u0440\u043E\u0444\u043E\u043D \u043E\u0440\u0443\u0442 \u0411\u0438\u043B\u043B\u0438 \u0410\u0439\u0434\u043E\u043B, \u041A\u043B\u044D\u043C \u0411\u0435\u0440\u043A\u0435 \u0438\u0437 Blondie, \u0421\u0442\u0438\u0432 \u0414\u0436\u043E\u043D\u0441 \u0438\u0437 Sex Pistols \u0438 \u041B\u0438 \u0413\u043E\u0440\u043C\u0430\u043D \u0438\u0437 Wow wow wow, \u043A\u043E\u0442\u043E\u0440\u044B\u0445 \u043E\u043D \u0441\u043E\u0431\u0441\u0442\u0432\u0435\u043D\u043D\u043E\u0440\u0443\u0447\u043D\u043E \u0441\u043E\u0431\u0440\u0430\u043B \u043F\u043E \u044D\u0442\u043E\u043C\u0443 \u0441\u043B\u0443\u0447\u0430\u044E, \u0430 \u0441\u0430\u043C \u0428\u0435\u043F\u0430\u0440\u0434, \u043E\u0434\u0435\u0442\u044B\u0439 \u043A\u0430\u043A \u0432\u0441\u0435\u0433\u0434\u0430 \u0432 \u0444\u0443\u0442\u0431\u043E\u043B\u043A\u0443 \u043D\u0435 \u0442\u043E \u0441 \u041C\u0430\u0440\u043A\u043E\u043C \u0411\u043E\u043B\u0430\u043D\u043E\u043C, \u043D\u0435 \u0442\u043E \u0441 \u0433\u0440\u0443\u043F\u043F\u043E\u0439 Damaged, \u0441\u0442\u043E\u0438\u0442 \u0438 \u0443\u043B\u044B\u0431\u0430\u0435\u0442\u0441\u044F \u0441\u0432\u043E\u0435\u0439 \u0448\u0438\u0440\u043E\u043A\u043E\u0439, \u043E\u0431\u0435\u0437\u043E\u0440\u0443\u0436\u0438\u0432\u0430\u044E\u0449\u0435\u0439 \u0443\u043B\u044B\u0431\u043A\u043E\u0439, \u0442\u0435\u043C \u0441\u0430\u043C\u044B\u043C \u0434\u043E\u043A\u0430\u0437\u044B\u0432\u0430\u044F, \u0447\u0442\u043E \u043E\u043D, \u0432 \u043E\u0442\u043B\u0438\u0447\u0438\u0435 \u043E\u0442 \u043C\u043D\u043E\u0433\u0438\u0445, \u043F\u043E-\u043F\u0440\u0435\u0436\u043D\u0435\u043C\u0443 \u043D\u0430\u0441\u0442\u043E\u044F\u0449\u0438\u0439.\n\n",
