    "id": 68,
    "nameRU": "B-Movie: \u0428\u0443\u043C \u0438 \u044F\u0440\u043E\u0441\u0442\u044C \u0432 \u0417\u0430\u043F\u0430\u0434\u043D\u043E\u043C \u0411\u0435\u0440\u043B\u0438\u043D\u0435",
    "nameEN": "B-Movie: Lust & Sound In West Berlin 1979-1989",
    "director": "\u0419\u043E\u0440\u0433 \u0425\u043E\u043F\u043F\u0435, \u0425\u0430\u0439\u043A\u043E \u041B\u0430\u043D\u0433\u0435, \u041A\u043B\u0430\u0443\u0441 \u041C\u0430\u0435\u043A",
    "country": "\u0413\u0435\u0440\u043C\u0430\u043D\u0438\u044F",
    "year": "2015",
    "duration": 92,
    "description": "\u041E\u0434\u043D\u043E\u0432\u0440\u0435\u043C\u0435\u043D\u043D\u043E \u0435\u0433\u043E \u0432\u0438\u0434\u0435\u043E\u0434\u043D\u0435\u0432\u043D\u0438\u043A \u0438 \u0440\u0435\u0442\u0440\u043E\u043A\u043E\u043B\u043B\u0430\u0436 \u043D\u0435\u043F\u0440\u0435\u0434\u0441\u043A\u0430\u0437\u0443\u0435\u043C\u043E\u0433\u043E, \u0445\u0430\u043E\u0442\u0438\u0447\u043D\u043E\u0433\u043E, \u0438\u0441\u043A\u0440\u044F\u0449\u0435\u0433\u043E\u0441\u044F \u0437\u0430\u0440\u0430\u0437\u0438\u0442\u0435\u043B\u044C\u043D\u043E\u0439 \u044D\u043D\u0435\u0440\u0433\u0438\u0435\u0439 \u0433\u043E\u0440\u043E\u0434\u0430, \u043A\u043E\u0442\u043E\u0440\u044B\u0439 \u043E\u0447\u0435\u043D\u044C \u0440\u0435\u0434\u043A\u043E \u0441\u043F\u0430\u043B \u0438 \u043A\u043E\u0442\u043E\u0440\u043E\u0433\u043E \u0431\u043E\u043B\u044C\u0448\u0435 \u043D\u0435\u0442 \u0438 \u043D\u0435 \u0431\u0443\u0434\u0435\u0442. \u0425\u0443\u0434\u044E\u0449\u0438\u0439 \u0411\u043B\u0438\u043A\u0441\u0430 \u0411\u0430\u0440\u0433\u0435\u043B\u044C\u0434, \u041D\u0438\u043A \u041A\u0435\u0439\u0432, \u0422\u0438\u043B\u044C\u0434\u0430 \u0421\u0443\u0438\u043D\u0442\u043E\u043D \u0438 \u043C\u043D\u043E\u0433\u0438\u0435 \u0434\u0440\u0443\u0433\u0438\u0435; \u0442\u0443\u0441\u043E\u0432\u043A\u0438, \u043A\u043B\u0443\u0431\u044B \u0438 \u0434\u0440\u0430\u043A\u0438, \u043F\u0430\u043D\u043A, \u0430\u0432\u0430\u043D\u0433\u0430\u0440\u0434 \u0438 \u0442\u0435\u0445\u043D\u043E; \u0432\u0435\u0449\u0435\u0441\u0442\u0432\u0430, \u0431\u0435\u0441\u043F\u0440\u0435\u0434\u0435\u043B \u0438 \u0435\u0449\u0435 \u043D\u0435 \u0440\u0430\u0437\u0440\u0443\u0448\u0435\u043D\u043D\u0430\u044F \u0441\u0442\u0435\u043D\u0430, \u0437\u0430 \u043A\u043E\u0442\u043E\u0440\u043E\u0439 \u0446\u0430\u0440\u0438\u0442 \u0432\u0435\u0447\u043D\u043E\u0435 \u0443\u043D\u044B\u043D\u0438\u0435 \u2014 \u043E\u0431\u043E \u0432\u0441\u0435\u043C \u044D\u0442\u043E\u043C \u0441\u043E \u0441\u043B\u043E\u0432 \u0443\u0447\u0430\u0441\u0442\u043D\u0438\u043A\u043E\u0432 \u0433\u043B\u0430\u0437\u0430\u043C\u0438 \u0438\u043D\u0441\u0430\u0439\u0434\u0435\u0440\u0430. \u0417\u0432\u0443\u043A, \u043A\u0430\u0440\u0442\u0438\u043D\u043A\u0430, \u0433\u0435\u0440\u043E\u0438 \u2014 \u0432\u0441\u0435 \u0441\u0434\u0435\u043B\u0430\u043D\u043E \u0442\u0430\u043A \u0434\u043E\u0441\u0442\u043E\u0432\u0435\u0440\u043D\u043E, \u0447\u0442\u043E \u043A\u0430\u0436\u0435\u0442\u0441\u044F, \u0431\u0443\u0434\u0442\u043E \u0411\u0435\u0440\u043B\u0438\u043D 80-\u0445 \u0443\u0436\u0435 \u0437\u0430 \u043E\u043A\u043D\u043E\u043C.\n\n",
