    "id": 69,
    "nameRU": "Sume \u2014 \u0417\u0432\u0443\u043A \u0440\u0435\u0432\u043E\u043B\u044E\u0446\u0438\u0438",
    "nameEN": "Sum\u00E9: Mumisitsinerup nipaa",
    "director": " \u0418\u043D\u0443\u043A \u0421\u0438\u043B\u0438\u0441 \u0425\u0435\u0433",
    "country": "\u0413\u0440\u0435\u043D\u043B\u0430\u043D\u0434\u0438\u044F, \u0414\u0430\u043D\u0438\u044F, \u041D\u043E\u0440\u0432\u0435\u0433\u0438\u044F",
    "year": "2014",
    "duration": 92,
    "description": "\u0424\u0438\u043B\u044C\u043C  \u043E \u043F\u0435\u0440\u0432\u043E\u0439 \u0433\u0440\u0435\u043D\u043B\u0430\u043D\u0434\u0441\u043A\u043E\u0439 \u0440\u043E\u043A-\u0433\u0440\u0443\u043F\u043F\u0435\n\n\u0412 1973 \u0433\u043E\u0434\u0443 \u0447\u0435\u0442\u044B\u0440\u0435 \u0433\u0440\u0435\u043D\u043B\u0430\u043D\u0434\u0441\u043A\u0438\u0445 \u0441\u0442\u0443\u0434\u0435\u043D\u0442\u0430 \u0432\u0434\u0430\u043B\u0438 \u043E\u0442 \u0434\u043E\u043C\u0430, \u0432 \u043C\u0435\u0442\u0440\u043E\u043F\u043E\u043B\u0438\u0438 \u0414\u0430\u043D\u0438\u0438, \u0441\u043A\u043E\u043B\u043E\u0442\u0438\u043B\u0438 \u0441\u043E\u0444\u0442-\u0440\u043E\u043A-\u0433\u0440\u0443\u043F\u043F\u0443 Sum\u00E9 \u0438 \u0432 \u043A\u0430\u0447\u0435\u0441\u0442\u0432\u0435 \u0430\u043A\u0442\u0430 \u043D\u0435\u043F\u043E\u0432\u0438\u043D\u043E\u0432\u0435\u043D\u0438\u044F \u043D\u0430\u0447\u0430\u043B\u0438 \u043F\u0435\u0442\u044C \u043F\u0440\u043E\u0442\u0435\u0441\u0442\u043D\u044B\u0435 \u043F\u043E\u043B\u0438\u0442\u0438\u0447\u0435\u0441\u043A\u0438\u0435 \u043F\u0435\u0441\u043D\u0438 \u043D\u0430 \u0440\u043E\u0434\u043D\u043E\u043C \u044F\u0437\u044B\u043A\u0435. \u0427\u0435\u0440\u0435\u0437 \u0448\u0435\u0441\u0442\u044C \u043B\u0435\u0442 \u0438\u0445 \u0440\u043E\u0434\u043D\u0430\u044F \u0432\u043E\u043B\u0448\u0435\u0431\u043D\u0430\u044F \u0441\u0442\u0440\u0430\u043D\u0430 \u043D\u0430\u043A\u043E\u043D\u0435\u0446 \u043F\u043E\u043B\u0443\u0447\u0438\u043B\u0430 \u0448\u0438\u0440\u043E\u043A\u0443\u044E \u0430\u0432\u0442\u043E\u043D\u043E\u043C\u0438\u044E. \u0421\u044A\u0435\u043C\u043A\u0438 \u043D\u0430 \u00AB\u0441\u0443\u043F\u0435\u0440-8\u00BB, \u0414\u0430\u043D\u0438\u044F \u0438 \u0433\u0440\u0435\u043D\u043B\u0430\u043D\u0434\u0441\u043A\u0438\u0439 \u041D\u0443\u0443\u043A, \u0440\u0430\u0437\u0433\u043E\u0432\u043E\u0440\u044B \u0441 \u0444\u0430\u043D\u0430\u0442\u0430\u043C\u0438, \u0434\u0440\u0443\u0437\u044C\u044F\u043C\u0438 \u0438 \u0441\u043E\u0447\u0443\u0432\u0441\u0442\u0432\u0443\u044E\u0449\u0438\u043C\u0438 \u043E\u0431\u0449\u0435\u0441\u0442\u0432\u0435\u043D\u043D\u044B\u043C\u0438 \u0434\u0435\u044F\u0442\u0435\u043B\u044F\u043C\u0438 \u2014 \u044D\u0442\u043E \u0431\u0443\u0434\u0442\u043E \u0431\u044B \u0442\u0438\u043F\u0438\u0447\u043D\u044B\u0439 \u0444\u0438\u043B\u044C\u043C \u043E \u0442\u0438\u043F\u0438\u0447\u043D\u043E\u0439 \u0440\u043E\u043A-\u0433\u0440\u0443\u043F\u043F\u0435, \u043F\u043E\u0432\u043B\u0438\u044F\u0432\u0448\u0435\u0439, \u043E\u0434\u043D\u0430\u043A\u043E, \u043D\u0430 \u0436\u0438\u0437\u043D\u044C \u0446\u0435\u043B\u043E\u0433\u043E \u0433\u043E\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0430. \u00ABSum\u00E9 \u2014 The Sound of a Revolution\u00BB \u2014 \u0444\u0438\u043B\u044C\u043C \u043E \u0442\u043E\u043C, \u043A\u0430\u043A \u0434\u0430\u0436\u0435 \u043D\u0435\u0431\u043E\u043B\u044C\u0448\u0438\u0435 \u043F\u043E\u043F\u044B\u0442\u043A\u0438 \u043D\u0435\u0440\u0430\u0432\u043D\u043E\u0434\u0443\u0448\u043D\u043E\u0439 \u0430\u043C\u0431\u0438\u0446\u0438\u043E\u0437\u043D\u043E\u0439 \u043C\u043E\u043B\u043E\u0434\u0435\u0436\u0438 \u0438\u0437\u043C\u0435\u043D\u0438\u0442\u044C \u043C\u0438\u0440 \u043C\u043E\u0433\u0443\u0442 \u0434\u0430\u0442\u044C \u0440\u0435\u0430\u043B\u044C\u043D\u044B\u0439 \u0440\u0435\u0437\u0443\u043B\u044C\u0442\u0430\u0442. \u041A\u0442\u043E \u0431\u044B \u043C\u043E\u0433 \u043F\u043E\u0434\u0443\u043C\u0430\u0442\u044C, \u0447\u0442\u043E \u0432\u043E\u043B\u043E\u0441\u0430\u0442\u044B\u0435 \u043D\u0435\u0430\u0433\u0440\u0435\u0441\u0441\u0438\u0432\u043D\u044B\u0435 \u0440\u043E\u043A\u0435\u0440\u044B \u0441\u0442\u0430\u043D\u0443\u0442 \u0440\u043E\u043B\u0435\u0432\u043E\u0439 \u043C\u043E\u0434\u0435\u043B\u044C\u044E \u0434\u043B\u044F \u043C\u043D\u043E\u0433\u0438\u0445 \u043F\u043E\u043A\u043E\u043B\u0435\u043D\u0438\u0439 \u043C\u0443\u0437\u044B\u043A\u0430\u043D\u0442\u043E\u0432 \u0413\u0440\u0435\u043B\u0430\u043D\u0434\u0438\u0438 \u0431\u043B\u0430\u0433\u043E\u0434\u0430\u0440\u044F \u0442\u043E\u043C\u0443, \u0447\u0442\u043E \u0440\u0435\u0448\u0430\u0442 \u0441\u043F\u0435\u0442\u044C \u00AB\u041A\u0430\u043A \u0435\u0434\u0438\u043D\u0430\u044F \u0441\u0442\u0440\u0430\u043D\u0430 \u043C\u044B \u0432\u043D\u043E\u0432\u044C \u043E\u0436\u0438\u0432\u0435\u043C\u00BB \u043D\u0430 \u0440\u043E\u0434\u043D\u043E\u043C \u044F\u0437\u044B\u043A\u0435.",
