    "id": 70,
    "nameRU": "\u0417\u0434\u043E\u0440\u043E\u0432\u043E \u0438 \u0432\u0435\u0447\u043D\u043E",
    "nameEN": "Machine translate: Healthy and forever",
    "director": "\u0410\u043D\u043D\u0430 \u0426\u0438\u0440\u043B\u0438\u043D\u0430, \u041D\u0430\u0442\u0430\u043B\u044C\u044F \u0427\u0443\u043C\u0430\u043A\u043E\u0432\u0430",
    "country": "\u0420\u043E\u0441\u0441\u0438\u044F",
    "year": "2014",
    "duration": 75,
    "description": "\u0424\u0438\u043B\u044C\u043C \u00AB\u0417\u0434\u043E\u0440\u043E\u0432\u043E \u0438 \u0432\u0435\u0447\u043D\u043E\u00BB \u2014 \u044D\u0442\u043E \u043F\u0435\u0440\u0432\u044B\u0439 \u0438 \u0435\u0434\u0438\u043D\u0441\u0442\u0432\u0435\u043D\u043D\u044B\u0439 \u0444\u0438\u043B\u044C\u043C, \u043F\u043E\u0441\u0432\u044F\u0449\u0435\u043D\u043D\u044B\u0439 \u0440\u0430\u043D\u043D\u0438\u043C \u0433\u043E\u0434\u0430\u043C \u0433\u0440\u0443\u043F\u043F\u044B \u00AB\u0413\u0440\u0430\u0436\u0434\u0430\u043D\u0441\u043A\u0430\u044F \u043E\u0431\u043E\u0440\u043E\u043D\u0430\u00BB, \u0440\u0435\u0436\u0438\u0441\u0441\u0435\u0440\u0441\u043A\u0438\u0439 \u0434\u0435\u0431\u044E\u0442 \u041D\u0430\u0442\u0430\u043B\u044C\u0438 \u0427\u0443\u043C\u0430\u043A\u043E\u0432\u043E\u0439, \u0431\u0430\u0441-\u0433\u0438\u0442\u0430\u0440\u0438\u0441\u0442\u043A\u0438 \u0433\u0440\u0443\u043F\u043F\u044B \u0438 \u0432\u0434\u043E\u0432\u044B \u0415\u0433\u043E\u0440\u0430 \u041B\u0435\u0442\u043E\u0432\u0430, \u0438 \u0410\u043D\u043D\u044B \u0426\u0438\u0440\u043B\u0438\u043D\u043E\u0439. \u0412 \u043E\u0441\u043D\u043E\u0432\u0443 \u0444\u0438\u043B\u044C\u043C\u0430 \u043B\u0435\u0433\u043B\u0438 \u0443\u043D\u0438\u043A\u0430\u043B\u044C\u043D\u044B\u0435 \u0441\u044A\u0435\u043C\u043A\u0438, \u0441\u0434\u0435\u043B\u0430\u043D\u043D\u044B\u0435 \u0443\u0447\u0430\u0441\u0442\u043D\u0438\u043A\u0430\u043C\u0438 \u0433\u0440\u0443\u043F\u043F\u044B, \u0438\u043D\u0442\u0435\u0440\u0432\u044C\u044E \u0441 \u043B\u044E\u0434\u044C\u043C\u0438, \u043F\u0440\u0438\u043D\u0438\u043C\u0430\u0432\u0448\u0438\u043C\u0438 \u0430\u043A\u0442\u0438\u0432\u043D\u043E\u0435 \u0443\u0447\u0430\u0441\u0442\u0438\u0435 \u0432 \u0441\u0443\u0434\u044C\u0431\u0435 \u00AB\u041E\u0431\u043E\u0440\u043E\u043D\u044B\u00BB \u043D\u0430 \u043D\u0430\u0447\u0430\u043B\u044C\u043D\u043E\u043C \u044D\u0442\u0430\u043F\u0435, \u0440\u0435\u0434\u043A\u0438\u0435 \u0430\u0440\u0445\u0438\u0432\u043D\u044B\u0435 \u043A\u0430\u0434\u0440\u044B. \u0420\u0435\u0436\u0438\u0441\u0441\u0435\u0440\u044B \u0444\u0438\u043B\u044C\u043C\u0430 \u0441\u0434\u0435\u043B\u0430\u043B\u0438 \u043F\u043E\u0447\u0442\u0438 \u043D\u0435\u0432\u043E\u0437\u043C\u043E\u0436\u043D\u043E\u0435 \u2014 \u0441\u043E\u0431\u0440\u0430\u043B\u0438 \u0432\u043D\u044F\u0442\u043D\u044B\u0439 \u0438 \u043E\u0441\u043B\u0435\u043F\u0438\u0442\u0435\u043B\u044C\u043D\u043E \u0436\u0438\u0432\u043E\u0439 \u0440\u0430\u0441\u0441\u043A\u0430\u0437 \u043E \u0442\u043E\u043C, \u043A\u0430\u043A \u0418\u0433\u043E\u0440\u044C \u041B\u0435\u0442\u043E\u0432 \u0441\u0442\u0430\u043B \u0415\u0433\u043E\u0440\u043E\u043C \u041B\u0435\u0442\u043E\u0432\u044B\u043C, \u0444\u0438\u043A\u0441\u0438\u0440\u0443\u044E\u0449\u0438\u0439 \u043F\u0440\u043E\u0438\u0441\u0445\u043E\u0434\u0438\u0432\u0448\u0435\u0435 \u0441 \u043D\u0438\u043C \u0438 \u0435\u0433\u043E \u043A\u0440\u0443\u0433\u043E\u043C \u0441 \u043D\u0430\u0447\u0430\u043B\u0430 80-\u0445 \u043F\u043E \u043D\u0430\u0447\u0430\u043B\u043E 90-\u0445. \u00AB\u0417\u0434\u043E\u0440\u043E\u0432\u043E \u0438 \u0432\u0435\u0447\u043D\u043E\u00BB \u2014 \u044D\u0442\u043E \u043D\u0435 \u0434\u043E\u043A\u0443\u043C\u0435\u043D\u0442\u0430\u043B\u044C\u043D\u044B\u0439 \u0431\u0430\u0439\u043E\u043F\u0438\u043A \u0432 \u0441\u0442\u0440\u043E\u0433\u043E\u043C \u0441\u043C\u044B\u0441\u043B\u0435 \u0441\u043B\u043E\u0432\u0430, \u043D\u043E \u0441\u043A\u043E\u0440\u0435\u0435 \u0443\u0441\u043F\u0435\u0448\u043D\u0430\u044F \u043F\u043E\u043F\u044B\u0442\u043A\u0430 \u043F\u043E\u0439\u043C\u0430\u0442\u044C \u043C\u044F\u0442\u0435\u0436\u043D\u044B\u0439 \u0434\u0443\u0445 \u0432\u0440\u0435\u043C\u0435\u043D\u0438 \u0438 \u043B\u044E\u0434\u0435\u0439, \u043A\u043E\u0442\u043E\u0440\u044B\u0435 \u043B\u043E\u043C\u0430\u043B\u0438 \u044D\u0442\u043E \u0432\u0440\u0435\u043C\u044F \u043F\u043E\u0434 \u0441\u0435\u0431\u044F.",
