    "id": 71,
    "nameRU": "\u0417\u0435\u043B\u0435\u043D\u044B\u0435 \u0434\u043D\u0438",
    "nameEN": "Salad Days",
    "director": "\u0421\u043A\u043E\u0442\u0442 \u041A\u0440\u043E\u0444\u043E\u0440\u0434",
    "country": "\u0421\u0428\u0410",
    "year": "2014",
    "duration": 90,
    "description": "\u0418\u0441\u0442\u043E\u0440\u0438\u044F \u0432\u0430\u0448\u0438\u043D\u0433\u0442\u043E\u043D\u0441\u043A\u043E\u0433\u043E \u0445\u0430\u0440\u0434\u043A\u043E\u0440\u0430 80-\u0445 \u0438 90-\u0445: \u043E\u0442 \u0440\u0430\u0441\u0442\u0430\u0444\u0430\u0440\u0438-\u043F\u0430\u043D\u043A\u043E\u0432 Bad Brains \u0447\u0435\u0440\u0435\u0437 Minor Threat \u0438 \u0434\u043E \u0441\u0432\u0435\u0440\u0445\u044D\u043C\u043E\u0446\u0438\u043E\u043D\u0430\u043B\u044C\u043D\u044B\u0445 Rites of Spring \u0438 Fugazi, \u043E \u0442\u043E\u043C, \u043A\u0430\u043A \u0441\u0442\u043E\u043B\u044C\u043A\u043E \u0447\u0435\u0441\u0442\u043D\u044B\u0445 \u0438 \u043B\u044E\u0442\u044B\u0445 \u043C\u0443\u0437\u044B\u043A\u0430\u043D\u0442\u043E\u0432 \u043F\u043E\u044F\u0432\u0438\u043B\u043E\u0441\u044C \u0432 \u043E\u0434\u043D\u043E\u043C \u043D\u0435\u0431\u043E\u043B\u044C\u0448\u043E\u043C \u0433\u043E\u0440\u043E\u0434\u0435, \u0438\u0437\u0432\u0435\u0441\u0442\u043D\u043E\u043C \u043D\u0430 \u0432\u0435\u0441\u044C \u043C\u0438\u0440 \u0442\u043E\u043B\u044C\u043A\u043E \u0431\u043B\u0430\u0433\u043E\u0434\u0430\u0440\u044F \u0411\u0435\u043B\u043E\u043C\u0443 \u0434\u043E\u043C\u0443. \u0420\u0435\u0436\u0438\u0441\u0441\u0435\u0440 \u2014 \u0436\u0443\u0440\u043D\u0430\u043B\u0438\u0441\u0442, \u043C\u0443\u0437\u044B\u043A\u0430\u043D\u0442, \u0433\u0440\u0430\u0444\u0438\u0447\u0435\u0441\u0438\u0439 \u0434\u0438\u0437\u0430\u0439\u043D\u0435\u0440, \u0431\u043E\u043B\u044C\u0448\u043E\u0439 \u0444\u0430\u043D\u0430\u0442 \u0436\u0430\u043D\u0440\u0430 \u0432 \u043F\u043E\u0434\u0440\u043E\u0441\u0442\u043A\u043E\u0432\u043E\u043C \u0432\u043E\u0437\u0440\u0430\u0441\u0442\u0435 \u2014 \u0432\u0437\u044F\u043B \u0437\u0430 \u0447\u0435\u0442\u044B\u0440\u0435 \u0433\u043E\u0434\u0430 \u0431\u043E\u043B\u0435\u0435 \u0441\u0442\u0430 \u0438\u043D\u0442\u0435\u0440\u0432\u044C\u044E, \u0430 \u0442\u0430\u043A\u0436\u0435 \u0441\u043E\u0431\u0440\u0430\u043B \u0444\u043B\u0430\u0435\u0440\u044B, \u0437\u0438\u043D\u044B, \u0444\u043E\u0442\u043E\u0433\u0440\u0430\u0444\u0438\u0438, \u043A\u0430\u0441\u0441\u0435\u0442\u044B. \u0414\u0430, \u0437\u0434\u0435\u0441\u044C \u0432 \u043E\u0441\u043D\u043E\u0432\u043D\u043E\u043C \u043A\u0430\u0440\u0442\u0438\u043D\u043A\u0438 \u0438 \u0433\u043E\u0432\u043E\u0440\u044F\u0449\u0438\u0435 \u0433\u043E\u043B\u043E\u0432\u044B \u2014 \u0437\u0430\u0442\u043E \u043A\u0430\u043A\u0438\u0435: \u043E\u0442 \u0413\u0435\u043D\u0440\u0438 \u0420\u043E\u043B\u043B\u0438\u043D\u0437\u0430 \u043F\u0440\u043E \u0440\u0430\u043D\u043D\u0438\u0435 \u0434\u043D\u0438 \u0438 \u0418\u044D\u043D\u0430 \u041C\u0430\u043A\u043A\u0435\u044F \u043F\u0440\u043E \u0432\u0441\u0435 \u043E\u0441\u0442\u0430\u043B\u044C\u043D\u044B\u0435 \u0434\u043E \u0441\u0442\u043E\u0440\u043E\u043D\u043D\u0438\u0445, \u043D\u043E \u043D\u0435\u0440\u0430\u0432\u043D\u043E\u0434\u0443\u0448\u043D\u044B\u0445 \u043D\u0430\u0431\u043B\u044E\u0434\u0430\u0442\u0435\u043B\u0435\u0439 \u0422\u0435\u0440\u0441\u0442\u043E\u043D\u0430 \u041C\u0443\u0440\u0430 \u0438 \u0414\u0435\u0439\u0432\u0430 \u0413\u0440\u043E\u043B\u0430; \u043C\u0438\u043D\u0438\u043C\u0443\u043C \u0441\u0440\u0435\u0434\u0441\u0442\u0432 \u2014 \u0437\u0430\u0442\u043E \u043C\u0430\u043A\u0441\u0438\u043C\u0443\u043C \u0433\u0440\u043E\u043C\u043A\u043E\u0441\u0442\u0438 \u0438 \u0432\u043E\u0437\u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044F.",
