    "id": 81,
    "nameRU": "\u0411\u0435\u0440\u0440\u043E\u0443\u0437",
    "nameEN": "Burroughs: The Movie",
    "director": "\u0425\u043E\u0432\u0430\u0440\u0434 \u0411\u0440\u0443\u043A\u043D\u0435\u0440",
    "country": "\u0421\u0428\u0410",
    "year": "1983",
    "duration": 86,
    "description": "\u041F\u0435\u0440\u0432\u044B\u0439 \u0438 \u0435\u0434\u0438\u043D\u0441\u0442\u0432\u0435\u043D\u043D\u044B\u0439 \u0434\u043B\u0438\u043D\u043D\u044B\u0439 \u0434\u043E\u043A\u0443\u043C\u0435\u043D\u0442\u0430\u043B\u044C\u043D\u044B\u0439 \u0444\u0438\u043B\u044C\u043C \u043E \u0432\u0435\u043B\u0438\u043A\u043E\u043C \u043A\u043E\u043D\u0442\u0440\u043A\u0443\u043B\u044C\u0442\u0443\u0440\u043D\u043E\u043C \u043F\u0438\u0441\u0430\u0442\u0435\u043B\u0435, \u043A\u043E\u0442\u043E\u0440\u044B\u0439 \u0441 \u0431\u043E\u043B\u044C\u0448\u0438\u043C \u0443\u0434\u043E\u0432\u043E\u043B\u044C\u0441\u0442\u0432\u0438\u0435\u043C \u0441\u0442\u0430\u043D\u043E\u0432\u0438\u0442\u0441\u044F \u043F\u043E\u0434 \u043F\u0440\u0438\u0446\u0435\u043B \u0432\u0438\u0434\u0435\u043E\u043A\u0430\u043C\u0435\u0440\u044B. \u0420\u0435\u0436\u0438\u0441\u0441\u0435\u0440 \u0413\u043E\u0432\u0430\u0440\u0434 \u0411\u0440\u0443\u043A\u043D\u0435\u0440 \u043D\u0430\u0447\u0430\u043B \u0440\u0430\u0431\u043E\u0442\u0430\u0442\u044C \u043D\u0430\u0434 \u00ABBurroughs\u00BB \u0432 1978-\u043C \u043A\u0430\u043A \u043D\u0430\u0434 \u0432\u044B\u043F\u0443\u0441\u043A\u043D\u043E\u0439 \u0440\u0430\u0431\u043E\u0442\u043E\u0439 \u0438\u0437 \u041D\u044C\u044E-\u0419\u043E\u0440\u043A\u0441\u043A\u043E\u0433\u043E \u0443\u043D\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u0430. \u0417\u0430\u043A\u043E\u043D\u0447\u0438\u043B \u0432 1983-\u043C, \u043F\u0440\u043E\u0432\u0435\u0434\u044F \u043C\u043D\u043E\u0433\u043E \u0432\u0440\u0435\u043C\u0435\u043D\u0438 \u0438 \u0441 \u0441\u0430\u043C\u0438\u043C \u0411\u0435\u0440\u0440\u043E\u0443\u0437\u043E\u043C, \u0438 \u0441 \u0435\u0433\u043E \u0434\u0440\u0443\u0437\u044C\u044F\u043C\u0438 \u0438 \u043F\u043E\u0441\u043B\u0435\u0434\u043E\u0432\u0430\u0442\u0435\u043B\u044F\u043C\u0438. \u0412 \u043A\u0430\u0434\u0440\u0435 \u043F\u043E\u044F\u0432\u043B\u044F\u044E\u0442\u0441\u044F \u0410\u043B\u043B\u0435\u043D \u0413\u0438\u043D\u0437\u0431\u0435\u0440\u0433 \u0438 \u041F\u0430\u0442\u0442\u0438 \u0421\u043C\u0438\u0442, \u043E\u043F\u0435\u0440\u0430\u0442\u043E\u0440 \u2014 \u0422\u043E\u043C \u0414\u0438\u0447\u0438\u043B\u043B\u043E, \u0437\u0432\u0443\u043A \u0432\u043E\u043E\u0431\u0449\u0435 \u0437\u0430\u043F\u0438\u0441\u0430\u043D \u0442\u043E\u0432\u0430\u0440\u0438\u0449\u0435\u043C \u0411\u0440\u0443\u043A\u043D\u0435\u0440\u0430 \u043F\u043E \u0438\u043C\u0435\u043D\u0438 \u0414\u0436\u0438\u043C \u0414\u0436\u0430\u0440\u043C\u0443\u0448. \u0411\u0440\u0443\u043A\u043D\u0435\u0440 \u0443\u043C\u0435\u0440 \u0432 1989-\u043C \u2014 \u043A \u0441\u0442\u043E\u043B\u0435\u0442\u0438\u044E \u0441\u043E \u0434\u043D\u044F \u0440\u043E\u0436\u0434\u0435\u043D\u0438\u044F \u0411\u0435\u0440\u0440\u043E\u0443\u0437\u0430, \u0432 2014-\u043C, \u0432\u0441\u0435\u0433\u043E \u043D\u0435\u0441\u043A\u043E\u043B\u044C\u043A\u043E \u0440\u0430\u0437 \u043F\u043E\u043A\u0430\u0437\u0430\u043D\u043D\u044B\u0439 \u0444\u0438\u043B\u044C\u043C \u0431\u044B\u043B \u0434\u043E\u0434\u0435\u043B\u0430\u043D \u0438 \u043F\u0435\u0440\u0435\u0432\u044B\u043F\u0443\u0449\u0435\u043D \u043F\u043B\u0435\u043C\u044F\u043D\u043D\u0438\u043A\u043E\u043C \u0440\u0435\u0436\u0438\u0441\u0441\u0435\u0440\u0430. \u041E\u0442 \u0421\u0428\u0410 \u0434\u043E \u0421\u0435\u0432\u0435\u0440\u043D\u043E\u0439 \u0410\u0444\u0440\u0438\u043A\u0438, \u043E\u0442 \u0447\u0442\u0435\u043D\u0438\u044F \u043E\u0442\u0440\u044B\u0432\u043A\u043E\u0432 \u0438\u0437 \u00AB\u0413\u043E\u043B\u043E\u0433\u043E \u0437\u0430\u0432\u0442\u0440\u0430\u043A\u0430\u00BB \u0434\u043E \u0432\u043E\u0441\u043F\u043E\u043C\u0438\u043D\u0430\u043D\u0438\u0439 \u043E \u043C\u043E\u043B\u043E\u043B\u043E\u0434\u043E\u0441\u0442\u0438, \u043E\u0442 \u0431\u0435\u0441\u0446\u0435\u043D\u043D\u044B\u0445 \u043C\u043E\u043D\u043E\u043B\u043E\u0433\u043E\u0432 \u0434\u043E \u0436\u0438\u0432\u043E\u0433\u043E \u0438 \u043F\u043E\u0440\u043E\u0439 \u043E\u0447\u0435\u043D\u044C \u0441\u043C\u0435\u0448\u043D\u043E\u0433\u043E \u043E\u0431\u0449\u0435\u043D\u0438\u044F \u0433\u0435\u0440\u043E\u044F \u0441 \u0434\u0440\u0443\u0433\u0438\u043C\u0438 \u043B\u044E\u0434\u044C\u043C\u0438 \u2014 \u043E\u0431\u043E \u0432\u0441\u0435\u043C \u044D\u0442\u043E\u043C \u0441 \u0431\u0435\u0441\u043A\u043E\u043D\u0435\u0447\u043D\u043E\u0439 \u0434\u0435\u043C\u043E\u043D\u0438\u0447\u0435\u0441\u043A\u043E\u0439 \u043F\u0440\u0438\u0432\u043B\u0435\u043A\u0430\u0442\u0435\u043B\u044C\u043D\u043E\u0441\u0442\u044C\u044E.",
