    "country": "\u0421\u0428\u0410",
    "year": "2014",
    "duration": 83,
    "description": "\u0412 \u043C\u043E\u043B\u043E\u0434\u043E\u0441\u0442\u0438 \u043E\u0434\u0438\u043D \u0432\u043B\u0430\u0434\u0435\u043B\u0435\u0446 \u043C\u0430\u0433\u0430\u0437\u0438\u043D\u0430 \u0437\u0430\u044F\u0432\u0438\u043B \u0435\u0439, \u0447\u0442\u043E \u043E\u043D\u0430 \u043D\u0435 \u043E\u0447\u0435\u043D\u044C \u043A\u0440\u0430\u0441\u0438\u0432\u0430\u044F, \u043D\u043E \u044D\u0442\u043E \u043D\u0435 \u0442\u0430\u043A \u0443\u0436 \u0432\u0430\u0436\u043D\u043E, \u043F\u043E\u0441\u043A\u043E\u043B\u044C\u043A\u0443 \u0443 \u043D\u0435\u0435 \u00AB\u0435\u0441\u0442\u044C \u0441\u0442\u0438\u043B\u044C \u2014 \u0438 \u044D\u0442\u043E \u0433\u043E\u0440\u0430\u0437\u0434\u043E \u043B\u0443\u0447\u0448\u0435\u00BB. \u0417\u0430 \u0432\u0441\u0435 \u0441\u043B\u0435\u0434\u0443\u044E\u0449\u0438\u0435 \u0433\u043E\u0434\u044B \u0410\u0439\u0440\u0438\u0441 \u0410\u043F\u0444\u0435\u043B\u044C, \u043A\u043E\u0442\u043E\u0440\u0430\u044F \u043D\u0435 \u043F\u043E\u043A\u043B\u0430\u0434\u0430\u044F \u0440\u0443\u043A \u0440\u0430\u0431\u043E\u0442\u0430\u0435\u0442 \u0432 \u043C\u043E\u0434\u0435 \u0441 50-\u0445 \u0438 \u043A\u043E\u0442\u043E\u0440\u043E\u0439 \u043D\u0430 \u043C\u043E\u043C\u0435\u043D\u0442 \u043F\u043E\u043A\u0430\u0437\u0430 \u0431\u0443\u0434\u0435\u0442 93 \u0433\u043E\u0434\u0430, \u043D\u0438 \u0440\u0430\u0437\u0443 \u043D\u0435 \u043E\u043F\u0440\u043E\u0432\u0435\u0440\u0433\u043B\u0430 \u044D\u0442\u043E \u0443\u0442\u0432\u0435\u0440\u0436\u0434\u0435\u043D\u0438\u0435 \u043E \u0441\u0442\u0438\u043B\u0435. \u041A\u0440\u0443\u0433\u043B\u044B\u0435 \u043E\u0447\u043A\u0438 \u0438 \u0433\u0438\u0433\u0430\u043D\u0442\u0441\u043A\u0438\u0435 \u0443\u043A\u0440\u0430\u0448\u0435\u043D\u0438\u044F, \u0431\u0435\u0441\u043A\u043E\u043D\u0435\u0447\u043D\u044B\u0435 \u0433\u0430\u0440\u0434\u0435\u0440\u043E\u0431\u044B, \u043E\u0431\u043B\u043E\u0436\u043A\u0430 Dazed \u0438 \u0414\u0440\u0438\u0441 \u0432\u0430\u043D \u041D\u043E\u0442\u0435\u043D \u0441 \u041A\u0430\u043D\u044C\u0435 \u0423\u044D\u0441\u0442\u043E\u043C \u0432 \u043F\u043E\u043A\u043B\u043E\u043D\u043D\u0438\u043A\u0430\u0445 \u2014 \u0432\u0441\u0435 \u044D\u0442\u043E \u0410\u0439\u0440\u0438\u0441. \u0410 \u0435\u0449\u0435 \u0443 \u043D\u0435\u0435 \u0435\u0441\u0442\u044C \u0441\u0442\u043E\u043B\u0435\u0442\u043D\u0438\u0439 \u043C\u0443\u0436 \u041A\u0430\u0440\u043B, \u0441 \u043A\u043E\u0442\u043E\u0440\u044B\u043C \u0410\u0439\u0440\u0438\u0441 \u0432\u043C\u0435\u0441\u0442\u0435 \u0441 1948-\u0433\u043E, \u0442\u0430\u043A \u0447\u0442\u043E \u0435\u0435 \u0441\u043B\u043E\u0432\u0430 \u00AB\u0413\u043E\u0440\u0430\u0437\u0434\u043E \u0432\u0430\u0436\u043D\u0435\u0435 \u0431\u044B\u0442\u044C \u0441\u0447\u0430\u0441\u0442\u043B\u0438\u0432\u044B\u043C, \u0447\u0435\u043C \u0445\u043E\u0440\u043E\u0448\u043E \u043E\u0434\u0435\u0442\u044B\u043C\u00BB, \u2014 \u044D\u0442\u043E \u043D\u0438\u0447\u0443\u0442\u044C \u043D\u0435 \u043B\u0443\u043A\u0430\u0432\u0441\u0442\u0432\u043E: \u0432\u043E\u0442 \u0443\u0436 \u043A\u0442\u043E \u0437\u043D\u0430\u0435\u0442, \u043E \u0447\u0435\u043C \u0433\u043E\u0432\u043E\u0440\u0438\u0442. \u041D\u0435 \u043C\u0435\u043D\u0435\u0435 \u0432\u0430\u0436\u043D\u044B\u0439 \u0433\u0435\u0440\u043E\u0439 \u0444\u0438\u043B\u044C\u043C\u0430 \u2014 \u0435\u0433\u043E \u0440\u0435\u0436\u0438\u0441\u0441\u0435\u0440 \u0410\u043B\u044C\u0431\u0435\u0440\u0442 \u041C\u0435\u0439\u0437\u0435\u043B\u0441, \u0430\u0432\u0442\u043E\u0440 \u00AB\u0421\u0435\u0440\u044B\u0445 \u0441\u0430\u0434\u043E\u0432\u00BB \u0438 \u00ABGimme Shelter\u00BB \u043E The Rolling Stones, \u0441\u043A\u043E\u043D\u0447\u0430\u0432\u0448\u0438\u0439\u0441\u044F \u0432 \u044D\u0442\u043E\u043C \u0433\u043E\u0434\u0443 \u0432 83 \u0433\u043E\u0434\u0430. \u00ABIris\u00BB \u0441\u0442\u0430\u043B \u043E\u0434\u043D\u0438\u043C \u0438\u0437 \u0435\u0433\u043E \u043F\u043E\u0441\u043B\u0435\u0434\u043D\u0438\u0445 \u0444\u0438\u043B\u044C\u043C\u043E\u0432 \u2014 \u043E\u043D \u0441\u043B\u0435\u0434\u043E\u0432\u0430\u043B \u0437\u0430 \u0433\u0435\u0440\u043E\u0438\u043D\u0435\u0439 \u043F\u043E \u0432\u0441\u0435\u043C\u0443 \u041C\u0430\u043D\u0445\u044D\u0442\u0442\u0435\u043D\u0443, \u0434\u043E\u0431\u0430\u0432\u0438\u0432 \u0438\u043D\u0442\u0435\u0440\u0432\u044C\u044E \u0435\u0435 \u043F\u043E\u0447\u0438\u0442\u0430\u0442\u0435\u043B\u0435\u0439 \u0438 \u043A\u0430\u0434\u0440\u044B \u0441 \u00AB\u041D\u0438\u043A\u043E\u043D\u0430\u00BB \u0438 16-\u043C\u0438\u043B\u043B\u0438\u043C\u0435\u0442\u0440\u043E\u0432\u043E\u0439 \u043A\u0438\u043D\u043E\u043F\u043B\u0435\u043D\u043A\u0438 \u0438\u0437 \u0441\u0435\u043C\u0435\u0439\u043D\u043E\u0433\u043E \u0430\u0440\u0445\u0438\u0432\u0430.",
