    "nameRU": "\u0421\u043B\u0443\u0448\u0430\u044F \u041C\u043E\u0441\u043A\u0432\u0443",
    "nameEN": "Machine translate: Listening to Moscow",
    "director": "\u0418\u0432\u0430\u043D \u041F\u0440\u043E\u0441\u043A\u0443\u0440\u044F\u043A\u043E\u0432",
    "country": "\u0420\u043E\u0441\u0441\u0438\u044F",
    "year": "2015",
    "duration": 25,
    "description": "\u041C\u043E\u0441\u043A\u0432\u0430 \u0441\u0442\u0430\u043B\u0430 \u0434\u043E\u043C\u043E\u043C \u0438 \u0441\u0446\u0435\u043D\u043E\u0439 \u0434\u043B\u044F \u0430\u0440\u0442\u0438\u0441\u0442\u043E\u0432 \u0438\u0437 \u0441\u0430\u043C\u044B\u0445 \u0440\u0430\u0437\u043D\u044B\u0445 \u0442\u043E\u0447\u0435\u043A \u043F\u043B\u0430\u043D\u0435\u0442\u044B. \u041C\u0443\u0437\u044B\u043A\u0430 \u0432 \u044D\u0442\u043E\u043C \u0433\u043E\u0440\u043E\u0434\u0435 \u0437\u0432\u0443\u0447\u0438\u0442, \u043D\u0435 \u043F\u0440\u0435\u043A\u0440\u0430\u0449\u0430\u044F\u0441\u044C: \u0432\u0435\u043D\u0435\u0441\u0443\u044D\u043B\u0435\u0446-\u043A\u043E\u0441\u043C\u043E\u043F\u043E\u043B\u0438\u0442, \u043E\u0441\u0435\u0432\u0448\u0438\u0439 \u0432 \u041C\u043E\u0441\u043A\u0432\u0435, \u0433\u043E\u0442\u043E\u0432\u0438\u0442 \u043F\u0440\u0435\u0437\u0435\u043D\u0442\u0430\u0446\u0438\u044E \u0430\u043B\u044C\u0431\u043E\u043C\u0430 \u0441\u0432\u043E\u0435\u0439 \u0433\u0440\u0443\u043F\u043F\u044B \u2013 \u0432\u0430\u0436\u043D\u043E\u0435 \u0441\u043E\u0431\u044B\u0442\u0438\u0435 \u0430\u043D\u0434\u0435\u0440\u0433\u0440\u0430\u0443\u043D\u0434\u043D\u043E\u0439 \u0440\u043E\u043A-\u0441\u0446\u0435\u043D\u044B. \u041A\u0438\u0442\u0430\u044F\u043D\u043A\u0430-\u043F\u0438\u0430\u043D\u0438\u0441\u0442\u043A\u0430 \u0438\u0437 \u041A\u043E\u043D\u0441\u0435\u0440\u0432\u0430\u0442\u043E\u0440\u0438\u0438, \u0432\u043B\u044E\u0431\u043B\u0451\u043D\u043D\u0430\u044F \u0432 \u0420\u0430\u0445\u043C\u0430\u043D\u0438\u043D\u043E\u0432\u0430, \u0433\u043E\u0442\u043E\u0432\u0438\u0442\u0441\u044F \u043A \u0441\u0435\u0440\u044C\u0451\u0437\u043D\u043E\u043C\u0443 \u044D\u043A\u0437\u0430\u043C\u0435\u043D\u0443. \u0410\u043C\u0435\u0440\u0438\u043A\u0430\u043D\u043A\u0430 \u0438 \u043A\u0430\u0437\u0430\u0445 \u044D\u043A\u0441\u043F\u0435\u0440\u0438\u043C\u0435\u043D\u0442\u0438\u0440\u0443\u044E\u0442 \u0441 \u0444\u043E\u0440\u043C\u0430\u0442\u0430\u043C\u0438 \u0438 \u0438\u0449\u0443\u0442 \u0441\u043B\u0443\u0448\u0430\u0442\u0435\u043B\u044F \u0441\u0440\u0435\u0434\u0438 \u0441\u043E\u0441\u0435\u0434\u0435\u0439 \u043F\u043E \u043F\u043E\u0434\u044A\u0435\u0437\u0434\u0443, \u043F\u0440\u0438\u0433\u043B\u0430\u0448\u0430\u044F \u0438\u0445 \u043D\u0430 \u043A\u0432\u0430\u0440\u0442\u0438\u0440\u043D\u0438\u043A. \u0410\u043D\u0441\u0430\u043C\u0431\u043B\u044C \u043A\u0443\u0431\u0438\u043D\u0446\u0435\u0432 \u0432 \u043E\u0447\u0435\u0440\u0435\u0434\u043D\u043E\u0439 \u0440\u0430\u0437 \u0432\u044B\u0445\u043E\u0434\u0438\u0442 \u043D\u0430 \u0441\u0446\u0435\u043D\u0443 \u0440\u0435\u0441\u0442\u043E\u0440\u0430\u043D\u0430 \u0441 \u043D\u0430\u0446\u0438\u043E\u043D\u0430\u043B\u044C\u043D\u044B\u043C\u0438 \u043F\u0435\u0441\u043D\u044F\u043C\u0438 \u0438 \u043F\u043B\u044F\u0441\u043A\u0430\u043C\u0438. \u0413\u0430\u043D\u0430\u044F\u043D\u0435\u0446-\u0431\u0430\u0440\u0430\u0431\u0430\u043D\u0449\u0438\u043A \u0438\u0433\u0440\u0430\u0435\u0442 \u0432\u043C\u0435\u0441\u0442\u0435 \u0441 \u0433\u043E\u0441\u043F\u0435\u043B-\u0445\u043E\u0440\u043E\u043C \u043D\u0430 \u043F\u0440\u043E\u0442\u0435\u0441\u0442\u0430\u043D\u0442\u0441\u043A\u043E\u0439 \u0441\u043B\u0443\u0436\u0431\u0435. \u041A\u0430\u0436\u0434\u044B\u0439 \u0438\u0437 \u043D\u0438\u0445 \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0443\u0435\u0442 \u0432 \u0441\u0432\u043E\u0438\u0445 \u043C\u0430\u043B\u0435\u043D\u044C\u043A\u0438\u0445 \u2013 \u0434\u043E\u0441\u0442\u0443\u043F\u043D\u044B\u0445 \u0441\u043B\u0443\u0448\u0430\u0442\u0435\u043B\u044E \u2013 \u043C\u0438\u0440\u0430\u0445; \u0438 \u0438\u0437 \u044D\u0442\u0438\u0445 \u043C\u0438\u0440\u043E\u0432 \u0438 \u0441\u043E\u0441\u0442\u043E\u0438\u0442 \u043C\u0443\u0437\u044B\u043A\u0430\u043B\u044C\u043D\u044B\u0439 \u043B\u0430\u043D\u0434\u0448\u0430\u0444\u0442 \u041C\u043E\u0441\u043A\u0432\u044B.",
