    "year": "2015",
    "duration": 38,
    "description": "\u0413\u0435\u0440\u043E\u044E \u0444\u0438\u043B\u044C\u043C\u0430 \u0434\u0432\u0430\u0434\u0446\u0430\u0442\u044C \u0442\u0440\u0438 \u0433\u043E\u0434\u0430, \u0438 \u043E\u043D \u043E\u0431\u044B\u0447\u043D\u044B\u0439 \u043C\u0435\u0447\u0442\u0430\u0442\u0435\u043B\u044C. \u0420\u0430\u0431\u043E\u0442\u0430\u0435\u0442 \u043F\u0440\u043E\u0434\u0430\u0432\u0446\u043E\u043C \u0432 \u0433\u0438\u043F\u0435\u0440\u043C\u0430\u0440\u043A\u0435\u0442\u0435, \u0436\u0438\u0432\u0451\u0442 \u0432 \u043A\u043E\u043C\u043C\u0443\u043D\u0430\u043B\u043A\u0435 \u0441 \u0440\u0430\u0431\u043E\u0447\u0438\u043C\u0438 \u043C\u0438\u0433\u0440\u0430\u043D\u0442\u0430\u043C\u0438, \u043F\u043E\u043F\u0443\u0442\u043D\u043E \u0433\u0440\u0435\u0437\u044F \u043E \u043A\u0430\u0440\u044C\u0435\u0440\u0435 \u043C\u0443\u0437\u044B\u043A\u0430\u043D\u0442\u0430. \u041D\u0438\u043A\u0442\u043E \u043D\u0435 \u0432\u043E\u0441\u043F\u0440\u0438\u043D\u0438\u043C\u0430\u0435\u0442 \u0435\u0433\u043E \u043C\u0443\u0437\u044B\u043A\u0430\u043B\u044C\u043D\u044B\u0435 \u0443\u0441\u0442\u0440\u0435\u043C\u043B\u0435\u043D\u0438\u044F \u0432\u0441\u0435\u0440\u044C\u0451\u0437: \u043D\u0438 \u0440\u043E\u0434\u0441\u0442\u0432\u0435\u043D\u043D\u0438\u043A\u0438, \u043D\u0438 \u043B\u0443\u0447\u0448\u0438\u0439 \u0434\u0440\u0443\u0433, \u043D\u0438 \u0441\u043E\u0441\u0435\u0434\u0438. \u0412 \u043E\u0441\u043E\u0431\u0435\u043D\u043D\u043E\u0441\u0442\u0438 \u043E\u043D\u0438\u2026 \u041D\u043E \u0443 \u0433\u0435\u0440\u043E\u044F \u0435\u0441\u0442\u044C \u0441\u0442\u0430\u0440\u0430\u044F \u00AB\u042F\u043C\u0430\u0445\u0430\u00BB, \u043A\u043E\u0442\u043E\u0440\u0430\u044F, \u043F\u043E \u0435\u0433\u043E \u043C\u043D\u0435\u043D\u0438\u044E, \u0434\u043E\u043B\u0436\u043D\u0430 \u043F\u0440\u0438\u0432\u0435\u0441\u0442\u0438 \u043A \u0436\u0435\u043B\u0430\u043D\u043D\u043E\u0439 \u043C\u0435\u0447\u0442\u0435.",
