    "director": "\u0424\u0440\u0435\u0434\u0440\u0438\u043A \u0413\u0435\u0440\u0442\u0442\u0435\u043D, \u041C\u0430\u0433\u043D\u0443\u0441 \u0413\u0435\u0440\u0442\u0442\u0435\u043D",
    "country": "Unknown",
    "year": "2015",
    "duration": 96,
    "description": "1999 \u0433\u043E\u0434. \u041D\u0430 \u0441\u0442\u0435\u043D\u0435 \u0432\u0438\u0441\u0438\u0442 \u0433\u0430\u0437\u0435\u0442\u0430 \u0441 \u043D\u0435\u043E\u0441\u043F\u043E\u0440\u0438\u043C\u044B\u043C \u0437\u0430\u0433\u043E\u043B\u043E\u0432\u043A\u043E\u043C \u00AB\u0411\u0435\u043A\u0445\u044D\u043C \u2013 \u043B\u0443\u0447\u0448\u0438\u0439 \u0432 \u043C\u0438\u0440\u0435\u00BB. \u041F\u0435\u0440\u0435\u0434 \u043A\u0430\u043C\u0435\u0440\u043E\u0439 \u2013 \u043C\u0430\u043B\u043E \u043A\u043E\u043C\u0443 \u0438\u0437\u0432\u0435\u0441\u0442\u043D\u044B\u0439 17-\u043B\u0435\u0442\u043D\u0438\u0439 \u043F\u0430\u0446\u0430\u043D, \u043A\u043E\u0442\u043E\u0440\u044B\u0439 \u0437\u0430\u044F\u0432\u043B\u044F\u0435\u0442: \u00AB\u0410\u043D\u0433\u043B\u0438\u0439\u0441\u043A\u0438\u0439 \u0444\u0443\u0442\u0431\u043E\u043B \u2013 \u0434\u0435\u0440\u044C\u043C\u043E\u00BB.\n\n\u042D\u0442\u043E \u043D\u0430\u043F\u0430\u0434\u0430\u044E\u0449\u0438\u0439 \u0448\u0432\u0435\u0434\u0441\u043A\u043E\u0433\u043E \u043A\u043B\u0443\u0431\u0430 \u00AB\u041C\u0430\u043B\u044C\u043C\u0435\u00BB \u0417\u043B\u0430\u0442\u0430\u043D \u0418\u0431\u0440\u0430\u0433\u0438\u043C\u043E\u0432\u0438\u0447, \u043E\u0433\u0440\u043E\u043C\u043D\u043E\u0435 \u0441\u0430\u043C\u043E\u043C\u043D\u0435\u043D\u0438\u0435 \u043A\u043E\u0442\u043E\u0440\u043E\u0433\u043E \u0440\u0430\u0432\u043D\u043E \u0435\u0433\u043E \u0444\u0443\u0442\u0431\u043E\u043B\u044C\u043D\u043E\u043C\u0443 \u0442\u0430\u043B\u0430\u043D\u0442\u0443, \u0442\u043E\u043B\u044C\u043A\u043E \u0442\u0430\u043B\u0430\u043D\u0442 \u044D\u0442\u043E\u0442 \u0435\u0449\u0435 \u043D\u0430\u0434\u043E \u0440\u0430\u0441\u043A\u0440\u044B\u0442\u044C. \u0412\u0441\u0435\u0433\u043E \u0447\u0435\u0440\u0435\u0437 \u043F\u0430\u0440\u0443 \u043B\u0435\u0442 \u0438\u0433\u0440\u044B \u0432 \u0428\u0432\u0435\u0446\u0438\u0438 \u0418\u0431\u0440\u0430\u0433\u0438\u043C\u043E\u0432\u0438\u0447 \u0432 \u0437\u043E\u043B\u043E\u0442\u043E\u043C \u043F\u0438\u0434\u0436\u0430\u043A\u0435 \u0438 \u0440\u043E\u0437\u043E\u0432\u043E\u0439 \u0440\u0443\u0431\u0430\u0448\u043A\u0435 \u043F\u043E\u0435\u0434\u0435\u0442 \u0437\u0430 \u0440\u0435\u043A\u043E\u0440\u0434\u043D\u0443\u044E \u0441\u0443\u043C\u043C\u0443 \u0432 \u0433\u043E\u043B\u043B\u0430\u043D\u0434\u0441\u043A\u0438\u0439 \u00AB\u0410\u044F\u043A\u0441\u00BB, \u0433\u0434\u0435 \u0431\u0443\u0434\u0443\u0442 \u0438 \u0434\u0440\u0430\u043A\u0438, \u0438 \u0434\u0438\u0441\u043A\u0432\u0430\u043B\u0438\u0444\u0438\u043A\u0430\u0446\u0438\u0438, \u0438 \u043A\u043E\u043D\u0444\u043B\u0438\u043A\u0442 \u0441 \u043A\u0430\u043F\u0438\u0442\u0430\u043D\u043E\u043C \u043A\u043E\u043C\u0430\u043D\u0434\u044B, \u043D\u043E \u0431\u0443\u0434\u0443\u0442 \u0438 \u0433\u043E\u043B\u044B \u2013 \u0432\u043A\u043B\u044E\u0447\u0430\u044F \u043E\u0434\u0438\u043D, \u043A\u043E\u0442\u043E\u0440\u044B\u0439 \u043E\u0431\u044F\u0437\u0430\u0442\u0435\u043B\u044C\u043D\u043E \u043D\u0430\u0434\u043E \u0443\u0432\u0438\u0434\u0435\u0442\u044C, \u043F\u043E\u0442\u043E\u043C\u0443 \u0447\u0442\u043E \u043F\u0435\u0440\u0435\u0441\u043A\u0430\u0437\u0430\u0442\u044C \u0435\u0433\u043E \u0432\u0441\u0435 \u0440\u0430\u0432\u043D\u043E \u043D\u0435 \u043F\u043E\u043B\u0443\u0447\u0438\u0442\u0441\u044F. \u0424\u0438\u043B\u044C\u043C \u0424\u0440\u0435\u0434\u0440\u0438\u043A\u0430 \u0438 \u041C\u0430\u0433\u043D\u0443\u0441\u0430 \u0413\u0435\u0440\u0442\u0442\u0435\u043D\u043E\u0432 \u043F\u043E\u043A\u0430\u0437\u044B\u0432\u0430\u0435\u0442, \u043E\u0442\u043A\u0443\u0434\u0430 \u0432\u0437\u044F\u043B\u0441\u044F \u0441\u0430\u043C\u044B\u0439 \u0445\u0430\u0440\u0438\u0437\u043C\u0430\u0442\u0438\u0447\u043D\u044B\u0439 \u0438\u0433\u0440\u043E\u043A \u0441\u043E\u0432\u0440\u0435\u043C\u0435\u043D\u043D\u043E\u0433\u043E \u0444\u0443\u0442\u0431\u043E\u043B\u0430 (\u0435\u0441\u043B\u0438 \u0447\u0442\u043E, \u0441 \u044D\u0442\u0438\u043C \u043E\u043F\u0440\u0435\u0434\u0435\u043B\u0435\u043D\u0438\u0435\u043C \u0441\u043E\u0433\u043B\u0430\u0441\u044F\u0442\u0441\u044F \u0438 \u041C\u0435\u0441\u0441\u0438, \u0438 \u0420\u043E\u043D\u0430\u043B\u0434\u0443) \u0438 \u043F\u043E\u0434\u0440\u043E\u0431\u043D\u0435\u0439\u0448\u0438\u043C \u043E\u0431\u0440\u0430\u0437\u043E\u043C \u043E\u0441\u0432\u0435\u0449\u0430\u0435\u0442 \u043E\u0442\u043D\u043E\u0441\u0438\u0442\u0435\u043B\u044C\u043D\u043E \u043C\u0430\u043B\u043E\u0438\u0437\u0432\u0435\u0441\u0442\u043D\u044B\u0439 \u043F\u0435\u0440\u0438\u043E\u0434 \u0435\u0433\u043E \u043A\u0430\u0440\u044C\u0435\u0440\u044B.\n\n\u0421\u0430\u043C\u043E\u0435 \u0446\u0435\u043D\u043D\u043E\u0435 \u0437\u0434\u0435\u0441\u044C \u2013 \u043D\u0435\u0432\u0435\u0440\u043E\u044F\u0442\u043D\u044B\u0435 \u0430\u0440\u0445\u0438\u0432\u043D\u044B\u0435 \u0441\u044A\u0435\u043C\u043A\u0438 \u0438\u0437 \u0428\u0432\u0435\u0446\u0438\u0438: \u043A\u043B\u0443\u0431\u043D\u044B\u0439 \u043E\u043F\u0435\u0440\u0430\u0442\u043E\u0440 \u00AB\u041C\u0430\u043B\u044C\u043C\u0435\u00BB, \u0441\u043D\u0438\u043C\u0430\u044E\u0449\u0438\u0439 \u0441 \u0440\u0430\u0441\u0441\u0442\u043E\u044F\u043D\u0438\u044F \u0432\u044B\u0442\u044F\u043D\u0443\u0442\u043E\u0439 \u0440\u0443\u043A\u0438, \u0445\u043E\u0434\u0438\u0442 \u0437\u0430 \u0417\u043B\u0430\u0442\u0430\u043D\u043E\u043C \u0438 \u0432 \u0440\u0430\u0437\u0434\u0435\u0432\u0430\u043B\u043A\u0443, \u0438 \u0432 \u0430\u0432\u0442\u043E\u0431\u0443\u0441, \u0438 \u043A \u043D\u0435\u043C\u0443 \u0434\u043E\u043C\u043E\u0439, \u0433\u0434\u0435 \u043E\u043D \u0440\u0435\u0436\u0435\u0442\u0441\u044F \u0432 \u043F\u0440\u0438\u0441\u0442\u0430\u0432\u043A\u0443, \u0430 \u0442\u0430\u043A\u0436\u0435 \u043F\u043E\u043A\u0430\u0437\u044B\u0432\u0430\u0435\u0442, \u043A\u0430\u043A \u0434\u0435\u0442\u0438 \u0432\u044B\u043F\u0440\u0430\u0448\u0438\u0432\u0430\u044E\u0442 \u0443 \u043D\u0435\u0433\u043E \u0431\u0443\u0442\u0441\u044B, \u0430 \u0434\u0435\u0432\u0443\u0448\u043A\u0438 \u2013 \u043D\u043E\u043C\u0435\u0440 \u0442\u0435\u043B\u0435\u0444\u043E\u043D\u0430. \u0420\u0430\u043D\u043D\u0438\u0439 \u044D\u0442\u0430\u043F \u0435\u0433\u043E \u043A\u0430\u0440\u044C\u0435\u0440\u044B \u043D\u0435 \u043E\u0431\u0445\u043E\u0434\u0438\u0442\u0441\u044F \u0431\u0435\u0437 \u0442\u0440\u0443\u0434\u043D\u043E\u0441\u0442\u0435\u0439, \u043D\u043E \u0418\u0431\u0440\u0430\u0433\u0438\u043C\u043E\u0432\u0438\u0447 \u0440\u0430\u0441\u043F\u0440\u0430\u0432\u043B\u044F\u0435\u0442\u0441\u044F \u0441 \u043D\u0438\u043C\u0438 \u043F\u0440\u0438\u043C\u0435\u0440\u043D\u043E \u0442\u0430\u043A \u0436\u0435 \u044D\u0444\u0444\u0435\u043A\u0442\u043D\u043E, \u043A\u0430\u043A \u043E\u0441\u0442\u0430\u0432\u043B\u044F\u0435\u0442 \u0432 \u0434\u0443\u0440\u0430\u043A\u0430\u0445 \u0441\u0440\u0430\u0437\u0443 \u0442\u0440\u0435\u0445 \u0437\u0430\u0449\u0438\u0442\u043D\u0438\u043A\u043E\u0432 \u0432 \u0434\u0435\u0440\u0431\u0438 \u0441 \u00AB\u042E\u0440\u0433\u043E\u0440\u0434\u0435\u043D\u043E\u043C\u00BB \u0432 2001 \u0433\u043E\u0434\u0443, \u2013 \u0438 \u0442\u0430\u043A \u0436\u0435 \u0443\u0431\u0435\u0434\u0438\u0442\u0435\u043B\u044C\u043D\u043E, \u043A\u0430\u043A \u0432 2016-\u043C \u0437\u0430\u0432\u043E\u0435\u0432\u044B\u0432\u0430\u0435\u0442 29-\u0439 \u0442\u0440\u043E\u0444\u0435\u0439 \u0432 \u0441\u0432\u043E\u0435\u0439 \u043A\u0430\u0440\u044C\u0435\u0440\u0435.",
