    "id": 91,
    "nameRU": "\u0411\u0435\u0433 \u2014 \u044D\u0442\u043E \u0441\u0432\u043E\u0431\u043E\u0434\u0430",
    "nameEN": "Free to Run",
    "director": "\u041F\u044C\u0435\u0440 \u041C\u043E\u0440\u0430\u0442",
    "country": "\u0428\u0432\u0435\u0439\u0446\u0430\u0440\u0438\u044F, \u0424\u0440\u0430\u043D\u0446\u0438\u044F, \u0411\u0435\u043B\u044C\u0433\u0438\u044F",
    "year": "2015",
    "duration": 90,
    "description": "\u0421\u0435\u0433\u043E\u0434\u043D\u044F \u043C\u0430\u043B\u043E \u043A\u0442\u043E \u043F\u043E\u043C\u043D\u0438\u0442, \u0447\u0442\u043E \u0435\u0449\u0435 50 \u043B\u0435\u0442 \u043D\u0430\u0437\u0430\u0434 \u043F\u0440\u043E\u0441\u0442\u044B\u043C \u0431\u0435\u0433\u0443\u043D\u0430\u043C \u043F\u0440\u0438\u0445\u043E\u0434\u0438\u043B\u043E\u0441\u044C \u0431\u044B\u0442\u044C \u0431\u0443\u043D\u0442\u0430\u0440\u044F\u043C\u0438 \u2014 \u043C\u0435\u0441\u0442\u0430 \u0432 \u044D\u0442\u043E\u043C \u0441\u043F\u043E\u0440\u0442\u0435 \u043E\u0444\u0438\u0446\u0438\u0430\u043B\u044C\u043D\u043E \u043D\u0435 \u0431\u044B\u043B\u043E \u043D\u0438 \u0436\u0435\u043D\u0449\u0438\u043D\u0430\u043C, \u043D\u0438 \u043B\u044E\u0431\u0438\u0442\u0435\u043B\u044F\u043C.\n\n\u0421\u0438\u0442\u0443\u0430\u0446\u0438\u044E \u0438\u0437\u043C\u0435\u043D\u0438\u043B\u0438 60-\u0435 \u0433\u043E\u0434\u044B, \u0432\u0440\u0435\u043C\u044F \u0431\u043E\u0440\u044C\u0431\u044B \u0437\u0430 \u043F\u0440\u0430\u0432\u0430 \u043D\u0430 \u0432\u0441\u0435\u0445 \u0444\u0440\u043E\u043D\u0442\u0430\u0445. \u041D\u0430\u0447\u0438\u043D\u0430\u044F \u0438\u043C\u0435\u043D\u043D\u043E \u0441 60-\u0445, \u0444\u0438\u043B\u044C\u043C \u0440\u0430\u0441\u0441\u043A\u0430\u0437\u044B\u0432\u0430\u0435\u0442 \u0438\u0441\u0442\u043E\u0440\u0438\u044E \u0431\u0435\u0433\u0430 \u043A\u0430\u043A \u043A\u0443\u043B\u044C\u0442\u0443\u0440\u043D\u043E\u0433\u043E \u0438 \u0434\u0430\u0436\u0435 \u043A\u043E\u043D\u0442\u0440\u043A\u0443\u043B\u044C\u0442\u0443\u0440\u043D\u043E\u0433\u043E \u044F\u0432\u043B\u0435\u043D\u0438\u044F, \u043E\u0442 \u0440\u043E\u043C\u0430\u043D\u0442\u0438\u0447\u0435\u0441\u043A\u0438\u0445 \u043F\u0440\u043E\u0432\u043E\u043A\u0430\u0446\u0438\u0439 \u0434\u043E \u0441\u043E\u0437\u0434\u0430\u043D\u0438\u044F \u043E\u0433\u0440\u043E\u043C\u043D\u043E\u0439 \u0438\u043D\u0434\u0443\u0441\u0442\u0440\u0438\u0438.\n\n\u0413\u043B\u0430\u0432\u043D\u044B\u0435 \u0433\u0435\u0440\u043E\u0438 \u0444\u0438\u043B\u044C\u043C\u0430 \u2014 \u0438\u043A\u043E\u043D\u044B \u0431\u0435\u0433\u043E\u0432\u043E\u0433\u043E \u0434\u0432\u0438\u0436\u0435\u043D\u0438\u044F. \u041A\u044D\u0442\u0440\u0438\u043D \u0428\u0432\u0438\u0442\u0446\u0435\u0440 \u2014 \u043F\u0435\u0440\u0432\u0430\u044F \u0436\u0435\u043D\u0449\u0438\u043D\u0430-\u043C\u0430\u0440\u0430\u0444\u043E\u043D\u0435\u0446: \u0432 1967-\u043C \u043E\u043D\u0430 \u043E\u0442\u0431\u0438\u0432\u0430\u043B\u0430\u0441\u044C \u043E\u0442 \u0434\u0438\u0440\u0435\u043A\u0442\u043E\u0440\u0430 \u0411\u043E\u0441\u0442\u043E\u043D\u0441\u043A\u043E\u0433\u043E \u043C\u0430\u0440\u0430\u0444\u043E\u043D\u0430, \u043A\u043E\u0442\u043E\u0440\u044B\u0439 \u0441\u0438\u043B\u043E\u0439 \u043F\u044B\u0442\u0430\u043B\u0441\u044F \u0441\u0442\u043E\u043B\u043A\u043D\u0443\u0442\u044C \u0435\u0435 \u0441 \u0434\u0438\u0441\u0442\u0430\u043D\u0446\u0438\u0438. \u0424\u043E\u0442\u043E\u0433\u0440\u0430\u0444\u0438\u044F \u044D\u0442\u043E\u0433\u043E \u043C\u043E\u043C\u0435\u043D\u0442\u0430 \u043E\u0431\u043E\u0448\u043B\u0430 \u043E\u0431\u043B\u043E\u0436\u043A\u0438 \u043C\u0438\u0440\u043E\u0432\u044B\u0445 \u0438\u0437\u0434\u0430\u043D\u0438\u0439, \u0430 \u0435\u0435 \u0433\u0435\u0440\u043E\u0438\u043D\u044F \u0432\u043F\u043E\u0441\u043B\u0435\u0434\u0441\u0442\u0432\u0438\u0438 \u0441\u0442\u0430\u043B \u043B\u0438\u0446\u043E\u043C \u043F\u0435\u0440\u0432\u043E\u0433\u043E \u043C\u0430\u0440\u0430\u0444\u043E\u043D\u0430 \u0434\u043B\u044F \u0436\u0435\u043D\u0449\u0438\u043D \u0438 \u043A\u043E\u043C\u043C\u0435\u043D\u0442\u0430\u0442\u043E\u0440\u043E\u043C \u043F\u0435\u0440\u0432\u043E\u0433\u043E \u0436\u0435\u043D\u0441\u043A\u043E\u0433\u043E \u0437\u0430\u0431\u0435\u0433\u0430 \u043D\u0430 \u041E\u043B\u0438\u043C\u043F\u0438\u0439\u0441\u043A\u0438\u0445 \u0438\u0433\u0440\u0430\u0445 1984 \u0433\u043E\u0434\u0430. \u0424\u0440\u0435\u0434 \u041B\u0435\u0431\u043E\u0443 \u2014 \u043E\u0441\u043D\u043E\u0432\u0430\u0442\u0435\u043B\u044C \u041D\u044C\u044E-\u0419\u043E\u0440\u043A\u0441\u043A\u043E\u0433\u043E \u043C\u0430\u0440\u0430\u0444\u043E\u043D\u0430, \u0440\u043E\u0434\u0438\u0432\u0448\u0435\u0433\u043E\u0441\u044F \u0438\u0437 \u043A\u0440\u043E\u0445\u043E\u0442\u043D\u043E\u0439 \u0430\u0441\u0441\u043E\u0446\u0438\u0430\u0446\u0438\u0438 \u0431\u0435\u0433\u0443\u043D\u043E\u0432-\u0432\u043E\u043B\u043E\u043D\u0442\u0435\u0440\u043E\u0432, \u043A\u043E\u0442\u043E\u0440\u044B\u0435 \u0442\u043E\u0433\u0434\u0430 \u0434\u0430\u0436\u0435 \u043D\u0435 \u043C\u043E\u0433\u043B\u0438 \u043F\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u0438\u0442\u044C, \u0447\u0442\u043E \u043A\u043E\u0433\u0434\u0430-\u043D\u0438\u0431\u0443\u0434\u044C \u043E\u043A\u043A\u0443\u043F\u0438\u0440\u0443\u044E\u0442 \u0426\u0435\u043D\u0442\u0440\u0430\u043B\u044C\u043D\u044B\u0439 \u043F\u0430\u0440\u043A. \u0412 62 \u0433\u043E\u0434\u0430 \u043E\u043D, \u0443\u0436\u0435 \u0437\u043D\u0430\u044F, \u0447\u0442\u043E \u0431\u043E\u043B\u0435\u043D \u0440\u0430\u043A\u043E\u043C \u043C\u043E\u0437\u0433\u0430, \u043F\u0440\u043E\u0431\u0435\u0436\u0430\u043B \u043C\u0430\u0440\u0430\u0444\u043E\u043D \u0432 \u043A\u0430\u0447\u0435\u0441\u0442\u0432\u0435 \u0441\u0438\u043C\u0432\u043E\u043B\u0438\u0447\u0435\u0441\u043A\u043E\u0433\u043E \u0436\u0435\u0441\u0442\u0430, \u043F\u043E\u043A\u0430\u0437\u044B\u0432\u0430\u044F \u0441\u0435\u0431\u0435 \u0438 \u0434\u0440\u0443\u0437\u044C\u044F\u043C, \u0447\u0442\u043E \u0436\u0438\u0432. \u041E\u0440\u0435\u0433\u043E\u043D\u0435\u0446 \u0421\u0442\u0438\u0432 \u041F\u0440\u0435\u0444\u043E\u043D\u0442\u0435\u0439\u043D \u2014 \u0440\u0435\u043A\u043E\u0440\u0434\u0441\u043C\u0435\u043D \u0438 \u0431\u043E\u0440\u0435\u0446 \u0437\u0430 \u043F\u0440\u0430\u0432\u043E \u0432\u0441\u0435\u0445 \u0442\u0430\u043B\u0430\u043D\u0442\u043B\u0438\u0432\u044B\u0445 \u00AB\u043B\u044E\u0431\u0438\u0442\u0435\u043B\u0435\u0439\u00BB \u043D\u0430 \u043F\u0440\u043E\u0444\u0435\u0441\u0441\u0438\u043E\u043D\u0430\u043B\u044C\u043D\u0443\u044E \u043A\u0430\u0440\u044C\u0435\u0440\u0443; \u0432 \u0413\u043E\u043B\u043B\u0438\u0432\u0443\u0434\u0435 \u043E \u043D\u0435\u043C \u0443\u0436\u0435 \u0441\u043D\u044F\u043B\u0438 \u0434\u0432\u0430 \u0444\u0438\u043B\u044C\u043C\u0430. \u042D\u0442\u043E \u043E\u0434\u0430 \u0431\u0435\u0433\u0443 \u043A\u0430\u043A \u043F\u0440\u043E\u044F\u0432\u043B\u0435\u043D\u0438\u044E \u0432\u043E\u043B\u0438 \u043A \u0436\u0438\u0437\u043D\u0438, \u0441\u043F\u043E\u0441\u043E\u0431\u0443 \u0435\u0434\u0438\u043D\u0435\u043D\u0438\u044F \u0441 \u043F\u0440\u0438\u0440\u043E\u0434\u043E\u0439, \u0430 \u043C\u0430\u0440\u0430\u0444\u043E\u043D\u0430\u043C \u2014 \u043A\u0430\u043A \u043C\u0438\u043D\u0443\u0442\u0430\u043C \u0441\u043B\u0430\u0432\u044B \u0434\u043B\u044F \u043A\u0430\u0436\u0434\u043E\u0433\u043E.",
