    "description": "\u041F\u043E\u0441\u043B\u0435\u0434\u043D\u044F\u044F \u0440\u0430\u0431\u043E\u0442\u0430 \u0410\u0434\u0430\u043C\u0430 \u041A\u0435\u0440\u0442\u0438\u0441\u0430, \u043F\u043E\u0436\u0430\u043B\u0443\u0439, \u0441\u0430\u043C\u043E\u0433\u043E \u0438\u0437\u0432\u0435\u0441\u0442\u043D\u043E\u0433\u043E \u0442\u0435\u043B\u0435\u0432\u0438\u0437\u0438\u043E\u043D\u0449\u0438\u043A\u0430 \u0432 \u043C\u0438\u0440\u0435 \u043A\u0438\u043D\u043E \u0438 \u0441\u0430\u043C\u043E\u0433\u043E \u043D\u0435\u043E\u0447\u0435\u0432\u0438\u0434\u043D\u043E\u0433\u043E \u0440\u0435\u0436\u0438\u0441\u0441\u0435\u0440\u0430 \u043D\u0430 \u0441\u043E\u0432\u0440\u0435\u043C\u0435\u043D\u043D\u043E\u043C \u0431\u0440\u0438\u0442\u0430\u043D\u0441\u043A\u043E\u043C \u0442\u0435\u043B\u0435\u0432\u0438\u0434\u0435\u043D\u0438\u0438. \u042D\u0442\u0430 \u0434\u0438\u043A\u043E\u0432\u0430\u0442\u0430\u044F \u043A\u043E\u043C\u0431\u0438\u043D\u0430\u0446\u0438\u044F \u0438\u0441\u0447\u0435\u0440\u043F\u044B\u0432\u0430\u044E\u0449\u0435 \u043E\u0431\u044A\u044F\u0441\u043D\u044F\u0435\u0442 \u043C\u0435\u0442\u043E\u0434 \u041A\u0435\u0440\u0442\u0438\u0441\u0430: \u0431\u0443\u0434\u0443\u0447\u0438 \u0448\u0442\u0430\u0442\u043D\u044B\u043C \u0441\u043E\u0442\u0440\u0443\u0434\u043D\u0438\u043A\u043E\u043C BBC \u0438 \u0438\u043C\u0435\u044F \u043D\u0435\u043E\u0433\u0440\u0430\u043D\u0438\u0447\u0435\u043D\u043D\u044B\u0439 \u0434\u043E\u0441\u0442\u0443\u043F \u043A \u0438\u0445 \u0430\u0440\u0445\u0438\u0432\u0430\u043C, \u043E\u043D \u0434\u0435\u043B\u0430\u0435\u0442 \u043A\u0440\u0430\u0439\u043D\u0435 \u0432\u0438\u0437\u0443\u0430\u043B\u044C\u043D\u044B\u0435 \u0444\u0438\u043B\u044C\u043C\u044B-\u044D\u0441\u0441\u0435, \u043F\u043E\u0441\u0432\u044F\u0449\u0435\u043D\u043D\u044B\u0435 \u0432\u0437\u0430\u0438\u043C\u043E\u0441\u0432\u044F\u0437\u0438 \u0432\u043B\u0430\u0441\u0442\u0438, \u0442\u0435\u0445\u043D\u0438\u0447\u0435\u0441\u043A\u043E\u0433\u043E \u043F\u0440\u043E\u0433\u0440\u0435\u0441\u0441\u0430 \u0438 \u0438\u0445 \u0432\u043B\u0438\u044F\u043D\u0438\u044E \u043D\u0430 \u043F\u043E\u043B\u0438\u0442\u0438\u043A\u0443 \u0438 \u043A\u0443\u043B\u044C\u0442\u0443\u0440\u0443, \u043F\u0440\u0438\u0447\u0435\u043C \u0432\u0441\u0435\u0433\u0434\u0430 \u0441 \u0431\u0435\u0437\u0443\u043F\u0440\u0435\u0447\u043D\u044B\u043C \u0432\u044B\u0431\u043E\u0440\u043E\u043C \u043C\u0443\u0437\u044B\u043A\u0438.\n\n\u042D\u0442\u043E \u0438\u0441\u0442\u043E\u0440\u0438\u044F \u043E\u0431 \u0410\u0444\u0433\u0430\u043D\u0438\u0441\u0442\u0430\u043D\u0435 \u0438 \u0445\u0440\u043E\u043D\u0438\u043A\u0430\u0445 \u0437\u0430\u043F\u0430\u0434\u043D\u043E\u0433\u043E \u0432\u043C\u0435\u0448\u0430\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u0430 \u043D\u0430 \u0411\u043B\u0438\u0436\u043D\u0435\u043C \u0412\u043E\u0441\u0442\u043E\u043A\u0435, \u043A\u043E\u0442\u043E\u0440\u043E\u0435 \u043F\u043E \u043C\u043D\u0435\u043D\u0438\u044E \u041A\u0435\u0440\u0442\u0438\u0441\u0430, \u043F\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043B\u044F\u0435\u0442 \u0441\u043E\u0431\u043E\u0439 \u0447\u0435\u0440\u0435\u0434\u0443 \u043D\u0435\u043F\u043E\u043D\u0438\u043C\u0430\u043D\u0438\u0439 \u0438 \u0443\u043F\u0440\u043E\u0449\u0435\u043D\u0438\u0439, \u0440\u0430\u0437 \u0437\u0430 \u0440\u0430\u0437\u043E\u043C \u043F\u0440\u0438\u0432\u043E\u0434\u0438\u0432\u0448\u0438\u0445 \u043A \u0440\u0435\u0437\u0443\u043B\u044C\u0442\u0430\u0442\u0443, \u0440\u043E\u0432\u043D\u043E \u043F\u0440\u043E\u0442\u0438\u0432\u043E\u043F\u043E\u043B\u043E\u0436\u043D\u043E\u043C\u0443 \u043F\u043B\u0430\u043D\u0438\u0440\u0443\u0435\u043C\u043E\u043C\u0443. \u0410\u043C\u0435\u0440\u0438\u043A\u0430 \u0437\u0430\u0449\u0438\u0449\u0430\u043B\u0430 \u0432\u0430\u0445\u0445\u0430\u0431\u0438\u0442\u043E\u0432, \u0447\u0442\u043E\u0431\u044B \u0438\u043C\u0435\u0442\u044C \u0434\u043E\u0441\u0442\u0443\u043F \u043A \u043D\u0435\u0444\u0442\u0438 \u0421\u0430\u0443\u0434\u043E\u0432\u0441\u043A\u043E\u0439 \u0410\u0440\u0430\u0432\u0438\u0438, \u0432 \u0410\u0444\u0433\u0430\u043D\u0438\u0441\u0442\u0430\u043D\u0435 \u0441\u0442\u0440\u043E\u0438\u043B\u0438 \u0434\u0430\u043C\u0431\u044B, \u0447\u0442\u043E\u0431\u044B \u043E\u0441\u0443\u0448\u0438\u0442\u044C \u0413\u0438\u043B\u044C\u043C\u0435\u043D\u0434\u0441\u043A\u0443\u044E \u0434\u043E\u043B\u0438\u043D\u0443, \u0442\u0430\u043A\u0438\u043C \u043E\u0431\u0440\u0430\u0437\u043E\u043C \u0433\u043E\u0442\u043E\u0432\u044F \u0438\u0434\u0435\u0430\u043B\u044C\u043D\u0443\u044E \u043F\u043E\u0447\u0432\u0443 \u0434\u043B\u044F \u0432\u044B\u0440\u0430\u0449\u0438\u0432\u0430\u043D\u0438\u044F \u043E\u043F\u0438\u0443\u043C\u043D\u043E\u0433\u043E \u043C\u0430\u043A\u0430. \u041F\u0440\u043E\u0448\u043B\u043E\u0435 \u0443\u0441\u0435\u044F\u043D\u043E \u043F\u0440\u0435\u0434\u0443\u043F\u0440\u0435\u0436\u0434\u0435\u043D\u0438\u044F\u043C\u0438, \u0430 \u0438\u0441\u0442\u043E\u0440\u0438\u044F \u2014 \u044D\u0442\u043E \u0443\u0437\u043E\u0440, \u0442\u043E\u043B\u044C\u043A\u043E \u043A\u0442\u043E \u0431\u044B \u0440\u0430\u0437\u0433\u043B\u044F\u0434\u0435\u043B \u0435\u0433\u043E, \u043D\u043E \u0441\u0435\u0433\u043E\u0434\u043D\u044F \u0438\u0441\u0442\u043E\u0440\u0438\u044F \u0432\u044B\u0433\u043B\u044F\u0434\u0438\u0442 \u0441\u043B\u0438\u0448\u043A\u043E\u043C \u0441\u043B\u043E\u0436\u043D\u043E\u0439 \u0448\u0442\u0443\u043A\u043E\u0439 \u0434\u043B\u044F \u043F\u043E\u043B\u0438\u0442\u0438\u043A\u043E\u0432, \u0435\u0435 \u0437\u0430\u043C\u0435\u043D\u0438\u043B \u0441\u043A\u0430\u0437\u043E\u0447\u043D\u044B\u0439 \u043C\u0438\u0444 \u043F\u0440\u043E \u0434\u043E\u0431\u0440\u043E \u0438 \u0437\u043B\u043E, \u0442\u0435\u043C \u0432\u0440\u0435\u043C\u0435\u043D\u0435\u043C \u0418\u0441\u043B\u0430\u043C\u0441\u043A\u043E\u0435 \u0413\u043E\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u043E \u0436\u0435\u043B\u0430\u0435\u0442 \u043F\u0440\u0438\u043C\u0435\u0440\u043D\u043E \u0442\u043E\u0433\u043E \u0436\u0435, \u0447\u0435\u0433\u043E \u0445\u043E\u0442\u0435\u043B\u0438 \u0432\u0430\u0445\u0445\u0430\u0431\u0438\u0442\u044B \u0435\u0449\u0435 \u043F\u043E\u043B\u0432\u0435\u043A\u0430 \u043D\u0430\u0437\u0430\u0434. \u0424\u0438\u043B\u044C\u043C-\u043F\u0440\u043E\u0432\u043E\u043A\u0430\u0446\u0438\u044F \u0432\u044B\u0437\u0432\u0430\u043B \u043D\u0435\u043C\u0430\u043B\u043E \u0441\u043F\u043E\u0440\u043E\u0432 \u0432 \u0411\u0440\u0438\u0442\u0430\u043D\u0438\u0438, \u043D\u043E \u0435\u0433\u043E \u043A\u0438\u043D\u0435\u043C\u0430\u0442\u043E\u0433\u0440\u0430\u0447\u0435\u0441\u043A\u0430\u044F \u0446\u0435\u043D\u043D\u043E\u0441\u0442\u044C \u0431\u0435\u0441\u0441\u043F\u043E\u0440\u043D\u0430 \u2014 \u0432\u043F\u0435\u0447\u0430\u0442\u043B\u044F\u044E\u0449\u0438\u0439 \u0430\u0443\u0434\u0438\u043E-\u0432\u0438\u0437\u0443\u0430\u043B\u044C\u043D\u044B\u0439 \u043A\u043E\u043B\u043B\u0430\u0436 \u0434\u043B\u0438\u043D\u043E\u0439 \u0432 137 \u043C\u0438\u043D\u0443\u0442, \u0441 \u0446\u0438\u0442\u0430\u0442\u0430\u043C\u0438 \u0438\u0437 \u00AB\u0421\u043E\u043B\u044F\u0440\u0438\u0441\u0430\u00BB \u0422\u0430\u0440\u043A\u043E\u0432\u0441\u043A\u043E\u0433\u043E.",
