    "description": "\u0424\u0438\u043B\u044C\u043C \u043E \u0441\u043E\u0432\u0440\u0435\u043C\u0435\u043D\u043D\u043E\u0439 \u043A\u043B\u0443\u0431\u043D\u043E\u0439 \u0441\u0446\u0435\u043D\u0435 \u043F\u043E\u0447\u0442\u0438 \u0434\u044E\u0436\u0438\u043D\u044B \u0431\u043E\u043B\u044C\u0448\u0438\u0445 \u0430\u0444\u0440\u0438\u043A\u0430\u043D\u0441\u043A\u0438\u0445 \u0441\u0442\u043E\u043B\u0438\u0446: \u0419\u043E\u0445\u0430\u043D\u043D\u0435\u0441\u0431\u0443\u0440\u0433\u0430, \u041B\u0430\u0433\u043E\u0441\u0430, \u0414\u0430\u043A\u0430\u0440\u0430 \u2014 \u043E\u0437\u0432\u0443\u0447\u0435\u043D \u043F\u0435\u0432\u0438\u0446\u0435\u0439 \u041D\u0435\u043D\u0435 \u0427\u0435\u0440\u0440\u0438 \u0438 \u043D\u0430\u0447\u0438\u043D\u0435\u043D \u0444\u0440\u0430\u0433\u043C\u0435\u043D\u0442\u0430\u043C\u0438 \u0442\u0435\u043A\u0441\u0442\u043E\u0432 \u0438 \u0432\u044B\u0441\u0442\u0443\u043F\u043B\u0435\u043D\u0438\u0439 \u0424\u0435\u043B\u0430 \u041A\u0443\u0442\u0438, \u043E\u0434\u043D\u043E\u0433\u043E \u0438\u0437 \u0441\u0430\u043C\u044B\u0445 \u0432\u043B\u0438\u044F\u0442\u0435\u043B\u044C\u043D\u044B\u0445 \u0430\u0444\u0440\u0438\u043A\u0430\u043D\u0441\u043A\u0438\u0445 \u0430\u0440\u0442\u0438\u0441\u0442\u043E\u0432 \u0438 \u043F\u043E\u043B\u0438\u0442\u0438\u0447\u0435\u0441\u043A\u0438\u0445 \u0430\u043A\u0442\u0438\u0432\u0438\u0441\u0442\u043E\u0432. \u0415\u0433\u043E \u044F\u0440\u043A\u0438\u0435 \u0438 \u043C\u0435\u0441\u0442\u0430\u043C\u0438 \u0440\u0430\u0434\u0438\u043A\u0430\u043B\u044C\u043D\u044B\u0435 \u0432\u044B\u0441\u043A\u0430\u0437\u044B\u0432\u0430\u043D\u0438\u044F \u043E \u0431\u043E\u0440\u044C\u0431\u0435 \u0441 \u043D\u0435\u043E\u043A\u043E\u043B\u043E\u043D\u0438\u0430\u043B\u0438\u0437\u043C\u043E\u043C, \u043E \u0442\u043E\u043C, \u0447\u0442\u043E \u0441\u043B\u043E\u0432\u043E \u00AB\u0434\u0435\u043C\u043E\u043A\u0440\u0430\u0442\u0438\u044F\u00BB \u043D\u0435 \u0442\u0430\u043A \u0443\u0436 \u0434\u0430\u043B\u0435\u043A\u043E \u043E\u0442 \u00AB\u0441\u0443\u043C\u0430\u0441\u0448\u0435\u0441\u0442\u0432\u0438\u044F\u00BB (democrazy) \u0441\u043E\u0441\u0435\u0434\u0441\u0442\u0432\u0443\u044E\u0442 \u0441 \u043D\u0435 \u043C\u0435\u043D\u0435\u0435 \u0432\u043F\u0435\u0447\u0430\u0442\u043B\u044F\u044E\u0449\u0438\u043C\u0438 \u043E\u0431\u0440\u0430\u0437\u0430\u043C\u0438 \u043C\u043E\u043B\u043E\u0434\u044B\u0445 \u0430\u0444\u0440\u0438\u043A\u0430\u043D\u0441\u043A\u0438\u0445 \u043C\u0443\u0437\u044B\u043A\u0430\u043D\u0442\u043E\u0432, \u0442\u0435\u0445, \u043A\u0442\u043E \u0433\u043E\u0442\u043E\u0432\u0438\u0442 \u0432 \u0434\u043E\u043C\u0430\u0448\u043D\u0438\u0445 \u0443\u0441\u043B\u043E\u0432\u0438\u044F\u0445 \u0430\u0444\u0440\u0438\u043A\u0430\u043D\u0441\u043A\u0443\u044E \u0442\u0430\u043D\u0446\u0435\u0432\u0430\u043B\u044C\u043D\u0443\u044E \u0440\u0435\u0432\u043E\u043B\u044E\u0446\u0438\u044E.",
