    "description": "\u00AB\u041F\u043E\u0441\u0442\u043E\u044F\u043D\u043D\u043E \u0441\u043F\u0440\u0430\u0448\u0438\u0432\u0430\u044F: \u00AB\u041F\u043E\u0447\u0435\u043C\u0443 \u044F \u0437\u0434\u0435\u0441\u044C?\u00BB \u0427\u0442\u043E \u044F \u0434\u0435\u043B\u0430\u044E \u0432 \u044D\u0442\u043E\u043C \u043C\u0438\u0440\u0435?\u00BB, \u044F \u0431\u0443\u0434\u0442\u043E \u0431\u044B \u0438\u0449\u0443 \u043F\u0440\u0438\u0447\u0438\u043D\u0443 \u0434\u043B\u044F \u0441\u043C\u0435\u0440\u0442\u0438. \u0412\u043E\u0442 \u043F\u043E\u0447\u0435\u043C\u0443 \u044F \u0438\u0433\u0440\u0430\u044E \u043D\u0430 \u0431\u0430\u0440\u0430\u0431\u0430\u043D\u0430\u0445 \u0442\u0430\u043A, \u0431\u0443\u0434\u0442\u043E \u043D\u0438\u043A\u0430\u043A\u043E\u0433\u043E \u0437\u0430\u0432\u0442\u0440\u0430 \u043D\u0435 \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0443\u0435\u0442\u00BB, \u2014 \u0433\u043E\u0432\u043E\u0440\u0438\u0442 \u0432 \u043D\u0430\u0447\u0430\u043B\u0435 \u0444\u0438\u043B\u044C\u043C\u0430 \u0401\u0441\u0438\u043A\u0438 \u0425\u0430\u044F\u0441\u0438, \u0441\u043E-\u043E\u0441\u043D\u043E\u0432\u0430\u0442\u0435\u043B\u044C \u043E\u0434\u043D\u043E\u0439 \u0438\u0437 \u0433\u043B\u0430\u0432\u043D\u044B\u0445 \u0440\u043E\u043A-\u0433\u0440\u0443\u043F\u043F \u042F\u043F\u043E\u043D\u0438\u0438, X Japan.\n\nX Japan, \u0432 \u0441\u043E\u043E\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0438\u0438 \u0441 \u043D\u0430\u0437\u0432\u0430\u043D\u0438\u0435\u043C, \u043E\u0447\u0435\u043D\u044C \u044F\u043F\u043E\u043D\u0441\u043A\u0430\u044F \u0433\u0440\u0443\u043F\u043F\u0430 \u2014 \u0432 \u0444\u0438\u043B\u044C\u043C\u0435 \u0440\u0430\u0441\u0441\u043A\u0430\u0437\u044B\u0432\u0430\u0435\u0442\u0441\u044F \u043E \u0447\u0435\u0441\u0442\u0438, \u0434\u043E\u0441\u0442\u043E\u0438\u043D\u0441\u0442\u0432\u0435, \u043F\u043E\u043F\u044B\u0442\u043A\u0430\u0445 \u0432\u044B\u0439\u0442\u0438 \u043D\u0430 \u0437\u0430\u043F\u0430\u0434\u043D\u044B\u0439 \u0440\u044B\u043D\u043E\u043A \u0438 \u0442\u043E\u043C, \u0447\u0442\u043E \u0432 \u043B\u044E\u0431\u044B\u0435 \u043C\u043E\u043C\u0435\u043D\u0442\u044B \u0436\u0438\u0437\u043D\u0438 \u0442\u044B \u0434\u043E\u043B\u0436\u0435\u043D \u0431\u044B\u0442\u044C \u0433\u043E\u0442\u043E\u0432 \u043A \u0442\u043E\u043C\u0443, \u0447\u0442\u043E\u0431\u044B \u0432\u044B\u043F\u043E\u043B\u043D\u0438\u0442\u044C \u0432\u043E\u043B\u044E \u0438\u043C\u043F\u0435\u0440\u0430\u0442\u043E\u0440\u0430. \u0412\u0441\u0435 \u043A\u0440\u0438\u0442\u0438\u043A\u0438 \u043D\u0430\u043F\u0435\u0440\u0435\u0431\u043E\u0439 \u0445\u0432\u0430\u043B\u044F\u0442 \u0433\u0440\u0443\u043F\u043F\u0443, \u043D\u0435\u043D\u0430\u0434\u043E\u043B\u0433\u043E \u043F\u043E\u044F\u0432\u043B\u044F\u044E\u0449\u0438\u0435\u0441\u044F \u0421\u0442\u044D\u043D \u041B\u0438, \u0414\u0436\u0438\u043D \u0421\u0438\u043C\u043C\u043E\u043D\u0441 \u0438 \u041C\u044D\u0440\u0438\u043B\u0438\u043D \u041C\u044D\u043D\u0441\u043E\u043D \u0441\u043A\u043B\u043E\u043D\u044F\u044E\u0442 \u0433\u043E\u043B\u043E\u0432\u0443 \u0432 \u043F\u043E\u0447\u0442\u0435\u043D\u0438\u0438, \u0444\u0430\u043D\u0430\u0442\u044B \u0431\u0435\u0437 \u0443\u043C\u0430 \u043E\u0442 \u043D\u0438\u0445, \u043D\u043E \u043D\u0430 \u0441\u0430\u043C\u043E\u043C \u0434\u0435\u043B\u0435 \u044D\u0442\u043E \u0444\u0438\u043B\u044C\u043C \u043D\u0435 \u043E\u0431 \u0443\u0441\u043F\u0435\u0445\u0435 \u0438 \u043E \u0442\u043E\u043C, \u043A\u0430\u043A \u0434\u043E\u0441\u0442\u0438\u0447\u044C \u0432 \u0436\u0438\u0437\u043D\u0438 \u0432\u0441\u0435\u0433\u043E, \u0447\u0442\u043E \u0445\u043E\u0442\u0435\u043B. \u00ABWe Are X\u00BB \u043B\u0438\u0448\u044C \u043F\u043E\u043D\u0430\u0447\u0430\u043B\u0443 \u043F\u043E\u043A\u0430\u0437\u044B\u0432\u0430\u0435\u0442 \u0442\u043E\u043B\u044C\u043A\u043E \u043F\u043E\u0434\u0433\u043E\u0442\u043E\u0432\u043A\u0443 \u043A \u0432\u0430\u0436\u043D\u043E\u043C\u0443 \u0434\u043B\u044F \u0433\u0440\u0443\u043F\u043F\u044B \u043A\u043E\u043D\u0446\u0435\u0440\u0442\u0443 \u0432 Madison Square Garden. \u0401\u0441\u0438\u043A\u0438 \u0440\u0430\u0441\u0441\u043A\u0430\u0437\u044B\u0432\u0430\u0435\u0442 \u043E \u0441\u043C\u0435\u0440\u0442\u0438 \u043E\u0442\u0446\u0430 \u0438 \u043D\u0435 \u0441\u0442\u0435\u0441\u043D\u044F\u0435\u0442\u0441\u044F \u043F\u043E\u043A\u0430\u0437\u044B\u0432\u0430\u0442\u044C \u0441\u0432\u043E\u0438 \u043F\u043E\u0445\u043E\u0434\u044B \u043F\u043E \u0432\u0440\u0430\u0447\u0430\u043C, \u043B\u0438\u0448\u044C \u0438\u043D\u043E\u0433\u0434\u0430 \u043E\u0442\u043A\u0430\u0437\u044B\u0432\u0430\u044F\u0441\u044C \u0433\u043E\u0432\u043E\u0440\u0438\u0442\u044C \u043E \u0441\u043B\u0438\u0448\u043A\u043E\u043C \u043B\u0438\u0447\u043D\u043E\u043C. \u0422\u043E\u0441\u0438, \u0432\u043E\u043A\u0430\u043B\u0438\u0441\u0442 \u0438 \u0434\u0430\u0432\u043D\u0438\u0439 \u0434\u0440\u0443\u0433 \u0401\u0441\u0438\u043A\u0438, \u043E\u0442\u043A\u0440\u043E\u0432\u0435\u043D\u043D\u043E \u043E\u0442\u0432\u0435\u0447\u0430\u0435\u0442 \u043D\u0430 \u0432\u043E\u043F\u0440\u043E\u0441\u044B \u043E \u0432\u0440\u0435\u043C\u0435\u043D\u0438, \u043F\u0440\u043E\u0432\u0435\u0434\u0451\u043D\u043D\u043E\u043C \u0432 \u0441\u0435\u043A\u0442\u0435, \u0438 \u043E \u0432\u0440\u0435\u043C\u0435\u043D\u0430\u0445, \u043A\u043E\u0433\u0434\u0430 \u0435\u043C\u0443 \u043F\u0440\u0438\u0448\u043B\u043E\u0441\u044C \u0443\u0439\u0442\u0438 \u0438\u0437 \u0433\u0440\u0443\u043F\u043F\u044B. \u041E\u0441\u0442\u0430\u043B\u044C\u043D\u044B\u0435 \u0443\u0447\u0430\u0441\u0442\u043D\u0438\u043A\u0438 \u0441\u043A\u043E\u0440\u0435\u0435 \u043E\u0441\u0442\u0430\u044E\u0442\u0441\u044F \u043D\u0430 \u0437\u0430\u0434\u043D\u0435\u043C \u043F\u043B\u0430\u043D\u0435 \u2014 \u043D\u043E \u043B\u0438\u0448\u044C \u0434\u043B\u044F \u0442\u043E\u0433\u043E, \u0447\u0442\u043E\u0431\u044B \u043F\u043E\u0434\u0447\u0435\u0440\u043A\u043D\u0443\u0442\u044C \u044D\u0442\u0443 \u0438\u0441\u0442\u043E\u0440\u0438\u044E \u043C\u043D\u043E\u0433\u043E\u043B\u0435\u0442\u043D\u0435\u0439 \u0434\u0440\u0443\u0436\u0431\u044B, \u043F\u0435\u0440\u0435\u0436\u0438\u0432\u0448\u0435\u0439 \u0441\u043C\u0435\u0440\u0442\u044C \u0431\u043B\u0438\u0437\u043A\u0438\u0445, \u0441\u0440\u044B\u0432\u044B, \u043D\u0435\u043F\u043E\u043D\u0438\u043C\u0430\u043D\u0438\u0435 \u0438 \u0441\u0441\u043E\u0440\u044B.",
