    "id": 97,
    "nameRU": "\u041E\u043B\u0435\u0433 \u0438 \u0440\u0435\u0434\u043A\u0438\u0435 \u0438\u0441\u043A\u0443\u0441\u0441\u0442\u0432\u0430",
    "nameEN": "Oleg y las raras artes",
    "director": "\u0410\u043D\u0434\u0440\u0435\u0441 \u0414\u0443\u043A\u0435",
    "country": "\u0418\u0441\u043F\u0430\u043D\u0438\u044F",
    "year": "2016",
    "duration": 70,
    "description": "\u041E\u043B\u0435\u0433 \u041A\u0430\u0440\u0430\u0432\u0430\u0439\u0447\u0443\u043A \u2013 \u0432\u0435\u043B\u0438\u043A\u0438\u0439 \u0438 \u0437\u0430\u0433\u0430\u0434\u043E\u0447\u043D\u044B\u0439 \u043A\u043E\u043C\u043F\u043E\u0437\u0438\u0442\u043E\u0440, \u0436\u0438\u0432\u0430\u044F \u0434\u043E\u0441\u0442\u043E\u043F\u0440\u0438\u043C\u0435\u0447\u0430\u0442\u0435\u043B\u044C\u043D\u043E\u0441\u0442\u044C \u041F\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0430, \u043F\u043E\u0447\u0442\u0438 \u043C\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043A\u0430\u044F \u043B\u0438\u0447\u043D\u043E\u0441\u0442\u044C \u0431\u0435\u0437 \u043F\u043E\u043B\u0430 \u0438 \u0432\u043E\u0437\u0440\u0430\u0441\u0442\u0430. \u041D\u0430 \u0441\u0430\u043C\u043E\u043C \u0434\u0435\u043B\u0435 \u0435\u043C\u0443 89, \u043D\u043E \u043F\u043E\u043F\u0440\u043E\u0431\u0443\u0439\u0442\u0435 \u0432 \u044D\u0442\u043E \u043F\u043E\u0432\u0435\u0440\u0438\u0442\u044C, \u0433\u043B\u044F\u0434\u044F \u043D\u0430 \u044D\u0442\u043E\u0433\u043E \u0432\u0435\u0447\u043D\u043E\u0433\u043E \u0433\u0443\u0442\u0442\u0430\u043F\u0435\u0440\u0447\u0435\u0432\u043E\u0433\u043E \u043C\u0430\u043B\u044C\u0447\u0438\u043A\u0430. \u0412\u044B\u0445\u043E\u0434\u0435\u0446 \u0438\u0437 \u0412\u0435\u043D\u0435\u0441\u0443\u044D\u043B\u044B \u0410\u043D\u0434\u0440\u0435\u0441 \u0414\u044E\u043A\u0435 \u0441\u043E\u0432\u0435\u0440\u0448\u0438\u043B \u0430\u0431\u0441\u043E\u043B\u044E\u0442\u043D\u044B\u0439 \u0440\u0435\u0436\u0438\u0441\u0441\u0435\u0440\u0441\u043A\u0438\u0439 \u043F\u043E\u0434\u0432\u0438\u0433, \u0443\u0433\u043E\u0432\u043E\u0440\u0438\u0432 \u0432\u0435\u0447\u043D\u043E \u0443\u0441\u043A\u043E\u043B\u044C\u0437\u0430\u044E\u0449\u0435\u0433\u043E \u041A\u0430\u0440\u0430\u0432\u0430\u0439\u0447\u0443\u043A\u0430 \u043D\u0430 \u043F\u043E\u043B\u043D\u043E\u0446\u0435\u043D\u043D\u044B\u0435 \u0441\u044A\u0435\u043C\u043A\u0438. \u0412 \u0433\u0435\u043E\u043C\u0435\u0442\u0440\u0438\u0447\u0435\u0441\u043A\u0438 \u0432\u044B\u0441\u0442\u0440\u043E\u0435\u043D\u043D\u044B\u0445 \u043F\u0440\u043E\u0445\u043E\u0434\u0430\u0445 \u043F\u043E \u042D\u0440\u043C\u0438\u0442\u0430\u0436\u0443 \u041E\u043B\u0435\u0433 \u041D\u0438\u043A\u043E\u043B\u0430\u0435\u0432\u0438\u0447 \u2013 \u0443\u0441\u0442\u0430\u043B\u044B\u0439 \u043F\u0443\u0442\u043D\u0438\u043A, \u0438\u0437\u0432\u043B\u0435\u043A\u0430\u044E\u0449\u0438\u0439 \u044D\u043D\u0435\u0440\u0433\u0438\u044E \u0438\u0437 \u0438\u0441\u043A\u0443\u0441\u0441\u0442\u0432\u0430 \u0434\u0440\u0435\u0432\u043D\u0438\u0445 \u043C\u0438\u0440\u043E\u0432, \u0442\u043E\u0433\u043E \u0435\u0441\u0442\u0435\u0441\u0442\u0432\u0435\u043D\u043D\u043E\u0433\u043E \u00AB\u043D\u043E\u0432\u0430\u0442\u043E\u0440\u0441\u0442\u0432\u0430, \u043A\u043E\u0442\u043E\u0440\u043E\u0435 \u043D\u0435 \u0434\u043E\u043C\u0438\u043D\u0438\u0440\u0443\u0435\u0442\u00BB, \u0438 \u0446\u0435\u043D\u0438\u0442\u0435\u043B\u044C \u0438\u043C\u043F\u0435\u0440\u0441\u043A\u043E\u0439 \u043A\u0440\u0430\u0441\u043E\u0442\u044B, \u043E\u0431\u044A\u0441\u043D\u044F\u044E\u0449\u0438\u0439\u0441\u044F \u0432 \u043B\u044E\u0431\u0432\u0438 \u0415\u043A\u0430\u0442\u0435\u0440\u0438\u043D\u0435, \u00AB\u0432\u043B\u0430\u0433\u0430\u043B\u0438\u0449\u0443 \u043C\u0438\u0440\u043E\u0437\u0434\u0430\u043D\u0438\u044F\u00BB. \u0412 \u043F\u0440\u043E\u0433\u0443\u043B\u043A\u0430\u0445 \u043F\u043E \u041A\u043E\u043C\u0430\u0440\u043E\u0432\u043E \u2013 \u0432\u043E\u0440\u0447\u043B\u0438\u0432\u044B\u0439 \u0438 \u0430\u0440\u0440\u043E\u0433\u0430\u043D\u0442\u043D\u044B\u0439 \u0441\u0442\u0430\u0440\u0438\u043A, \u0434\u043E\u0431\u0440\u044B\u043C \u0441\u043B\u043E\u0432\u043E\u043C \u043F\u043E\u043C\u0438\u043D\u0430\u044E\u0449\u0438\u0439 \u0421\u0442\u0430\u043B\u0438\u043D\u0430 (\u00AB\u043E\u043D \u0432\u044B\u0438\u0433\u0440\u0430\u043B \u0432\u043E\u0439\u043D\u0443 \u0438 \u0442\u0432\u043E\u0440\u0447\u0435\u0441\u0442\u0432\u043E\u00BB) \u0438 \u043C\u0435\u0447\u0442\u0430\u044E\u0449\u0438\u0439 \u0434\u043E\u0436\u0438\u0442\u044C \u0434\u043E \u0421\u0442\u0440\u0430\u0448\u043D\u043E\u0433\u043E \u0441\u0443\u0434\u0430, \u043A\u043E\u0433\u0434\u0430 \u043D\u0435\u043F\u0440\u0438\u044F\u0442\u043D\u044B\u0435 \u0441\u043E\u0441\u0435\u0434\u0438 \u0438\u0441\u0447\u0435\u0437\u043D\u0443\u0442 \u0441 \u043B\u0438\u0446\u0430 \u0437\u0435\u043C\u043B\u0438, \u0430 \u0441\u0440\u0443\u0431\u043B\u0435\u043D\u043D\u044B\u0435 \u0438\u043C\u0438 \u0435\u043B\u0438 \u0432\u043E\u0437\u0440\u043E\u0434\u044F\u0442\u0441\u044F \u0438\u0437 \u043C\u0435\u0440\u0442\u0432\u044B\u0445. \u041D\u043E \u0433\u043B\u0430\u0432\u043D\u044B\u0435 \u044D\u043F\u0438\u0437\u043E\u0434\u044B \u2013 \u0442\u0435, \u0433\u0434\u0435 \u041A\u0430\u0440\u0430\u0432\u0430\u0439\u0447\u0443\u043A \u0438\u0433\u0440\u0430\u0435\u0442 \u0441\u0432\u043E\u0438 \u00AB\u043D\u0435\u0443\u0434\u043E\u0431\u043D\u044B\u0435, \u043D\u043E \u0433\u0435\u043D\u0438\u0430\u043B\u044C\u043D\u044B\u0435\u00BB \u043C\u0435\u043B\u043E\u0434\u0438\u0438, \u0438 \u0440\u0443\u043A\u0438 \u043C\u0443\u0437\u044B\u043A\u0430\u043D\u0442\u0430, \u0432\u0441\u0442\u0443\u043F\u0430\u044F \u0432 \u043A\u043E\u043D\u0442\u0430\u043A\u0442 \u0441 \u043A\u043B\u0430\u0432\u0438\u0448\u0430\u043C\u0438, \u0431\u0443\u0434\u0442\u043E \u043E\u0442\u0434\u0435\u043B\u044F\u044E\u0442\u0441\u044F \u043E\u0442 \u0442\u0435\u043B\u0430 \u0438 \u043F\u0440\u0435\u0432\u0440\u0430\u0449\u0430\u044E\u0442\u0441\u044F \u0432 \u043D\u043E\u0432\u044B\u0439, \u0438\u043D\u043E\u043F\u043B\u0430\u043D\u0435\u0442\u043D\u044B\u0439 \u043E\u0440\u0433\u0430\u043D\u0438\u0437\u043C.",
