    "id": 100,
    "nameRU": "\u0417\u0438\u0433\u0433\u0438 \u0417\u0432\u0451\u0437\u0434\u043D\u0430\u044F \u041F\u044B\u043B\u044C \u0438 \u043F\u0430\u0443\u043A\u0438 \u0441 \u041C\u0430\u0440\u0441\u0430",
    "nameEN": " Ziggy Stardust and the Spiders from Mars",
    "director": " \u0414.\u0410. \u041F\u0435\u043D\u043D\u0435\u0431\u0435\u0439\u043A\u0435\u0440",
    "country": "\u0412\u0435\u043B\u0438\u043A\u043E\u0431\u0440\u0438\u0442\u0430\u043D\u0438\u044F",
    "year": "1973",
    "duration": 90,
    "description": "3 \u0438\u044E\u043B\u044F 1973 \u0433\u043E\u0434\u0430 \u0414\u044D\u0432\u0438\u0434 \u0411\u043E\u0443\u0438 \u0432\u044B\u0448\u0435\u043B \u043D\u0430 \u0441\u0446\u0435\u043D\u0443 \u043B\u043E\u043D\u0434\u043E\u043D\u0441\u043A\u043E\u0433\u043E Hammersmith Odeon, \u0447\u0442\u043E\u0431\u044B \u0434\u0430\u0442\u044C \u0441\u0432\u043E\u0439 \u043F\u043E\u0441\u043B\u0435\u0434\u043D\u0438\u0439 \u043A\u043E\u043D\u0446\u0435\u0440\u0442 \u0432 \u043E\u0431\u0440\u0430\u0437\u0435 \u0417\u0438\u0433\u0433\u0438 \u0421\u0442\u0430\u0440\u0434\u0430\u0441\u0442\u0430. \u041E \u0442\u043E\u043C, \u0447\u0442\u043E \u044D\u0442\u043E \u043F\u0440\u043E\u0449\u0430\u043B\u044C\u043D\u043E\u0435 \u0432\u044B\u0441\u0442\u0443\u043F\u043B\u0435\u043D\u0438\u0435 \u043A\u043E\u0441\u043C\u0438\u0447\u0435\u0441\u043A\u043E\u0433\u043E \u043C\u0435\u0441\u0441\u0438\u0438, \u043D\u0435 \u0437\u043D\u0430\u043B \u0437\u0430\u0440\u0430\u043D\u0435\u0435 \u043D\u0438\u043A\u0442\u043E, \u0432\u043A\u043B\u044E\u0447\u0430\u044F \u043C\u0443\u0437\u044B\u043A\u0430\u043D\u0442\u043E\u0432 \u0433\u0440\u0443\u043F\u043F\u044B \u0438 \u0440\u0435\u0436\u0438\u0441\u0441\u0435\u0440\u0430 \u0414.\u0410. \u041F\u0435\u043D\u043D\u0431\u0435\u0439\u043A\u0435\u0440\u0430, \u043A\u043E\u0442\u043E\u0440\u044B\u0439 \u0432\u043E\u043E\u0431\u0449\u0435-\u0442\u043E \u043F\u0440\u0438\u0448\u0435\u043B \u0442\u0443\u0434\u0430 \u0441\u043D\u044F\u0442\u044C \u0434\u0432\u0430\u0434\u0446\u0430\u0442\u0438\u043C\u0438\u043D\u0443\u0442\u043D\u044B\u0439 \u043F\u0440\u043E\u043C\u043E\u0444\u0438\u043B\u044C\u043C, \u043D\u043E, \u0443\u0432\u0438\u0434\u0435\u0432 \u0411\u043E\u0443\u0438 \u043D\u0430 \u0441\u0446\u0435\u043D\u0435, \u043E\u0441\u0442\u0430\u043B\u0441\u044F \u0438 \u0437\u0430\u043F\u0435\u0447\u0430\u0442\u043B\u0435\u043B \u0432\u0441\u0435, \u0432\u043A\u043B\u044E\u0447\u0430\u044F \u0431\u0435\u0441\u0447\u0438\u0441\u043B\u0435\u043D\u043D\u044B\u0435 \u043D\u0430\u0440\u044F\u0434\u044B \u0430\u0440\u0442\u0438\u0441\u0442\u0430 \u0438 \u043F\u043E\u043B\u0443\u0436\u0438\u0432\u044B\u0435 \u043E\u0442 \u0441\u0447\u0430\u0441\u0442\u044C\u044F \u0442\u043E\u043B\u043F\u044B \u0444\u0430\u043D\u0430\u0442\u043E\u0432 \u0432 \u043F\u0430\u0440\u0442\u0435\u0440\u0435.\n\n\u00AB\u0417\u0438\u0433\u0433\u0438 \u0421\u0442\u0430\u0440\u0434\u0430\u0441\u0442\u00BB \u2014 \u044D\u0442\u043E \u043F\u0430\u043C\u044F\u0442\u043D\u0438\u043A \u043D\u0430 \u044D\u043A\u0440\u0430\u043D\u0435, \u0441\u043E\u0437\u0434\u0430\u043D\u043D\u044B\u0439 \u043F\u0440\u0438 \u0436\u0438\u0437\u043D\u0438, \u043F\u043E\u0447\u0442\u0438 \u0441\u043B\u0443\u0447\u0430\u0439\u043D\u0430\u044F \u0438 \u0432\u043F\u043E\u043B\u043D\u0435 \u0443\u0434\u0430\u0447\u043D\u0430\u044F \u043F\u043E\u043F\u044B\u0442\u043A\u0430 \u0443\u0445\u0432\u0430\u0442\u0438\u0442\u044C \u043B\u0438\u0446\u043E \u0433\u0435\u0440\u043E\u044F, \u043F\u043E\u0441\u0442\u043E\u044F\u043D\u043D\u043E \u043C\u0435\u043D\u044F\u044E\u0449\u0435\u0433\u043E \u043E\u0431\u043B\u0438\u0447\u044C\u0435. \u0421\u0442\u0430\u0432\u0448\u0438\u0439 \u0441\u0435\u0433\u043E\u0434\u043D\u044F \u043A\u043B\u0430\u0441\u0441\u0438\u043A\u043E\u0439 \u0434\u043E\u043A\u0443\u043C\u0435\u043D\u0442\u0430\u043B\u044C\u043D\u043E\u0433\u043E \u043A\u0438\u043D\u043E \u043A\u043E\u043D\u0446\u0435\u0440\u0442\u043D\u044B\u0439 \u0444\u0438\u043B\u044C\u043C \u041F\u0435\u043D\u043D\u0435\u0431\u0435\u0439\u043A\u0435\u0440 \u0432 \u0438\u0442\u043E\u0433\u0435 \u0440\u0430\u0437\u0431\u0430\u0432\u0438\u043B \u043B\u0438\u0448\u044C \u043D\u0435\u0441\u043A\u043E\u043B\u044C\u043A\u0438\u043C\u0438 \u0434\u0443\u0431\u043B\u044F\u043C\u0438 \u0430\u0440\u0442\u0438\u0441\u0442\u0430 \u0437\u0430 \u0441\u0446\u0435\u043D\u043E\u0439. \u0418\u0445, \u0432\u043F\u0440\u043E\u0447\u0435\u043C, \u0434\u043E\u0441\u0442\u0430\u0442\u043E\u0447\u043D\u043E \u0434\u043B\u044F \u0442\u043E\u0433\u043E, \u0447\u0442\u043E\u0431\u044B \u043E\u0431\u043E\u0437\u043D\u0430\u0447\u0438\u0442\u044C \u0442\u043E\u0442 \u0441\u0430\u043C\u044B\u0439 \u0437\u0430\u0437\u043E\u0440, \u043A\u043E\u0442\u043E\u0440\u044B\u0439 \u0441\u043E\u0437\u0434\u0430\u0432\u0430\u043B \u0432 \u0411\u043E\u0443\u0438 \u0431\u0435\u0448\u0435\u043D\u044B\u0439 \u043C\u0430\u0433\u043D\u0435\u0442\u0438\u0437\u043C \u2014 \u0437\u0430\u0437\u043E\u0440 \u043C\u0435\u0436\u0434\u0443 \u043F\u0435\u0440\u0441\u043E\u043D\u0430\u0436\u0435\u043C \u0438 \u0447\u0435\u043B\u043E\u0432\u0435\u043A\u043E\u043C, \u043E\u0442 \u043A\u043E\u0442\u043E\u0440\u043E\u0433\u043E \u0442\u0440\u0443\u0434\u043D\u043E \u043E\u0442\u0432\u0435\u0441\u0442\u0438 \u0432\u0437\u0433\u043B\u044F\u0434.",
